hild\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"Matt: Futuristic Predictions\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44568\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://ma.tt/2015/01/futuristic-predictions/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:336:\"<p>Yesterday&#8217;s post was a bit of a downer, so here io9 lists <a href=\"http://io9.com/the-most-futuristic-predictions-that-came-true-in-2014-1674887659\">The Most Futuristic Predictions That Came True In 2014</a>, including technologically-assisted telepathy, 3d printing in space, laser weapons, and landing a robot on a comet.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 14 Jan 2015 15:15:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"WPTavern: Justin Tadlock Joins Forces with Emil Uzelac to Provide WordPress Theme Review as a Service\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=37204\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"http://wptavern.com/justin-tadlock-joins-forces-with-emil-uzelac-to-provide-wordpress-theme-review-as-a-service\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5464:\"<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/red-pen.jpg\" rel=\"prettyphoto[37204]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/red-pen.jpg?resize=1024%2C500\" alt=\"photo credit: pollas - cc\" class=\"size-full wp-image-37241\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/pollas/526544001/\">pollas</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-sa/2.0/\">cc</a>\n<p>Last week, Emil Uzelac <a href=\"http://wptavern.com/emil-uzelac-launches-new-wordpress-theme-review-service\" target=\"_blank\">launched a new theme review service</a> targeted at WordPress developers and companies that want their products to adhere to best practices. Just one week after launch, <a href=\"http://justintadlock.com/\" target=\"_blank\">Justin Tadlock</a>, a fellow member of the WordPress.org theme review team and author of the <a href=\"http://themehybrid.com/hybrid-core\" target=\"_blank\">Hybrid Core</a> framework, is joining forces with Uzelac to provide professional reviews to customers.</p>\n<p>&#8220;I’m interested in seeing where this goes. We (DevPress when I was there) were going to offer this service. It never took off because the business itself didn’t,&#8221; Tadlock <a href=\"http://wptavern.com/emil-uzelac-launches-new-wordpress-theme-review-service#comment-62455\" target=\"_blank\">commented</a> on the original announcement. In the past he has conducted paid reviews privately for commercial theme vendors. Uzelac noticed his interest and pounced on the opportunity to partner with him.</p>\n<p>&#8220;To quote one of my all time favorite businessman, J.C. Penney: &#8216;Growth is never by mere chance; it is the result of forces working together,\'&#8221; Uzelac said. &#8220;Justin and I exchanged a few ideas in my launching interview and that is where I learned from Jeff that he had this idea back in 2011.&#8221;</p>\n<p>Since this idea has been on Tadlock&#8217;s mind for several years, he didn&#8217;t hesitate to get involved. &#8220;It&#8217;s something I pretty much immediately hopped on.  We already have a bit of a working relationship as admins for the Theme Review Team.  I believe it&#8217;s a good fit,&#8221; he said.</p>\n<p>Based on his <a href=\"http://wptavern.com/justin-tadlock-publishes-the-results-of-his-themeforest-experiment\" target=\"_blank\">experience at ThemeForest</a> and his service on the WordPress.org Theme Review Team, Tadlock is convinced that developers of all experience levels can benefit from professional theme review:</p>\n<blockquote><p>Professional theme authors who want to bring the highest quality theme to market need assurance that their code is solid. There&#8217;s nothing worse than spending months building an awesome theme only to have it break for a bunch of users because you missed something minor.  Even the most experienced theme authors (myself included) overlook problems that a fresh, second pair of eyes could easily find.  We have editors for books, newspapers, and so on for the same reason.  Authors, whether they&#8217;re writers or theme developers, are going to miss something.</p></blockquote>\n<p>Although themes have always been critical to the success of WordPress, theme review is just now emerging as a service for which one might want to hire a dedicated professional. Tadlock attributes this to the increasing complexity of theme development. &#8220;Themes are a lot more complex than they were just 5 years ago, for example.  This isn&#8217;t just because theme authors are packing in more stuff,&#8221; he said.</p>\n<p>&#8220;Part of it is because basic WordPress theme development has gotten more complex. WordPress has been packing in a lot of new things in recent years, and themes need to account for a variety of possibilities. Just having someone running through unit tests will be a big help.&#8221;</p>\n<p>Several readers commented on the original announcement to suggest that Uzelac consider offering a certification or badge of some sort for commercial theme authors to display once their themes have passed a professional review. Tadlock is open to the idea but sees it more as a marketing tool for their customers to employ.</p>\n<p>&#8220;That&#8217;s probably a good idea, but I don&#8217;t think that&#8217;s what really matters,&#8221; he said. &#8220;I think the focus should be on giving our clients (theme devs) peace of mind.  Once we are seen as a legit and well-known service, a badge or something will most likely become a useful marketing tool for theme authors.&#8221;</p>\n<p><a href=\"http://themereview.co/\" target=\"_blank\">The Theme Review service</a> has already gained traction, and Uzelac reports that he completed his fourth review today. &#8220;I&#8217;ve taken only what I could handle alone and in time. Now that Justin is in, we will do more,&#8221; he said. &#8220;In only few days after the initial launch the response and support has been overwhelming. This confirms that our community is in great need of experienced reviewers.&#8221;</p>\n<p>When it comes to WordPress theme review skills and experience, Uzelac and Tadlock&#8217;s forces combined are unparalleled in the WordPress community. Tadlock hopes that together they can expand their efforts to serve more commercial theme providers. &#8220;I&#8217;d like to see regular business from some of the major theme shops,&#8221; he said. &#8220;That&#8217;s probably the biggest goal I&#8217;d shoot for at the moment.&#8221;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Jan 2015 23:41:21 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"WPTavern: VersionPress RC1 Released to Early Backers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=37215\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"http://wptavern.com/versionpress-rc1-released-to-early-backers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3708:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/VersionPressFeaturedImage.png\" rel=\"prettyphoto[37215]\"><img class=\"size-full wp-image-24643\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/06/VersionPressFeaturedImage.png?resize=650%2C200\" alt=\"Version Control Featured Image\" /></a>Version Control Featured Image\n<p><a title=\"http://versionpress.net/\" href=\"http://versionpress.net/\">VersionPress</a>, the plugin that allows you to <a title=\"http://wptavern.com/versionpress-hopes-to-bring-version-control-to-the-masses\" href=\"http://wptavern.com/versionpress-hopes-to-bring-version-control-to-the-masses\">revert changes to a site</a> without having to restore a backup, is <a title=\"http://blog.versionpress.net/2015/01/announcing-early-access-program/\" href=\"http://blog.versionpress.net/2015/01/announcing-early-access-program/\">being released</a> to early backers. Near the middle of 2014, VersionPress creators <a href=\"https://twitter.com/borekb\">Borek Bernard</a> and <a href=\"https://twitter.com/JanVoracek\">Jan Voráček</a> created a crowdfunding campaign asking for $30K.</p>\n<p>The campaign started off on a rocky note, as several readers <a title=\"http://wptavern.com/versionpress-adopts-the-gpl-software-license\" href=\"http://wptavern.com/versionpress-adopts-the-gpl-software-license\">questioned what license</a> the plugin would use. Bernard decided to license the plugin using the GPLv2, but the decision was made near the middle of the campaign and the duo missed their goal by $14.5K. However, development continued and, for the past several months, the team has been hard at work getting the product to a point where people can start using it.</p>\n<p>A release candidate will be made available later this week to those who backed the project with $50 or more. If no major issues are reported, the team will release version 1.0 by the end of the month. However, the plugin will not be free to use. Those who want access to version 1.0 and future releases will need to join the <a title=\"http://versionpress.net/#get\" href=\"http://versionpress.net/#get\">early access program</a>. The program tries to strike a balance between making the plugin accessible to anyone who&#8217;s interested and funding development.</p>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/VersionPressEarlyAccessProgramPrices.png\" rel=\"prettyphoto[37215]\"><img class=\"size-full wp-image-37221\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/VersionPressEarlyAccessProgramPrices.png?resize=956%2C308\" alt=\"VersionPress Early Access Program Prices\" /></a>Early Access Program Prices\n<p>VersionPress 1.0 is an initial release and won&#8217;t have all of the planned features such as sync and staging. Instead, those features will be rolled out in future versions of the product. According to their development plan:</p>\n<ul type=\"disc\">\n<li>Version <strong>1.0</strong> will contain all the important <strong>basics</strong> – things like <strong>Undo</strong>, <strong>Rollback</strong>, <strong>automatic change tracking</strong>, support for all the built-in WordPress types, etc.</li>\n<li>Version <strong>2.0</strong> will bring full support for <strong>sync and staging</strong>.</li>\n<li>Versions <strong>3.0</strong>, <strong>4.0</strong> etc. will bring features from the <a href=\"http://docs.versionpress.net/en/release-notes/roadmap\">roadmap</a>.</li>\n</ul>\n<p>I&#8217;m happy to see the duo remain committed to their goal of developing and shipping a working product. I still think VersionPress is a great idea and can&#8217;t wait to see how easy or difficult it is to use. Look for a thorough review on the Tavern sometime in February.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Jan 2015 21:31:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"WPTavern: Is 2015 The Year of WordPress Admin Themes?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=37098\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"http://wptavern.com/is-2015-the-year-of-wordpress-admin-themes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3370:\"<p>The CPO and partner of <a title=\"http://hmn.md/\" href=\"http://hmn.md/\">Human Made</a>, Noel Tock, <a title=\"https://medium.com/@noeltock/wordpress-in-2015-ed6a4674a608\" href=\"https://medium.com/@noeltock/wordpress-in-2015-ed6a4674a608\">published</a> his WordPress predictions for 2015. His predictions include, custom dashboards, front-end editing, internationalization, and more. This could be the year of admin themes, but I think it largely depends on whether the <a title=\"https://github.com/WP-API/WP-API\" href=\"https://github.com/WP-API/WP-API\">WP API</a> is merged into core.</p>\n<p>Tock predicts we&#8217;ll see a substantial increase in different WordPress backend experiences. Although there are implementations like <a title=\"http://www.happytables.com/\" href=\"http://www.happytables.com/\">Happytables</a> and <a title=\"http://jettyapp.com/\" href=\"http://jettyapp.com/\">Jetty</a> which use the WP API, I don&#8217;t think we&#8217;ll see a lot of adoption until it&#8217;s vetted and merged into core.</p>\n<p>Regarding custom dashboard experiences, Tock makes a great point when he says:</p>\n<blockquote><p>For the most part, premium custom dashboards will fail. If it’s too generic, it likely can’t compete with WP-Admin (which actively pursues <em class=\"markup--em markup--li-em\">one size fits all). </em>On the other hand, if it’s too niche or not very extendable, it won’t be of much use either. A minimal small business dashboard with front-end editing will likely be the most popular seller.</p></blockquote>\n<p>Additionally, I think his advice to those looking to experiment with the API should be considered, &#8220;Don’t create a custom dashboard because you want to change the way it looks, change it because you significantly want to improve the experience of <em class=\"markup--em markup--p-em\">your </em>users.&#8221;</p>\n<p>Jason Schuller&#8217;s admin design for <a title=\"http://wptavern.com/jason-schuller-to-re-enter-wordpress-theme-market-with-niche-admin-designs\" href=\"http://wptavern.com/jason-schuller-to-re-enter-wordpress-theme-market-with-niche-admin-designs\">Pickle</a> is a great example of a backend that correlates with what&#8217;s on the frontend. Everything that&#8217;s unnecessary to manage the frontend of the site is removed from the backend, creating a streamlined experience.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/pickle-admin.jpg\" rel=\"prettyphoto[37098]\"><img class=\"wp-image-32235 size-full\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/10/pickle-admin.jpg?resize=964%2C520\" alt=\"pickle-admin\" /></a>WordPress Backend For The Pickle Theme\n<p>The WP API will make it easy for developers to create a variety of different admin experiences, but users will ultimately decide which implementation is right for them. We may even see an entire category added to the <a title=\"https://wordpress.org/themes/\" href=\"https://wordpress.org/themes/\">WordPress theme directory</a> for admin themes.</p>\n<p>Whether the API is merged this year or next, custom admin themes are inevitable. In the future, there will likely be an admin theme that matches the way you use WordPress to harmonize the user experience. What that theme looks like is anyone&#8217;s guess, but I&#8217;m looking forward to reviewing custom admin experiences created by developers using the API.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Jan 2015 21:18:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"WPTavern: Better Notifications Plugin for WordPress Now Out of Beta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=37180\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"http://wptavern.com/better-notifications-plugin-for-wordpress-now-out-of-beta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4881:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/better-notifications-for-wordpress-featured.png\" rel=\"prettyphoto[37180]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/better-notifications-for-wordpress-featured.png?resize=660%2C300\" alt=\"better-notifications-for-wordpress-featured\" class=\"aligncenter size-full wp-image-37196\" /></a></p>\n<p>The beta version of the <a href=\"https://wordpress.org/plugins/bnfw/\" target=\"_blank\">Better Notifications for WordPress</a> plugin was released last year, and it lay dormant for many months while its original collaborators searched for a new developer. The plugin was created to allow you to send customizable HTML emails to users based on different actions in WordPress.</p>\n<p>Jack McConnell, founder of development agency <a href=\"http://www.voltronik.co.uk/\" target=\"_blank\">Voltronik</a>, commissioned the plugin to be built while creating <a href=\"http://www.voltronik.co.uk/case-studies/building-web-app-wordpress-re-imagining-bespoke-project-management-system/\" target=\"_blank\">a custom project management system</a> on top of WordPress. &#8220;One of the requirements was for notifications of new projects (WordPress categories) via email. I couldn&#8217;t find a plugin that sent notifications for events such as these, so I decided to write my own,&#8221; McConnell said. He worked with a developer to push the beta out over the course of a weekend, but that&#8217;s as far as it went last year.</p>\n<p>After finding a new developer, McConnell was able to get the plugin out of beta and develop a roadmap for future releases. Version 1.0 is a major overhaul and a complete re-write of the plugin. New features include:</p>\n<ul>\n<li>Auto-importer: Your old notifications will be imported when updating the plugin</li>\n<li>New &#8216;Generator&#8217; for easily creating and editing your notifications</li>\n<li>More options and notification types as per feedback via the forums</li>\n<li>Granular control over choosing either user roles or individual users you&#8217;d like to send a notification to</li>\n<li>Fully translatable</li>\n</ul>\n<p>Each email can be customized using HTML, CSS, and Voltronik&#8217;s extensive list of <a href=\"http://www.voltronik.co.uk/wordpress-plugins/better-notifications-for-wordpress-shortcodes/\" target=\"_blank\">shortcodes</a>, which means you can add your site&#8217;s logo, a simple design, and all kinds of content to the emails. You can also set the notifications to go to selected individual users or limit the notifications based on user roles.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/better-notifications-for-wordpress.png\" rel=\"prettyphoto[37180]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/better-notifications-for-wordpress.png?resize=806%2C534\" alt=\"better-notifications-for-wordpress\" class=\"aligncenter size-full wp-image-37190\" /></a></p>\n<p>In addition to customizing WordPress&#8217; default notification emails (i.e. new  comments, registrations, password reset), the plugin adds options for the following:</p>\n<ul>\n<li>New category</li>\n<li>New post updated, published</li>\n<li>New [custom post type] updated, published, pending review</li>\n<li>Custom taxonomy &#8211; new term added</li>\n</ul>\n<p>Better Notifications for WordPress adds notification customization options for every custom post type you have registered on your site, which can be very useful if your CPT-based plugins don&#8217;t include notifications.</p>\n<p>If you&#8217;re trying to keep a tight rein on new category creation, this plugin will help keep you in the loop. It also makes it easy to brand your site communications better as an alternative to WordPress&#8217; ugly notification emails. The plugin was built to fit into WordPress like a natural part of the admin.</p>\n<p>McConnell identifies other scenarios where Better Notifications might be useful:</p>\n<ul>\n<li>Outreach: A blog/news site with hundreds of subscribers &#8211; use it to alert them of new blog posts</li>\n<li>Communication: A small, internal WordPress site &#8211; use it to alert staff of new posts and comments</li>\n<li>Monitor: A website for a new product or service &#8211; use it for notifications of pingbacks and trackbacks</li>\n<li>Security: To receive alerts of password reset requests and their corresponding email address</li>\n</ul>\n<p>If you need greater control and customization over WordPress&#8217; email notifications, this plugin handles just about every kind of notice on actions related to publishing. It&#8217;s well on its way to becoming a comprehensive tool and McConnell and his team are eager to improve the plugin based on user feedback. <a href=\"https://wordpress.org/plugins/bnfw/\" target=\"_blank\">Better Notifications for WordPress</a> version 1.0 is now available for download on WordPress.org.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Jan 2015 19:58:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"Post Status: GravityView raises the bar for WordPress video advertisements\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7332\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"https://poststatus.com/gravityview-songadaymann/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1092:\"<p>Okay, maybe it doesn&#8217;t raise the bar the way you think I mean. But this is worthwhile.</p>\n<p>I&#8217;m pretty busy building the new Post Status infrastructure, but not too busy to post this.</p>\n<p><a href=\"https://gravityview.co/\">GravityView</a> is a WordPress plugin by Zack Katz and Katz Web Services that lists Gravity Forms entries on your site in a nice way. It&#8217;s a slick plugin I&#8217;ve been meaning to dig further into since I learned about it at a WordCamp a few months back.</p>\n<p>Nevertheless, the folks behind GravityView have hired <a href=\"https://twitter.com/songadaymann\">@songadaymann</a>, <a href=\"http://jonathanmann.net/about/\">Jonathan Mann</a>, to create a new video for them, and it is&#8230; unforgettable.</p>\n<p></p>\n<p>I mean, I told you.</p>\n<p>This is the type of &#8220;hey this is funny / quirky&#8221; will probably better qualify for the members only newsletter in the future. But while I&#8217;m <a href=\"https://poststatus.com/club/\" title=\"Post Status Membership Club\">building that out</a>, you all get this nugget of fun for free.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Jan 2015 19:28:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"Matt: Limits to Growth\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44525\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"http://ma.tt/2015/01/limits-to-growth/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:637:\"<p>&#8220;They modelled data up to 1970, then developed a range of scenarios out to 2100, depending on whether humanity took serious action on environmental and resource issues. [&#8230;] The book’s central point, much criticised since, is that “the earth is finite” and the quest for unlimited growth in population, material goods etc would eventually lead to a crash. So were they right?&#8221; The answer lies in <a href=\"http://www.theguardian.com/commentisfree/2014/sep/02/limits-to-growth-was-right-new-research-shows-were-nearing-collapse\">Limits to Growth was right. New research shows we&#8217;re nearing collapse</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Jan 2015 19:19:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"Ping-O-Matic: A Prompt a Day\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"http://blog.pingomatic.com/?p=115\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"http://blog.pingomatic.com/2015/01/13/a-prompt-a-day/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1387:\"<p><a href=\"http://pingomatic.com/\" target=\"_blank\">Ping-O-Matic</a> is all about getting your latest content out into the world and driving more traffic to your blog. Sometimes, though, we need inspiration to write.</p>\n<p>Our friends at <em><a href=\"http://dailypost.wordpress.com\" target=\"_blank\">The Daily Post</a></em> published a free ebook of daily prompts: a gentle nudge to encourage a regular blogging habit. It&#8217;s available in four languages: <strong>English</strong>, <strong>French</strong>, <strong>Spanish</strong>, and <strong>Indonesian</strong>:</p>\n<p><a href=\"https://dailypost.wordpress.com/postaday/ebook-365-writing-prompts/\" target=\"_blank\">Ebook: 365 Writing Prompts</a></p>\n<p><a href=\"https://dailypost.wordpress.com/postaday/ebook-365-writing-prompts/\"><img class=\" size-large wp-image-116 aligncenter\" src=\"https://pingomatic.files.wordpress.com/2015/01/ebook-365-featured-2.png?w=600&h=178\" alt=\"ebook-365-featured 2\" /></a></p>\n<p>Download the version you need &#8212; it&#8217;s free!</p><br />  <a rel=\"nofollow\" href=\"http://feeds.wordpress.com/1.0/gocomments/pingomatic.wordpress.com/115/\"><img alt=\"\" border=\"0\" src=\"http://feeds.wordpress.com/1.0/comments/pingomatic.wordpress.com/115/\" /></a> <img alt=\"\" border=\"0\" src=\"http://pixel.wp.com/b.gif?host=blog.pingomatic.com&blog=68432&post=115&subd=pingomatic&ref=&feed=1\" width=\"1\" height=\"1\" />\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Jan 2015 18:16:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:20:\"Cheri Lucas Rowlands\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"WPTavern: How to Customize The Body and Title Font in WordPress Default Themes Without Touching Code\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=37158\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:110:\"http://wptavern.com/how-to-customize-the-body-and-title-font-in-wordpress-default-themes-without-touching-code\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3147:\"<p>WordPress 4.1 ships with three default themes, <a title=\"https://wordpress.org/themes/twentythirteen\" href=\"https://wordpress.org/themes/twentythirteen\">Twenty Thirteen</a>, <a title=\"https://wordpress.org/themes/twentyfourteen\" href=\"https://wordpress.org/themes/twentyfourteen\">Twenty Fourteen</a>, and <a title=\"https://wordpress.org/themes/twentyfifteen\" href=\"https://wordpress.org/themes/twentyfifteen\">Twenty Fifteen</a>. Although the theme customizer enables you to edit a default theme&#8217;s colors, header image, and other attributes, it doesn&#8217;t give you the ability to change the body and title fonts. If you&#8217;d like to easily change fonts in a default theme using the customizer without using code, try the <a title=\"https://wordpress.org/plugins/styleguide/\" href=\"https://wordpress.org/plugins/styleguide/\">Styleguide plugin</a> created by <a title=\"http://www.binarymoon.co.uk/\" href=\"http://www.binarymoon.co.uk/\">Ben Gillbanks</a>.</p>\n\n<a href=\"http://wptavern.com/how-to-customize-the-body-and-title-font-in-wordpress-default-themes-without-touching-code/2015customizerbeforestyleguide\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/2015CustomizerBeforeStyleguide.png?resize=297%2C668\" class=\"attachment-full\" alt=\"Customizer Before Styleguide is Activated\" /></a>\n<a href=\"http://wptavern.com/how-to-customize-the-body-and-title-font-in-wordpress-default-themes-without-touching-code/2015customizerafterstyleguide\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/2015CustomizerAfterStyleguide.png?resize=291%2C826\" class=\"attachment-full\" alt=\"Customizer after Styleguide is Activated\" /></a>\n\n<p>Once Styleguide is activated, you&#8217;ll see two new options added to the customizer. These allow you to edit the font for the body and title text. Styleguide will let you change fonts for headers and body text in almost any theme, but out of the box it supports Twenty Ten through Twenty Fifteen. There&#8217;s also support for <a title=\"https://creativemarket.com/BinaryMoon/108641-Puzzle-Responsive-WordPress-Theme?u=BinaryMoon\" href=\"https://creativemarket.com/BinaryMoon/108641-Puzzle-Responsive-WordPress-Theme?u=BinaryMoon\">Puzzle</a>, a theme created by Gillbanks.</p>\n<p>If you&#8217;re using one of the supported themes mentioned above then it will add font and color editing to the customizer, allowing you to style the themes as you wish. Developers can add support for their own themes by using the &#8216;add_theme_support&#8217; command. Check out the <a title=\"https://github.com/BinaryMoon/styleguide/tree/master/theme-styles\" href=\"https://github.com/BinaryMoon/styleguide/tree/master/theme-styles\">included theme-styles</a> to see live examples on how to use the command.</p>\n<p>Gillbanks notes that additional theme support will be added in the future. Until then, if you&#8217;re using one of WordPress&#8217; default themes, <a title=\"https://wordpress.org/plugins/styleguide/\" href=\"https://wordpress.org/plugins/styleguide/\">Styleguide</a> is an easy way to add the ability to customize the body and title fonts without touching a line of code.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Jan 2015 04:28:52 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Matt: Struggles of Distributed\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44585\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"http://ma.tt/2015/01/struggles-of-distributed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:511:\"<p>I think it&#8217;s good to show both sides of what a distributed organization is like, here are two essays by different <a href=\"http://automattic.com/\">Automatticians</a>. Steph Yiu writes <a href=\"http://hoppycow.com/2015/01/04/still-figuring-it-out-communicating-remotely-with-lots-of-people/\">Still figuring it out: communicating remotely with lots of people</a> and Chris Hardie writes on <a href=\"http://www.chrishardie.com/2015/01/distributed-vs-person-teams/\">Distributed vs. In-person Teams</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 13 Jan 2015 00:48:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"WPTavern: New BuddyPress Global Search Plugin Adds Unified Search of All BuddyPress Components\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=37106\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"http://wptavern.com/new-buddypress-global-search-plugin-adds-unified-search-of-all-buddypress-components\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2938:\"<p>The developers behind the <a href=\"http://www.buddyboss.com/\" target=\"_blank\">BuddyBoss</a> theme shop released a plugin today that has the potential to benefit nearly every BuddyPress social network. <a href=\"https://wordpress.org/plugins/buddypress-global-search/\" target=\"_blank\">BuddyPress Global Search</a> adds a unified search bar, allowing users to search through every BuddyPress component, along with pages, posts, and select custom post types.</p>\n<p>Once activated, the plugin turns the site&#8217;s WordPress search inputs into a global search, capable of returning results for any of the social content on the site. It also features a live dropdown of results as you are typing.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/buddypress-global-search.png\" rel=\"prettyphoto[37106]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/buddypress-global-search.png?resize=1025%2C708\" alt=\"buddypress-global-search\" class=\"aligncenter size-full wp-image-37141\" /></a></p>\n<p>The plugin&#8217;s settings page allows administrators to include or exclude any component or custom post type from the unified search.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/buddypress-global-search-settings.png\" rel=\"prettyphoto[37106]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/buddypress-global-search-settings.png?resize=1025%2C532\" alt=\"buddypress-global-search-settings\" class=\"aligncenter size-full wp-image-37144\" /></a></p>\n<p>The plugin was designed to work with any theme out of the box and should adopt your theme&#8217;s styling for BuddyPress search results. However, every theme is different and it may require additional tweaking to get it to perfectly compliment your current design.</p>\n<p>I spoke with BuddyBoss founder Michael Eisenwasser, who said that the plugin is his company&#8217;s way of giving back to one of WordPress&#8217; sister projects. &#8220;I saw Matt at WCSF talking about WP companies giving back 5%, and was inspired to give back to BuddyPress,&#8221; he said. &#8220;Better search has always been lacking in BP. We built this one because we would use it ourselves on pretty much any site.&#8221;</p>\n<p>Eisenwasser plans to continue improving BuddyPress Global Search and will add new features based on user feedback. The BuddyBoss team is cooking up a string of free plugins and next on deck is one that will allow users to easily edit BuddyPress activity on the front end.</p>\n<p>If you administer a BuddyPress site and want your search results to return content from the social network, this plugin offers a solid option. Download <a href=\"https://wordpress.org/plugins/buddypress-global-search/\" target=\"_blank\">BuddyPress Global Search</a> for free from WordPress.org. Documentation and support can be found on the <a href=\"http://www.buddyboss.com/tutorials/\" target=\"_blank\">BuddyBoss website</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 12 Jan 2015 23:21:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"WPTavern: Preview the New Design for the WordPress Themes Directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=37090\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"http://wptavern.com/preview-the-new-design-for-the-wordpress-themes-directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3730:\"<p>A long-awaited update to the official WordPress Themes Directory is in progress. Contributors on the <a href=\"http://make.wordpress.org/meta/\" target=\"_blank\">Meta team</a> for WordPress.org are picking up speed on the effort to move the theme repository away from bbPress and into a new plugin, comprised of a custom post type for the repository package and a theme uploader.</p>\n<p>Konstantin Obenland posted a <a href=\"https://make.wordpress.org/meta/2015/01/09/theme-directory-update-19/\" target=\"_blank\">project update</a> to inform contributors that both the <a href=\"https://meta.trac.wordpress.org/browser/sites/trunk/wordpress.org/public_html/wp-content/themes/pub/wporg-themes\" target=\"_blank\">theme</a> and the <a href=\"https://meta.trac.wordpress.org/browser/sites/trunk/wordpress.org/public_html/wp-content/plugins/theme-directory\" target=\"_blank\">plugin</a> that help to power the directory are now open source and available for anyone to view on <a href=\"https://meta.trac.wordpress.org/ticket/745\" target=\"_blank\">meta.trac</a>. The plan is to match the new directory design to the WordPress admin themes browser, allowing users to filter themes in a similar way.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/new-themes-directory.png\" rel=\"prettyphoto[37090]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/new-themes-directory.png?resize=1001%2C852\" alt=\"new-themes-directory\" class=\"aligncenter size-full wp-image-37112\" /></a></p>\n<p>As you can see in the screenshots above, much of the same UI from WordPress is being re-purposed for the directory. Users will be able to select from all available filters in order to narrow down results.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/themes-directory-filters.png\" rel=\"prettyphoto[37090]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/themes-directory-filters.png?resize=987%2C662\" alt=\"themes-directory-filters\" class=\"aligncenter size-full wp-image-37115\" /></a></p>\n<p>A <a href=\"https://wordpress.org/themesnew/\" target=\"_blank\">live preview</a> of the new directory is available, though Obenland warns it&#8217;s still a bit buggy. The new design also includes an update for the <a href=\"https://wordpress.org/themesnew/commercial/\" target=\"_blank\">commercially-supported GPL themes</a> page.</p>\n<h3>Timeline for Launching the New Themes Directory</h3>\n<p>There is no set timeline for launching the new directory, though some of the larger tasks have already been accomplished. All the necessary API changes are complete, along with the upload process, theme suspension and approval capabilities, and theme version handling.</p>\n<p>Obenland identified a list of important tasks that will need to be accomplished before launching the new directory. These items include things like importing existing themes from bbPress, rewriting the theme API and downloads handling to work with WordPress, synchronizing theme review results as a cron job, etc.</p>\n<p>Matching the UI to the admin themes browser means that users will have a consistent experience, whether they are searching on WordPress.org or browsing in the WordPress admin. It also speeds up the process by enabling contributors to reuse work that has already been done for the core software.</p>\n<p>If you are interested in contributing with the WordPress Meta team, now is an exciting time to jump in. All of the code for the project is public on <a href=\"https://meta.trac.wordpress.org/ticket/745\" target=\"_blank\">meta.trac</a>, and you can offer feedback on the <a href=\"https://make.wordpress.org/meta/2015/01/09/theme-directory-update-19/\" target=\"_blank\">Make.WordPress.org/Meta</a> blog.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 12 Jan 2015 19:58:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: BuddyPress 2.2 Beta 1 Now Available for Testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=37060\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"http://wptavern.com/buddypress-2-2-beta-1-now-available-for-testing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2509:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/buddypress-logo-blue.png\" rel=\"prettyphoto[37060]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/09/buddypress-logo-blue.png?resize=839%2C398\" alt=\"buddypress-logo-blue\" class=\"aligncenter size-full wp-image-30655\" /></a></p>\n<p>Over the weekend, BuddyPress project lead John James Jacoby announced that <a href=\"https://buddypress.org/2015/01/buddypress-2-2-beta-1/\" target=\"_blank\">2.2 beta 1</a> is ready for testing. The upcoming release has been in development since last September. Jacoby&#8217;s campaign for six months of BuddyPress, bbPress, and GlotPress development was <a href=\"http://wptavern.com/buddypress-bbpress-and-glotpress-development-campaign-is-now-fully-funded\" target=\"_blank\">fully funded</a> in mid-December, allowing him to spend more time on the project in 2015.</p>\n<p>So far, the 2.2 milestone has <a href=\"https://buddypress.trac.wordpress.org/query?status=closed&group=resolution&milestone=2.2\" target=\"_blank\">127 resolved tickets</a>, which include enhancements and fixes across all components. Jacoby outlined the most significant changes that require more testing ahead of the official release:</p>\n<ul>\n<li><a href=\"http://wptavern.com/buddypress-2-2-on-track-to-provide-a-basic-member-type-api\" target=\"_blank\">Member types</a> will allow developers to register different types of users, i.e. ‘teacher’ vs. ‘student’.</li>\n<li>Post type activities will allow developers to <a href=\"http://wptavern.com/buddypress-2-2-to-add-custom-post-type-support-to-the-activity-stream\" target=\"_blank\">connect custom post types to activity stream items</a>.</li>\n<li>Numerous improvements to the Legacy template pack</li>\n<li>Several new query API’s (based on WordPress improvements) for retrieving more specific results</li>\n<li>Continued cache enhancements, particularly for multi-site and multi-network WordPress configurations</li>\n<li>Tons of under-the-hood improvements</li>\n<li>Increased coverage of inline code documentation, actions, and filters</li>\n</ul>\n<p>Now is good time for BuddyPress site administrators and plugin and theme developers to start testing their extensions against the beta. You can download the zip file for 2.2 beta 1 from the <a href=\"https://buddypress.org/2015/01/buddypress-2-2-beta-1/\" target=\"_blank\">release announcement</a>. The plugin&#8217;s core development team is aiming to get the official 2.2 release out to users by the end of January.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 12 Jan 2015 05:31:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"Matt: Thirty One\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44592\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"http://ma.tt/2015/01/thirty-one/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3042:\"<p>The first year of my thirties was both incredibly challenging and incredibly rewarding. I started a new decade and <a href=\"http://ma.tt/2014/01/toni-automattic-ceo/\">a new role as CEO</a> at the same time, and at Automattic we grew to over 300 people and <a href=\"http://ma.tt/2014/05/new-funding-for-automattic/\">raised money for the first time in a while</a>, both of which I couldn&#8217;t have predicted five or even two years ago.</p>\n<p>My big takeaway from the year was the importance of habits and small actions for accomplishing big things. To be productive I don&#8217;t need any fancy setups or project management software, just a well-groomed todo list and a pomodoro timer. This year on my birthday I find myself in Egypt which is an awe-inspiring place in many ways, but most striking to me has been the enduring beauty of craftsmanship with access to only the simplest of tools.</p>\n<p>In running, which I started this past summer while in Italy, I was able <a href=\"http://ma.tt/2014/10/run-better/\">to slow down to go further and without injury</a>, and ended up putting in about 140 miles which took my fitness to be better than it&#8217;s been so far in my adult life. At least half of those miles were with friends and you can&#8217;t underestimate the importance of friends in helping you overcome mental blocks. (Also flew 425k miles in 2014, a new record. You can run anywhere and with minimal equipment &#8212; it&#8217;s a great way to explore a city.)</p>\n<p>Reading and writing, two of the activities still most important to me, benefitted from a &#8220;just do it&#8221; philosophy of putting one foot in front of the other. I <a href=\"http://ma.tt/2014/10/streak/\">published more words</a> on ma.tt than any year since 2007, and I find blogging one of the most rewarding pastimes in my life. It was also a year of not trying to be all business all the time: I started reading fiction regularly after a decade away and letting the topics here drift wherever my interest is at the moment. Last year I talked about balance, and I think this is what drove many of the accomplishments I&#8217;m looking back on fondly now.</p>\n<p>I&#8217;m proud of how 2014 went, and I hope to build on that foundation to be a better person and reach even more ambitious milestones in the year to come. Here&#8217;s to slowing down to go further, and tackling big tasks with friends.</p>\n<p>Previously: <a href=\"http://ma.tt/2003/01/bday/\">19</a>, <a href=\"http://ma.tt/2004/01/so-im-20/\">20</a>, <a href=\"http://ma.tt/2005/01/hot-barely-legal-matt/\">21</a>, <a href=\"http://ma.tt/2006/01/matt-22/\">22</a>, <a href=\"http://ma.tt/2007/01/twenty-three/\">23</a>, <a href=\"http://ma.tt/2008/01/twenty-four/\">24</a>, <a href=\"http://ma.tt/2009/01/twenty-five/\">25</a>, <a href=\"http://ma.tt/2010/01/twenty-six/\">26</a>, <a href=\"http://ma.tt/2011/01/twenty-seven/\">27</a>, <a href=\"http://ma.tt/2012/01/twenty-eight/\">28</a>, and <a href=\"http://ma.tt/2013/01/twenty-nine/\">29</a>, <a href=\"http://ma.tt/2014/01/matt-3-0/\">30</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 12 Jan 2015 04:26:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"Matt: NFL is a Non-Profit\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44285\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://ma.tt/2015/01/nfl-is-a-non-profit/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:283:\"<p>Did you know the NFL is a non-profit? Slate says <a href=\"http://www.slate.com/articles/business/moneybox/2014/09/the_nfl_should_lose_its_tax_exempt_status_the_league_is_not_a_nonprofit.html\">the NFL should lose its tax-exempt status: The league is not a “nonprofit.”</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 10 Jan 2015 18:12:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:18:\"Matt: PGP Tutorial\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44579\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"http://ma.tt/2015/01/pgp-tutorial/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:373:\"<p>Speaking <a href=\"http://ma.tt/2014/12/donate-to-gnupg/\">of PGP</a> and <a href=\"http://ma.tt/?p=44577\">security</a>, this self-described<a href=\"http://notes.jerzygangi.com/the-best-pgp-tutorial-for-mac-os-x-ever/\">best PGP tutorial for Mac OS X, ever</a> actually lives up to the promise. Check it out, makes encrypting and decrypting things on the fly super easy.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 10 Jan 2015 00:26:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"WPTavern: Duplicate and Merge Posts: A New Editorial Plugin for WordPress Publishers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=37018\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"http://wptavern.com/duplicate-and-merge-posts-a-new-editorial-plugin-for-wordpress-publishers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4489:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/duplicate-merge.jpg\" rel=\"prettyphoto[37018]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/duplicate-merge.jpg?resize=772%2C330\" alt=\"duplicate-merge\" class=\"aligncenter size-full wp-image-37020\" /></a></p>\n<p>WordPress sites with multiple users often run into challenges when attempting to work on the same content. Larger publications require more robust editorial tools for efficient collaboration between administrators, editors, contributors, and authors, who often need to jump in on the same post.</p>\n<p><a href=\"https://wordpress.org/plugins/duplicate-and-merge-posts/\" target=\"_blank\">Duplicate and Merge Posts</a> is a plugin that offers a new take on WordPress drafts. This editorial tool makes it possible to clone a live post, edit it, and then merge back the updated copy into the original post. It&#8217;s a essentially a far more simplified version of the <a href=\"http://wptavern.com/introducing-wordpress-post-forking-version-control-for-writers\" target=\"_blank\">Post Forking plugin</a> in that it offers fewer capabilities. Duplicate and Merge Posts is intended for the following workflow:</p>\n<p><strong>Original Post</strong> -> <strong>Clone</strong> -> <strong>Edit</strong> -> <strong>Merge back to Original Post</strong></p>\n<p>The plugin was created by WordPress developer <a href=\"https://twitter.com/DavidWells\" target=\"_blank\">David Wells</a> as part of a client project with <a href=\"http://exygy.com/\" target=\"_blank\">Exygy</a>. &#8220;We built it for a &#8216;Fortune 10&#8242; company for them to manage an internal documentation platform they have running on WordPress and figured the rest of the WordPress community would benefit from the plugin as well,&#8221; he said.</p>\n<p>Duplicate and Merge Posts works with both posts and pages. When activated, you&#8217;ll find a new &#8220;Duplicate and Edit&#8221; button at the top of the post on the front end, as well as in the post edit screen.</p>\n<p>The plugin&#8217;s settings screen allows you to set different editorial capabilities based on user role. For example, you might only allow administrators and editors to merge changes back into posts. The buttons shown in the post editor are limited to the user&#8217;s capabilities and allow for the following:</p>\n<ul>\n<li>View side-by-side differences</li>\n<li>Submit update for review</li>\n<li>Merge back into the original post</li>\n<li>Save as a new post</li>\n</ul>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/duplicate-merge-post.jpg\" rel=\"prettyphoto[37018]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/duplicate-merge-post.jpg?resize=1025%2C523\" alt=\"duplicate-merge-post\" class=\"aligncenter size-full wp-image-37024\" /></a></p>\n<p>Users with merge capabilities will receive an email notification when a post has edits ready for review. The plugin allows you to see all of the changes side-by-side for quick comparison.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/duplicate-merge-side-by-side.jpg\" rel=\"prettyphoto[37018]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/duplicate-merge-side-by-side.jpg?resize=1025%2C523\" alt=\"duplicate-merge-side-by-side\" class=\"aligncenter size-full wp-image-37025\" /></a></p>\n<p>The primary use case for the Duplicate and Merge plugin is likely to be multi-author publications. However, it&#8217;s flexible enough to enable more creative uses, such as turning your site into a wiki or allowing visitors to submit fixes for typos. The basic ability to clone posts can also be useful for sites using WordPress as a CMS with many pages that are similar in content.</p>\n<p>After testing Duplicate and Merge, I found that it works as advertised. This tool has the potential to improve your editorial workflow without creating additional confusion for contributors. It has a natural workflow that allows a publication team to get more eyes on the content before pushing edits live.</p>\n<p>You can download <a href=\"https://wordpress.org/plugins/duplicate-and-merge-posts/\" target=\"_blank\">Duplicate and Merge</a> from WordPress.org. It&#8217;s also available for contributions on <a href=\"https://github.com/Exygy/duplicate-and-merge-posts\" target=\"_blank\">GitHub</a>. If you want to see the plugin in action before installing it, check out the video below to tour its features.</p>\n<p><span class=\"embed-youtube\"></span></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Jan 2015 20:02:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"WPTavern: AcademiaThemes One Year Later\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=37011\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://wptavern.com/academiathemes-one-year-later\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2636:\"<p>When Dumitru Brinzan launched <a title=\"http://www.academiathemes.com/\" href=\"http://www.academiathemes.com/\">AcademiaThemes</a> in <a title=\"http://wptavern.com/academiathemes-wordpress-themes-specifically-for-academia\" href=\"http://wptavern.com/academiathemes-wordpress-themes-specifically-for-academia\">early 2014</a>, he did so with the goal of providing high quality themes for the education sector. With one year under his belt, I reached out to Brinzan to find out how the business is doing. The first year was rough, thanks in large part to <a title=\"http://moz.com/google-algorithm-change\" href=\"http://moz.com/google-algorithm-change\">algorithm changes</a> implemented by Google to its search engine in early 2014.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/01/AcademiaThemesUniversityTheme.jpg\" rel=\"prettyphoto[37011]\"><img class=\"aligncenter size-full wp-image-14054\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/01/AcademiaThemesUniversityTheme.jpg?resize=983%2C536\" alt=\"Academia Themes University Theme\" /></a></p>\n<p>The updates negatively impacted a majority of AcademiaThemes affiliates, &#8220;Many of our affiliates simply lost all of their traffic, so we lost basically all sales generated by them, which is an important source of revenue for new shops.&#8221; With affiliates having a hard time getting search engine traffic, Brinzan is finding it difficult to get new traffic to his site, &#8220;Now with almost all of the main affiliates out of the picture, it&#8217;s become incredibly hard to get traffic to our shop.&#8221;</p>\n<p>Despite a significant loss in traffic and affiliate revenue, Brinzan will continue to operate the site. In fact, he&#8217;s opened a new theme shop called <a title=\"http://www.energythemes.com/\" href=\"http://www.energythemes.com/\">EnergyThemes</a> aimed at the fitness market. EnergyThemes is the third theme company he owns that&#8217;s aimed at a specific niche. In addition to AcademiaThemes, he operates <a href=\"http://www.premiumwp.com/go/hermes-themes\" target=\"_blank\" rel=\"nofollow\">HermesThemes</a> which offers themes for hotels.</p>\n<h2>The Achilles&#8217; Heel of Affiliate Programs</h2>\n<p>I&#8217;ve never owned a WordPress theme shop, but I understand how important affiliate programs are. They provide free advertising while helping to generate sales. I never realized updates to Google&#8217;s search engine could drastically reduce affiliate revenue and traffic if sites perform poorly based on those updates. This is an important thing to consider if you&#8217;re thinking about utilizing an affiliate program.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Jan 2015 11:50:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"WPTavern: 5 WordPress Initiatives That Didn’t Make it Out of 2014\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36477\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"http://wptavern.com/5-wordpress-initiatives-that-didnt-make-it-out-of-2014\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7788:\"<p>Throughout the course of a year, several new ideas, products, and businesses are launched in the WordPress ecosystem. However, not all of them are destined for success. Here are five WordPress initiatives launched in 2014 that didn&#8217;t make the cut.</p>\n<h2>WPKindness</h2>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/02/WPKindnesslogo.jpg\" rel=\"prettyphoto[36477]\"><img class=\"aligncenter size-full wp-image-16049\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/02/WPKindnesslogo.jpg?resize=542%2C140\" alt=\"WP Kindness Logo\" /></a></p>\n<p>Launched <a title=\"http://wptavern.com/new-site-highlights-acts-of-kindness-in-the-wordpress-community\" href=\"http://wptavern.com/new-site-highlights-acts-of-kindness-in-the-wordpress-community\">in early</a> 2014 and created by Ryan Bell,<a title=\"http://wpkindness.com/\" href=\"http://wpkindness.com/\"> WPKindness</a> shared acts of kindness that have taken place throughout the WordPress community. The site used a combination of <a href=\"http://headwaythemes.com/\">Headway</a>, <a href=\"http://www.gravityforms.com/\">Gravity Forms</a>, <a href=\"http://wp-types.com/\">Toolset</a> and <a title=\"http://www.wordpress.org\" href=\"http://www.wordpress.org\">WordPress,</a> allowing visitors to submit reports. At the time, I was concerned with a section within the site&#8217;s terms of service that explained affiliate links might be used in reports where companies are mentioned, “You understand wpkindness.com might use an affiliate link to the company you are submitting about.“ The concern is a moot point as the site is offline.</p>\n<h2>WPCollab</h2>\n<p>Fresh out of WordCamp Norway, Slobodan Manic created a <a title=\"http://make.wpcollab.co/\" href=\"http://make.wpcollab.co/\">WordPress collaboration group</a> with the idea that working together creates more opportunities to learn. The first task for the group was to create a WordPress plugin and submit it to the directory. Their first plugin, <a title=\"https://wordpress.org/plugins/hello-emoji/\" href=\"https://wordpress.org/plugins/hello-emoji/\">Hello Emoji,</a> successfully made it to the directory and was created by <strong>five people</strong> from <strong>four different continents</strong> in a <strong>two week</strong> time period.</p>\n<p>While WPCollab showed promise, <a title=\"http://make.wpcollab.co/2014/06/26/wpcollab-future/\" href=\"http://make.wpcollab.co/2014/06/26/wpcollab-future/\">the lack of focus and the inability to manage several contributors</a> from across the world caused the project to lose momentum.</p>\n<h2>Feuilles</h2>\n<p>When <a title=\"http://wptavern.com/feuilles-app-aims-to-replace-editorially-offers-publishing-to-github-wordpress-and-dropbox\" href=\"http://wptavern.com/feuilles-app-aims-to-replace-editorially-offers-publishing-to-github-wordpress-and-dropbox\">Editorially closed its</a> doors in May of 2014, it took all of its cool writing collaboration tools with it. A new project called <a title=\"https://feuill.es/\" href=\"https://feuill.es/\">Feuilles</a> picked up where Editorially left off with an app that provided some of the features Editorially users loved most.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/05/Feuilles.jpg\" rel=\"prettyphoto[36477]\"><img class=\"aligncenter size-full wp-image-23799\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/05/Feuilles.jpg?resize=962%2C509\" alt=\"Feuilles\" /></a></p>\n<p>Feuilles allowed users to publish to Github, WordPress.com, and Dropbox at the same time. <a href=\"https://twitter.com/alexduloz\" target=\"_blank\">Alex Duloz,</a> one of the project&#8217;s creators, aimed to make Feuilles a language/device agnostic CMS with in-house publishing. Unfortunately, the project never made it that far and the website devoted to the project fails to redirect properly.</p>\n<h2>WP School</h2>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/01/WpSchoolFrontPage.jpg\" rel=\"prettyphoto[36477]\"><img class=\"aligncenter size-full wp-image-14202\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2014/01/WpSchoolFrontPage.jpg?resize=928%2C452\" alt=\"WpSchoolFrontPage\" /></a></p>\n<p>Created by Pooria Asteraky, <a title=\"http://www.wpschool.org/\" href=\"http://www.wpschool.org/\">WP School</a> launched with the goal of bringing WordPress education to the masses. Classified as a (<strong>MOOC</strong>) or massive open online course, the site was dedicated to offering WordPress education and online courses in a variety of languages for people to use across the world. In order to get off the ground, Asteraky created a <a title=\"https://www.indiegogo.com/projects/wordpress-school-mooc\" href=\"https://www.indiegogo.com/projects/wordpress-school-mooc\">crowdfunding campaign</a> asking for $25K. The campaign ended with only $1,087 pledged. With a severe lack of funding, WP School never made it out of the gate.</p>\n<h2>Netropolitan</h2>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/09/netropolitan.jpg\" rel=\"prettyphoto[36477]\"><img class=\"aligncenter size-full wp-image-30802\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/09/netropolitan.jpg?resize=1025%2C640\" alt=\"netropolitan\" /></a></p>\n<p><a title=\"http://netropolitan.info/\" href=\"http://netropolitan.info/\">Netropolitan</a> also known as the &#8220;Facebook for Rich People&#8221; <a title=\"http://wptavern.com/netropolitan-facebook-for-rich-people-is-powered-by-wordpress-and-buddypress\" href=\"http://wptavern.com/netropolitan-facebook-for-rich-people-is-powered-by-wordpress-and-buddypress\">launched in late 2014</a>. The site used WordPress and BuddyPress to provide a social network for those who had nothing better to do with $9K. After paying a $9K entrance fee, it cost $3K a year to continue membership. Netropolitan was featured on <a href=\"http://www.cnn.com/2014/09/16/tech/social-media/netropolitan-social-media/\" target=\"_blank\">CNN</a> and other major news outlets across the globe.</p>\n<p>When <a title=\"http://www.vice.com/read/this-guy-is-creating-a-facebook-for-rich-people-917\" href=\"http://www.vice.com/read/this-guy-is-creating-a-facebook-for-rich-people-917\">Vice asked the site&#8217;s creator </a>James Touchi-Peters, why he created the site, he responded, &#8220;This whole thing started because when I was traveling in my work, I wanted to get in on a social event where basically I could meet people like myself.&#8221; There must not be a lot of people like him because the service recently closed. Touch-Peters left the site online with the following message:</p>\n<blockquote><p>It is with a sad heart that I report that the Netropolitan Club has been closed. In the end, there was not sufficient interest in our service among the targeted demographic to operate it as a going concern. (That said, I am happy to report that all paid members received full refunds.)</p>\n<p>I personally would like to thank all those involved in this enterprise – employees, contractors, publicists, et.al. – as well as the paying members who took a chance on an unprecedented business model. I also would like to thank both the public and the worldwide media for their relatively intense interest, whether positive or negative. (It’s not often that Jimmy Fallon tells jokes about your business on &#8216;The Tonight Show&#8217;.)</p>\n<p>Thanks again, one and all. I’ll see you at the concert hall</p></blockquote>\n<h2>There&#8217;s Likely More Than 5</h2>\n<p>There are likely several more products, ideas, and businesses outside of what we covered on the Tavern, that launched in 2014, but shut down before 2015 arrived. Keep an eye on the Tavern as there are several things that launched that are doing well and in the next few weeks, we&#8217;ll update you on how they&#8217;re doing.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Jan 2015 10:09:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"WPTavern: The Geeky Tech Behind WordSesh 3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=37001\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:52:\"http://wptavern.com/the-geeky-tech-behind-wordsesh-3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2756:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/11/WordSesh3FeaturedImage.png\" rel=\"prettyphoto[37001]\"><img class=\"aligncenter size-full wp-image-32961\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/11/WordSesh3FeaturedImage.png?resize=650%2C266\" alt=\"WordSesh 3 Featured Image\" /></a></p>\n<p>WordSesh 3 attracted <a title=\"http://wptavern.com/wordsesh-3-attracts-3000-unique-viewers-from-89-countries\" href=\"http://wptavern.com/wordsesh-3-attracts-3000-unique-viewers-from-89-countries\">more than 3,000 unique viewers from 89 countries</a>. This equates to nearly three times the amount of people who attended <a title=\"http://wptavern.com/wordpress-beyond-boundaries-a-recap-of-wordcamp-europe-2014\" href=\"http://wptavern.com/wordpress-beyond-boundaries-a-recap-of-wordcamp-europe-2014\">WordCamp Europe 2014</a>. With so many people interacting with the <a title=\"http://wordsesh.org/\" href=\"http://wordsesh.org/\">WordSesh site</a> and 24 hours of live video sessions, it&#8217;s imperative that a webhost be able to deliver great performance. For the third annual event, <a title=\"http://scottbasgaard.com/\" href=\"http://scottbasgaard.com/\">Scott Basgaard</a> partnered with <a title=\"http://blog.siteground.com/hosting-wordsesh-2014/\" href=\"http://blog.siteground.com/hosting-wordsesh-2014/\">SiteGround</a>.</p>\n<p>In a <a title=\"http://blog.siteground.com/hosting-wordsesh-2014/\" href=\"http://blog.siteground.com/hosting-wordsesh-2014/\">post published on the company blog</a>, SiteGround employee Hristo Pandjarov explains how they were able to hand the traffic load and keep the site online. The post is filled with geeky terminology and provides a glimpse into what it takes to host a mission critical site. The company used Linux Containers, built redundant infrastructure from the start, utilized dynamic caching, and more.</p>\n<blockquote><p>Since we didn’t want to risk any downtime with WordSesh, we opted for a hosting technology that we love for its almost unlimited ability to scale on the fly without downtime – the Linux containers. Using containers gave us the peace of mind that no matter what happens we will be able to add more resources both vertically and horizontally to each part of the infrastructure we built for WordSesh. At any moment, we had people on duty ready to add more resources or face any other potential issues.</p></blockquote>\n<p>Although I don&#8217;t understand many of the technologies involved, the end result is that the WordSesh 3 site stayed online throughout the entire event. I didn&#8217;t encounter any errors or experience problems watching sessions live. If you experienced problems accessing the WordSesh site during the event, let us know in the comments.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Jan 2015 09:50:10 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:97:\"WPTavern: WordPress 4.2 Will Automatically Enable Pretty Permalinks for New Sites on Installation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36867\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"http://wptavern.com/wordpress-4-2-will-automatically-enable-pretty-permalinks-for-new-sites-on-installation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2506:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/links.jpg\" rel=\"prettyphoto[36867]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/links.jpg?resize=1024%2C508\" alt=\"photo credit: gordon2208 - cc\" class=\"size-full wp-image-36986\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/gordon2208/4987669000/\">gordon2208</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-nd/2.0/\">cc</a>\n<p><a href=\"http://codex.wordpress.org/Changelog/1.0\" target=\"_blank\">WordPress 1.0</a> introduced search engine friendly permalinks using mod_rewrite. Setting your site to use pretty permalinks is usually one of the first things that administrators do after installation.</p>\n<p>WordPress 4.2 will add a new function that will <a href=\"https://core.trac.wordpress.org/changeset/31089\" target=\"_blank\">automatically enable pretty permalinks</a>, if the server supports it, at the time of installation. This means that in most cases you&#8217;ll never be greeted with ugly permalinks again.</p>\n<p>The new function is the result of a <a href=\"https://core.trac.wordpress.org/ticket/6481\" target=\"_blank\">ticket</a> that was originally opened seven years ago. In the upcoming release, pretty permalinks will be enabled if WordPress can verify that they work. It will cycle through the various permalink formats, and if they all fail to work, WordPress will fall back to ugly permalinks.</p>\n<p>By default, WordPress will set the following permalink structure for a new site, if possible, using mod_rewrite or nginx rewriting: <code>/%year%/%monthnum%/%day%/%postname%/</code></p>\n<p>Under configurations without rewrites enabled, it will set <code>/index.php/%year%/%monthnum%/%day%/%postname%/</code> for <a href=\"http://codex.wordpress.org/Using_Permalinks#PATHINFO:_.22Almost_Pretty.22\" target=\"_blank\">PATHINFO</a> (&#8220;Almost Pretty&#8221;) permalinks.</p>\n<p><a href=\"https://profiles.wordpress.org/ericlewis\" target=\"_blank\">Eric Lewis</a>, a contributor on the ticket, <a href=\"https://wordpress.slack.com/archives/core/p1419636021003661\" target=\"_blank\">commented</a> on the upcoming change, &#8220;Delivering pretty permalinks by default seems in line with a bunch of core philosophies &#8211; great out-of-the-box, design for the majority, simplicity, clean, lean and mean.&#8221;</p>\n<p>If you frequently create new WordPress sites or development sites, the automatically enabled pretty permalinks in 4.2 should save you a step in the setup process.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Jan 2015 06:11:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:117:\"WPTavern: Plugin Authors: How to Avoid Download Prompts Associated with Screenshots on the WordPress Plugin Directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36949\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:126:\"http://wptavern.com/plugin-authors-how-to-avoid-download-prompts-associated-with-screenshots-on-the-wordpress-plugin-directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2599:\"<p>If you&#8217;ve ever <a title=\"https://wordpress.org/plugins/woocommerce/screenshots/\" href=\"https://wordpress.org/plugins/woocommerce/screenshots/\">clicked on a screenshot</a> in the WordPress plugin directory and received a download prompt, you&#8217;re not the only one. In fact, it&#8217;s a widespread issue that affects a number of plugins. <a title=\"http://wptavern.com/dear-wordpress-plugin-developer-please-add-screenshots\" href=\"http://wptavern.com/dear-wordpress-plugin-developer-please-add-screenshots\">Screenshots are important</a> as they help with troubleshooting, previewing features, and give users a sense of what to expect when it&#8217;s activated. But if you can&#8217;t see important details, they&#8217;re a moot point.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/PluginScreenshotDownloadPrompt.png\" rel=\"prettyphoto[36949]\"><img class=\"size-full wp-image-36950\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/PluginScreenshotDownloadPrompt.png?resize=609%2C406\" alt=\"Plugin Screenshot Download Prompt\" /></a>Plugin Screenshot Download Prompt\n<p>Mika Epstein, who reviews plugins before they&#8217;re added to the directory, <a title=\"https://make.wordpress.org/plugins/2014/03/20/plugin-screenshots-downloading/\" href=\"https://make.wordpress.org/plugins/2014/03/20/plugin-screenshots-downloading/\">wrote about the issue</a> in early 2014. The prompt appears for images that use the incorrect <a title=\"http://en.wikipedia.org/wiki/Internet_media_type\" href=\"http://en.wikipedia.org/wiki/Internet_media_type\">MIME Type</a>. Otto explains how to set the correct MIME Type using TortiseSVN on Windows or where to look if you use a different SVN client.</p>\n<blockquote><p>On Windows, using TortoiseSVN, you can right click the screenshot file, and select the TortoiseSVN-&gt;Properties menu. There you will find the svn:mime-type property, probably incorrectly set to “application/octet-stream”. Change that to the proper mime type of “image/png” or “image/jpg” accordingly. Afterwards, commit the change.</p>\n<p>If you prefer command line SVN:<br />\n<code>svn propset svn:mime-type image/png screenshot-1.png<br />\nsvn commit<br />\n</code><br />\nOr similar. If somebody uses a different SVN client, look for “properties” and then the svn:mime-type property.</p></blockquote>\n<p>Once the changes are made, upload them to the plugin directory. They&#8217;ll take effect once the directory is synchronized. It&#8217;s a simple change that vastly improves the effectiveness and user experience of viewing screenshots.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Jan 2015 01:19:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:25:\"Matt: Easy Security Guide\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44577\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:41:\"http://ma.tt/2015/01/easy-security-guide/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:422:\"<p>There&#8217;s a simple, unattributed site called <a href=\"http://www.decentsecurity.com/\">Decent Security which has very nice common-sense but effective advice on security</a>. I believe it&#8217;s from the same person as behind <a href=\"https://twitter.com/swiftonsecurity\">the Infosec Taylor Swift account</a>. It&#8217;s refreshing like <a href=\"https://www.schneier.com/\">reading Bruce Schnier&#8217;s blog</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 09 Jan 2015 00:40:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WPTavern: WPWeekly Episode 176 – Farewell Kim\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"http://wptavern.com?p=36934&preview_id=36934\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"http://wptavern.com/wpweekly-episode-176-farewell-kim\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1643:\"<p>This special episode of WordPress Weekly doesn&#8217;t have any news or plugin picks of the week. Instead, it&#8217;s dedicated to the <a href=\"http://wptavern.com/kim-parsell-affectionately-known-as-wpmom-passes-away\" title=\"http://wptavern.com/kim-parsell-affectionately-known-as-wpmom-passes-away\" title=\"http://wptavern.com/kim-parsell-affectionately-known-as-wpmom-passes-away\" title=\"http://wptavern.com/kim-parsell-affectionately-known-as-wpmom-passes-away\">late Kim Parsell</a>.</p>\n<p>I describe the experience of January 2nd where Brian Layman and I drive to Kim Parsell&#8217;s house to check on her. After telling the story, I share a couple of funny memories I have of Kim, like the time I called her #wpgrandma. Near the end of the show, we discuss the outpouring of support from the WordPress community and <a href=\"http://wpmom.org/about-kim-parsell/\" title=\"http://wpmom.org/about-kim-parsell/\">a special memorial page</a> created by Suzette Franck.</p>\n<h2>WPWeekly Meta:</h2>\n<p><strong>Next Episode:</strong> Wednesday, January 14th 9:30 P.M. Eastern</p>\n<p><strong>Subscribe To WPWeekly Via Itunes: </strong><a href=\"https://itunes.apple.com/us/podcast/wordpress-weekly/id694849738\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via RSS: </strong><a href=\"http://www.wptavern.com/feed/podcast\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Subscribe To WPWeekly Via Stitcher Radio: </strong><a href=\"http://www.stitcher.com/podcast/wordpress-weekly-podcast?refid=stpr\" target=\"_blank\">Click here to subscribe</a></p>\n<p><strong>Listen To Episode #176:</strong><br />\n</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Jan 2015 22:43:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"WPTavern: Access Monitor Plugin Tests WordPress Sites for Accessibility Compliance\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36903\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"http://wptavern.com/access-monitor-plugin-tests-wordpress-sites-for-accessibility-compliance\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6151:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/access-monitor.jpg\" rel=\"prettyphoto[36903]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/access-monitor.jpg?resize=772%2C250\" alt=\"access-monitor\" class=\"aligncenter size-full wp-image-36914\" /></a></p>\n<p>Web accessibility guideline are constantly in flux, making it difficult for site administrators to keep pace. Even if you have a decent grasp on the basics, changes to your theme, plugins, and content can introduce new accessibility issues that you didn&#8217;t anticipate. <a href=\"http://www.w3.org/WAI/bcase/pol\" target=\"_blank\">Legal requirements</a> may soon put publishers under the gun for accessibility compliance.</p>\n<p>Plugin developer and WordPress Accessibility team member <a href=\"https://www.joedolson.com/\" target=\"_blank\">Joe Dolson</a> has just released a tool that will help the average WordPress site administrator to identify and tackle accessibility issues with the help of automated testing. <a href=\"https://wordpress.org/plugins/access-monitor/\" title=\"Access Monitor\" target=\"_blank\">Access Monitor</a>, now available on WordPress.org, is a plugin that runs accessibility tests on both the front and back ends of your site, powered by the new <a href=\"http://tenon.io/\" target=\"_blank\">Tenon.io</a> API.</p>\n<p>Tenon is an automated accessibility testing service developed by <a href=\"http://www.karlgroves.com/\" target=\"_blank\">Karl Groves</a>. It&#8217;s designed to make accessibility testing less painful for developers. Groves has taken the &#8220;API first&#8221; route in order to create flexibility for developers interested in building tools for content management systems, browser extensions, IDE plugins, etc.</p>\n<p>Access Monitor is the first plugin to use the Tenon API for testing WordPress sites in the admin. It generates a report that identifies each issue, where it&#8217;s found, and who is affected by it. With that knowledge you can work on improving your site&#8217;s overall accessibility. Here is an example of results for a single page:</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/a11y-single-page-results.png\" rel=\"prettyphoto[36903]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/a11y-single-page-results.png?resize=813%2C864\" alt=\"a11y-single-page-results\" class=\"aligncenter size-full wp-image-36924\" /></a></p>\n<p>Accessibility reports generated by the plugin are configurable and can return results for multiple pages at once.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/a11y-multiple-page-report.png\" rel=\"prettyphoto[36903]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/a11y-multiple-page-report.png?resize=1025%2C769\" alt=\"a11y-multiple-page-report\" class=\"aligncenter size-full wp-image-36927\" /></a></p>\n<p>Access Monitor includes the following features in its automated testing:</p>\n<ul>\n<li>Run a one-time test or schedule a test to be run on a weekly or monthly basis.</li>\n<li>All tests run through the system are saved for later review and comparison so you can track the performance of a page or a test over time.</li>\n<li>Duplicate issues are filtered out from the display. If an accessibility issue appears on multiple pages, it will only be shown the first time it&#8217;s identified.</li>\n<li>Re-run any test from the Accessibility Reports screen at any time, which creates a new test on the same pages and using the same test parameters.</li>\n<li>Test the page you&#8217;re viewing in the admin, using a link in the admin bar labeled &#8216;A11y Check.&#8217;</li>\n</ul>\n<h3>What Does Access Monitor Test?</h3>\n<p>It&#8217;s important to note that a perfect score from Access Monitor doesn&#8217;t necessarily mean that the theme you&#8217;re using meets WordPress accessibility guidelines or that your site is perfectly accessible. Dolson notes that the plugin only tests issues that are machine-testable, which means that it cannot detect keyboard issues, color contrast, etc.</p>\n<p>Access monitor incorporates the current 72 tests outlined by the <a href=\"http://www.tenon.io/documentation/what-tenon-tests.php\" target=\"_blank\">WCAG criterion</a> for accessibility best practices. This includes items such non-text content, focus order, images of text, and the ability to resize text. Tenon plans to add 43 new tests in the first quarter of 2015.</p>\n<p>To get an idea of how the testing works without installing the plugin, you can run your site through the <a href=\"http://tenon.io/\" target=\"_blank\">Tenon.io</a> testing tool. Having the Access Monitor plugin on hand is useful for when you want to test multiple pages, schedule tests, and keep records in order to monitor your site&#8217;s accessibility performance.</p>\n<p>The WordPress Accessibility Team, of which Dolson is a member, is mobilizing in 2015 to carry out a plan of action that would <a href=\"http://wptavern.com/wordpress-accessibility-team-is-mobilizing-to-make-accessibility-required-for-wordpress-org-themes\" target=\"_blank\">make accessibility required for all themes hosted on WordPress.org</a>. The team has a number of hurdles that it will have to overcome in order to get this approved by the Theme Review team, including further education for theme developers.</p>\n<p>Automated accessibility testing for WordPress is an important first step towards making users and developers more aware of accessibility best practices. With high quality automated tests like these, there&#8217;s no excuse for being completely in the dark about your site&#8217;s accessibility issues. Dolson&#8217;s new tool puts the knowledge of accessibility experts into the hands of the average WordPress user, who is capable of implementing many of the text content-related recommendations.</p>\n<p>If you want to see how your site measures up with current web accessibility guidelines, download <a href=\"https://wordpress.org/plugins/access-monitor/\" target=\"_blank\">Access Monitor</a> from WordPress.org. The <a href=\"http://tenon.io/register.php\" target=\"_blank\">Tenon.io API key</a> is free to anyone who signs up.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Jan 2015 22:26:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"WPTavern: Show Support for Free Speech with the Je Suis Charlie Plugin for WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36865\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"http://wptavern.com/show-support-for-free-speech-with-the-je-suis-charlie-plugin-for-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3767:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/je-suis-charlie.png\" rel=\"prettyphoto[36865]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/je-suis-charlie.png?resize=772%2C350\" alt=\"je-suis-charlie\" class=\"aligncenter size-full wp-image-36878\" /></a></p>\n<p>This week the world mourns with Parisians following yesterday&#8217;s terrorist attack at the headquarters of satirical newspaper <a href=\"http://www.charliehebdo.fr/index.html\" target=\"_blank\">Charlie Hebdo</a>. Masked gunmen, claiming to be Yemeni al-Qaida, killed 12 people, including eight journalists and two police officers. The attackers targeted Charlie Hebdo&#8217;s daily editorial meeting, in protest of the publication&#8217;s controversial satirical depictions of religious figures.</p>\n<p>In light of the tragedy, French WordPress developer <a href=\"http://boiteaweb.fr/\" target=\"_blank\">Julio Potier</a> released a new plugin in support of the #jesuischarlie hashtag created to show solidarity with victims of the attack. The <a href=\"https://wordpress.org/plugins/je-suis-charlie/\" target=\"_blank\">Je Suis Charlie plugin</a> adds a black ribbon to the top right or left of your site.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/jesuischarlie.png\" rel=\"prettyphoto[36865]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/jesuischarlie.png?resize=929%2C693\" alt=\"jesuischarlie\" class=\"aligncenter size-full wp-image-36886\" /></a></p>\n<p>The banner links to the <a href=\"http://twitter.com/#jesuischarlie\" target=\"_blank\">#jesuischarlie Twitter hashtag</a>, which supporters are using to advocate for freedom of expression.</p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p>You can kill journalists, cartoonists. You can\'t kill the freedom of the press. You have only made their message stronger. <a href=\"https://twitter.com/hashtag/JeSuisCharlie?src=hash\">#JeSuisCharlie</a></p>\n<p>&mdash; Emily Koch (@EmilyKoch22) <a href=\"https://twitter.com/EmilyKoch22/status/552812847651377153\">January 7, 2015</a></p></blockquote>\n<p></p>\n<blockquote class=\"twitter-tweet\" width=\"550\"><p><a href=\"https://twitter.com/hashtag/Freedomofthepress?src=hash\">#Freedomofthepress</a> cannot be killed. <a href=\"https://twitter.com/hashtag/FreedomOfSpeech?src=hash\">#FreedomOfSpeech</a> cannot be suppressed. We are journalists, we will not be silenced. <a href=\"https://twitter.com/hashtag/JeSuisCharlie?src=hash\">#JeSuisCharlie</a></p>\n<p>&mdash; Marika Kataja-Lian (@katajalian) <a href=\"https://twitter.com/katajalian/status/552825744284712960\">January 7, 2015</a></p></blockquote>\n<p></p>\n<p>You can see a live demo of the plugin on <a href=\"http://boiteaweb.fr/\" target=\"_blank\">Potier&#8217;s website</a>. In just one day, the plugin has already been downloaded more than 700 times.</p>\n<p>Since WordPress is one of the most powerful vehicles for free speech on the web, Potier decided to use his plugin development skills to create a way for WordPress users to show their support. &#8220;I did it to show my support for Charlie Hebdo, for all the families of the casualties, for all people involved in this tragedy,&#8221; he said.</p>\n<p>Potier believes that the banner means more than simply showing support for victims but is also a rallying cry in support of freedom of speech. &#8220;Saying &#8216;I am Charlie&#8217; means that nobody can shut the mouth of the freedom of expression,&#8221; he said.</p>\n<p>&#8220;I am also Charlie; we are all Charlie. Terrorists, you killed 12 people, but you can&#8217;t kill all of us, you can&#8217;t even try. You thought you could kill this freedom by taking down this newspaper? Instead, you raise a country with its beloved friends, all over the world.&#8221;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Jan 2015 19:55:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:106:\"Post Status: Yoast Google Analytics plugin introduces stats dashboards, with lessons learned along the way\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7305\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"https://poststatus.com/yoasts-google-analytics-plugin/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6046:\"<p>I look at my website stats a lot, but I typically just want a really brief snapshot to give me an idea of what&#8217;s happening <em>right now</em> on my website. I run both Jetpack&#8217;s WordPress.com Stats module and Google Analytics on this site, but I actually view the WordPress.com Stats many times more than Google Analytics, because they are right there in my dashboard.</p>\n<h3>New Analytics dashboards by Yoast</h3>\n<p>With the update to <a href=\"https://yoast.com/wordpress/plugins/#analytics\">Yoast&#8217;s Google Analytics plugin</a>, I can now get a similarly quick glance with either plugin.</p>\n<p><img class=\"aligncenter size-large wp-image-7307\" src=\"https://poststatus.com/wp-content/uploads/2015/01/yoast-analytics-dashboard-752x419.png\" alt=\"yoast-analytics-dashboard\" width=\"752\" height=\"419\" /></p>\n<p><img class=\"aligncenter size-large wp-image-7306\" src=\"https://poststatus.com/wp-content/uploads/2015/01/yoast-analytics-reports-dashboard-752x423.png\" alt=\"yoast-analytics-reports-dashboard\" width=\"752\" height=\"423\" /></p>\n<p>The new dashboards in Yoast&#8217;s plugin are nice, but definitely are what I&#8217;d consider a first iteration. It&#8217;s not a replacement dashboard for WordPress.com&#8217;s stats, yet.</p>\n<p>For one, the dashboard is only pulling in stats once per day, so it&#8217;s not exactly a <em>right now</em> sort of thing. When I look at stats, it&#8217;s often to see how a recently published article is &#8220;trending&#8221; and I usually care most about the current day&#8217;s numbers. Additionally, the basic stats only show Sessions and Bounce Rate. I rely heavily on seeing referrals and clicks out of my site.</p>\n<p>But that&#8217;s what early versions of new features are about. And the Yoast team has definitely learned a lot while rolling out these new dashboards.</p>\n<h3>Lessons learned with new features</h3>\n<p>I have had a notice on my site&#8217;s admin for a few weeks now, telling me that Google Analytics by Yoast can&#8217;t authenticate. I&#8217;ve re-authenticated a dozen times, but the notice has persisted. Thankfully, my stats were being tracked still, but I had no idea where that error was coming from.</p>\n<p>This morning, I finally decided it was time to investigate, and I learned that this problem persists across many <a href=\"https://wordpress.org/support/topic/failed-to-fetch-the-new-data-from-google-analytics-please-reauthenticate-on-the/\">sites where this plugin is installed</a>. I also had a pending update for the plugin in my dashboard, and the update message claimed to fix the issue. For me and others, it seems to have done so; at least so that the notice only appears on the actual analytics pages and not site-wide (which was incredibly annoying).</p>\n<p>So, what went wrong? Well, I talked to Joost de Valk, Founder of Yoast, and he filled me in on the backstory.</p>\n<p>Google Analytics are fetched via a WordPress cron job, and Yoast tells me that the lack of reliability (a common sentiment amongst plugin developers) of WordPress cron jobs can cause the plugin to think it needs re-authentication. Though he tells me there were a few other issues involved as well.</p>\n<p>Now that the feature is a few weeks old, the plugin is only fetching data from Google once per day. That&#8217;s after they received a message from Google though. At first, they were grabbing the data live, and in a matter of hours they were far beyond the APIs limits.</p>\n<p>Joost said to me, <span class=\"pullquote alignright\">&#8220;We learned a lot in that week.&#8221;</span> They had a number of releases in quick succession attempting to squash the issues pinging Google&#8217;s API. This included an update to using the newer <a href=\"https://developers.google.com/accounts/docs/OAuth2\">OAuth 2.0</a> instead of 1.0 &#8212; which they had successfully used until the update.</p>\n<h3>Releasing plugins at scale</h3>\n<p>I have no idea what it&#8217;s like to release code at a scale that Yoast is doing. They have increased their development team from one person (Joost) to five people in a pretty short amount of time; and that team is learning.</p>\n<p>That may not be a great excuse for causing issues with millions; but in my opinion it&#8217;s understandable, and it&#8217;s obvious to me their team is working hard to ship better products (which are basically all free for most people). I think as the team matures and lessons are learned, we&#8217;ll see better and better releases from Yoast &#8212; not that their current slate isn&#8217;t already the best on the market, proven by the fact that it seems everyone uses them.</p>\n<p>Automattic (with Jetpack) may be the only team in the WordPress ecosystem that knows what it&#8217;s like to create a plugin to scale like Yoast&#8217;s. And Automattic just surpassed 300 people. Yoast&#8217;s team, in total, is fifteen people. I&#8217;ve heard a decent amount of grumbling from the WordPress community about Yoast&#8217;s frequent &#8212; and sometimes seemingly flippant &#8212; update procedures. These grumbles may be warranted. At the same time, I think we can all extend a little grace in times like these. Scaling is hard, and many large or growing WordPress companies can attest to. I think Joost de Valk cares about his products and the role he plays in the WordPress ecosystem as much as just about anyone, and I&#8217;m pretty pleased with the direction they are taking their plugins.</p>\n<p>The updates to Google Analytics don&#8217;t seem like a whole lot right now &#8212; with a couple of new charts &#8212; but I think it has potential to be a great way to get a snapshot of site activity in the future.</p>\n<p>One thing is for sure: this plugin may have started as a simple way to embed Google Analytics code, but it&#8217;s evolving to be much more than that. Not everyone will care to keep using it as it evolves &#8212; and will opt for a simpler solution &#8212; but I think most users will welcome the changes and the new features. I certainly like the potential.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Jan 2015 17:04:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"WPTavern: Advanced WordPress Facebook Group Milestones in 2014\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36846\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"http://wptavern.com/advanced-wordpress-facebook-group-milestones-in-2014\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6519:\"<p>For the <a title=\"https://www.facebook.com/groups/advancedwp/\" href=\"https://www.facebook.com/groups/advancedwp/\">Advanced WordPress</a> group on Facebook, 2014 was a great year. The group added key admins Joost de Valk and Danny van Kooten to cover the European time zone. It took two and a half years to reach 7,500 members, but after <a title=\"http://wptavern.com/a-facebook-group-dedicated-to-advanced-wordpress-topics\" href=\"http://wptavern.com/a-facebook-group-dedicated-to-advanced-wordpress-topics\">highlighting the group</a> on the Tavern, membership skyrocketed from 7,500 members to more than 10,000.</p>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/AdvancedWordPressFacebookGroupFeaturedImage.png\" rel=\"prettyphoto[36846]\"><img class=\"size-full wp-image-36848\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/AdvancedWordPressFacebookGroupFeaturedImage.png?resize=854%2C270\" alt=\"Advanced WordPress Facebook Group Header\" /></a>Advanced WordPress Facebook Group 11K Members Strong\n<p>Matt Cromwell, who administers the group, <a title=\"https://wordimpress.com/epic-posts-advanced-wordpress-2014/\" href=\"https://wordimpress.com/epic-posts-advanced-wordpress-2014/\">highlights notable threads</a> throughout the year. My favorite item from the list is when Matt Mullenweg joined the group and participated in an <a title=\"http://wptavern.com/matt-mullenweg-hosts-impromptu-qa-session-on-facebook\" href=\"http://wptavern.com/matt-mullenweg-hosts-impromptu-qa-session-on-facebook\">unscheduled Q&amp;A session</a>. In the thread, Mullenweg answered every question, including my own; Do you ever eat food that doesn&#8217;t look like it belongs in an art gallery? Like a Big Mac or something. His response:</p>\n<blockquote><p>I had McDonald&#8217;s as recently as Sunday, just a few days ago. I just don&#8217;t usually post it to my blog. McDonald&#8217;s I&#8217;m a chicken McNugget guy, though I&#8217;m curious about their new jalapeño burger. Burger King it&#8217;s always a Whopper. Growing up in Texas I have a soft spot for Whataburger and Sonic, I think In-n-Out is overrated but usually tasty, and I&#8217;ve been really enjoying Five Guys when I come across one.</p>\n<p>I will always be happy with fried chicken from Popeyes or KFC, though the former has better biscuits and I grew up just a few blocks away from one. When Automattic had an office in the Mission in SF there was a KFC on the opposite corner and I&#8217;d often sneak over there for lunch or a late snack when I was in the office till odd hours.</p></blockquote>\n<p>The group is an excellent place to have discussions, but <a title=\"http://wptavern.com/a-facebook-group-dedicated-to-advanced-wordpress-topics#comment-57154\" href=\"http://wptavern.com/a-facebook-group-dedicated-to-advanced-wordpress-topics#comment-57154\">the things that bothered</a> me in 2014 still exist. It&#8217;s hard to find posts using Facebook&#8217;s search feature because it sucks. There are a lot of threads where people ask for general tech support either with a theme or plugin. Although the group&#8217;s title says it&#8217;s about Advanced WordPress, it really doesn&#8217;t have a central identity and according to Cromwell, it may never have one.</p>\n<blockquote><p>The name itself seems to cause confusion or lack clarity. Some are attracted to the group expecting seriously “Advanced” material. Others come to the group because they are learning and wanting to become advanced. Others see “Advanced” and think: “Perfect, I’ll go ask the experts how to fix all my problems.” With 11k+ members now, it’s hard to conceive of this group as having any kind of central identity.</p></blockquote>\n<p>With over 11K members, Advanced WordPress has splintered into several smaller groups. Doing a search for WordPress groups on Facebook shows the following results:</p>\n<ul>\n<li><a title=\"https://www.facebook.com/groups/wordpresssec/?ref=br_rs\" href=\"https://www.facebook.com/groups/wordpresssec/?ref=br_rs\">WordPress Security</a> 1,697 Members</li>\n<li><a title=\"https://www.facebook.com/groups/wordpressspeedup/?ref=br_rs\" href=\"https://www.facebook.com/groups/wordpressspeedup/?ref=br_rs\">WordPress Speed Up</a> 576 Members</li>\n<li><a title=\"https://www.facebook.com/groups/wphosting/?ref=br_rs\" href=\"https://www.facebook.com/groups/wphosting/?ref=br_rs\">WordPress Hosting</a> 869 Members</li>\n<li><a title=\"https://www.facebook.com/groups/IntermediateWordPress/?ref=br_rs\" href=\"https://www.facebook.com/groups/IntermediateWordPress/?ref=br_rs\">Intermediate WordPress</a> 4,640 Members</li>\n<li><a title=\"https://www.facebook.com/groups/wp.business.group/?ref=br_rs\" href=\"https://www.facebook.com/groups/wp.business.group/?ref=br_rs\">WordPress Business</a> 202 Members</li>\n<li><a title=\"https://www.facebook.com/groups/wpsecure/?ref=br_rs\" href=\"https://www.facebook.com/groups/wpsecure/?ref=br_rs\">WordPress Secure</a> &#8211; Advanced WordPress Security Group 283 Members</li>\n<li><a title=\"https://www.facebook.com/groups/advanced.woocommerce/?ref=br_rs\" href=\"https://www.facebook.com/groups/advanced.woocommerce/?ref=br_rs\">Advanced WooCommerce</a> &#8211; 581 Members</li>\n</ul>\n<p>Each group on Facebook is like a silo with its own members and conversations. I can&#8217;t help but wonder how awesome it would be if a centralized discussion platform such as a forum, played host to all of these discussions. However, a Facebook group does have a few key benefits, such as focusing the topic of discussion and eliminating distractions from other groups. It&#8217;s also easy to pull people into a conversation by adding their name to a response.</p>\n<p>I still don&#8217;t think Facebook is a great platform for conversations surrounding WordPress. It lacks the ability to style posts, browse archives, and easily browse topics. It&#8217;s also a <a title=\"http://en.wikipedia.org/wiki/Closed_platform\" href=\"http://en.wikipedia.org/wiki/Closed_platform\">walled garden</a> and if Facebook decides to remove the feature or shuts down, a lot of great knowledge will be lost forever. However, with so many people on Facebook and the convenience of quickly participating in a conversation, I can see why a lot of people are happy to use it.</p>\n<p>How many of you would like to see an open discussion platform dedicated to WordPress topics that everyone can participate in? Is there a WordPress sub-community or watering hole that doesn&#8217;t exist that you&#8217;d like to see created?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 08 Jan 2015 00:04:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"WPTavern: WordPress For Android Version 3.5 Embraces Google’s New Material Design Principles\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36774\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"http://wptavern.com/wordpress-for-android-version-3-5-embraces-googles-new-material-design-principles\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4010:\"<p>WordPress for Android is starting 2015 with a big update. <a href=\"https://apps.wordpress.org/2015/01/07/wordpress-for-android-version-3-5/\" target=\"_blank\">Version 3.5</a> was released today, introducing major changes to the app&#8217;s overall design. This release follows Google&#8217;s new <a href=\"http://www.google.com/design/spec/material-design/introduction.html\" target=\"_blank\">Material design principles</a>, which was created to unify the experience of apps across platforms and devices. The design spec includes basic tenets for the various aspects of app design, including animation, layouts, patterns, and usability.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/material-design.png\" rel=\"prettyphoto[36774]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/material-design.png?resize=1025%2C369\" alt=\"material-design\" class=\"aligncenter size-full wp-image-36815\" /></a></p>\n<p>Google&#8217;s goal with Material design is to &#8220;create a visual language that synthesizes classic principles of good design with the innovation and possibility of technology and science.&#8221; To that end, Material design incorporates three guiding principles:</p>\n<ul>\n<li>Material is the metaphor</li>\n<li>Bold, graphic, intentional</li>\n<li>Motion provides meaning</li>\n</ul>\n<p>The WordPress for Android app interface now embraces these principles with new Lollipop components and styling. With the exception of a few features, such as ripple animations, these enhancements should also work for pre-Lollipop devices. You can see the changes most clearly when checking out the designs of the individual posts, the app menu, notifications, and post editor screens.</p>\n\n<a href=\"http://wptavern.com/wordpress-for-android-version-3-5-embraces-googles-new-material-design-principles/wp-for-android-2\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/wp-for-android.png?fit=300%2C300\" class=\"attachment-medium\" alt=\"wp-for-android\" /></a>\n<a href=\"http://wptavern.com/wordpress-for-android-version-3-5-embraces-googles-new-material-design-principles/wp-for-android-menu\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/wp-for-android-menu.png?fit=300%2C300\" class=\"attachment-medium\" alt=\"wp-for-android-menu\" /></a>\n<a href=\"http://wptavern.com/wordpress-for-android-version-3-5-embraces-googles-new-material-design-principles/wp-for-android-compose\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/wp-for-android-compose.png?fit=300%2C300\" class=\"attachment-medium\" alt=\"wp-for-android-compose\" /></a>\n\n<p>Another major change in version 3.5 is the addition of auto completion for mentions in comments. If you use the &#8220;@&#8221; symbol while typing, the app can now match blog member usernames, displayed via a popover.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/mentions-autocomplete.png\" rel=\"prettyphoto[36774]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/mentions-autocomplete.png?resize=285%2C500\" alt=\"mentions-autocomplete\" class=\"alignright size-large wp-image-36832\" /></a>Auto completion is also integrated into the reader and notifications. It makes it easy for blog authors to interact more directly with readers in the comments. Participants in blog conversations can stay in the loop via the app&#8217;s notifications. Auto completion for mentions is a major update that should deepen the level of interaction on blogs and help keep users better connected.</p>\n<p>The design changes in this version may come as a surprise to many users, but they make the app feel like a native part of the device. The additions make the app feel cleaner and more intuitive for mobile publishing. <a href=\"https://play.google.com/store/apps/details?id=org.wordpress.android\" target=\"_blank\">WordPress for Android version 3.5</a> is now available in the Google Play store. Update your app today to take advantage of all the new features and fixes.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Jan 2015 22:57:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"WPTavern: Better Search Replace: A New Plugin for Updating URLs and Text in WordPress Databases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36741\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:104:\"http://wptavern.com/better-search-replace-a-new-plugin-for-updating-urls-and-text-in-wordpress-databases\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4372:\"<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/find-replace.png\" rel=\"prettyphoto[36741]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/find-replace.png?resize=1024%2C471\" alt=\"photo credit: Bunches and Bits {Karina} - cc\" class=\"size-full wp-image-36777\" /></a>photo credit: <a href=\"http://www.flickr.com/photos/bunchesandbits/4106216129/\">Bunches and Bits {Karina}</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-nd/2.0/\">cc</a>\n<p>When migrating a WordPress site to a new domain, you&#8217;ll have to update every instance of the site&#8217;s URL in the database. Some developers prefer to use tools like <a href=\"http://wp-cli.org/\" target=\"_blank\">WP-CLI</a> or <a href=\"https://wordpress.org/plugins/wp-migrate-db/\" target=\"_blank\">WP Migrate DB</a> to handle this, while others opt for a general database search and replace plugin with a UI in the WordPress admin.</p>\n<p><a href=\"https://wordpress.org/plugins/better-search-replace/\" target=\"_blank\">Search and Replace</a> is an old plugin, with nearly a million downloads, that can be used to update URLs and text in the database. I used this plugin successfully for a number of years, but it went without any updates for long time. It has since come under new ownership, although the screenshots demonstrate just how long ago the plugin was released.</p>\n<p><a href=\"https://wordpress.org/plugins/better-search-replace/\" target=\"_blank\">Better Search Replace</a> is a new take on database search and replace plugins. It was heavily based on <a href=\"https://interconnectit.com/products/search-and-replace-for-wordpress-databases/\" target=\"_blank\">Interconnect/It&#8217;s open source Search Replace DB script</a> that performs replacement actions without damaging PHP serialized strings or objects. I&#8217;ve used this script a number of times with success, although it&#8217;s not as convenient as a plugin. The Better Search Replace plugin packages it up using native WordPress database functions and adds a friendly UI.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/better-search-replace-screenshot.png\" rel=\"prettyphoto[36741]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/better-search-replace-screenshot.png?resize=1025%2C613\" alt=\"better-search-replace-screenshot\" class=\"aligncenter size-full wp-image-36795\" /></a></p>\n<p>The plugin merges the best features from older plugins and the Interconnect/It script to support the following capabilities:</p>\n<ul>\n<li>Serialization support for all tables</li>\n<li>The ability to select specific tables</li>\n<li>The ability to run a &#8220;dry run&#8221; to see how many fields will be updated</li>\n<li>No server requirements aside from a running installation of WordPress</li>\n</ul>\n<p>Since searching and replacing in the database is a sensitive action to perform, the &#8220;dry run&#8221; feature gives you a good idea of what you can expect before pulling the trigger. Even with the option of performing a dry run, you will undoubtedly want to have a backup of your database created before touching it.</p>\n<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/better-search-replace-dry-run.png\" rel=\"prettyphoto[36741]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/better-search-replace-dry-run.png?resize=1025%2C594\" alt=\"better-search-replace-dry-run\" class=\"aligncenter size-full wp-image-36797\" /></a></p>\n<p>Migrations aren&#8217;t the only reason for this type of plugin. Perhaps you&#8217;ve renamed your company or product line and need to replace all instances throughout your website. This plugin makes it safe and easy to perform the replacements directly within the WordPress admin. I tested it on a development site and found that it is fast and works exactly as advertised.</p>\n<p>Better Search Replace was created by Matt Shaw, author of the <a href=\"http://wptavern.com/free-revisr-plugin-offers-git-management-for-wordpress\" target=\"_blank\">Revisr plugin</a> that allows developers to synchronize WordPress with a remote Git repository. If you&#8217;re a long-time fan of the Interconnect/It script, you&#8217;ll find that this plugin is even easier to use. You can find <a href=\"https://wordpress.org/plugins/better-search-replace/\" target=\"_blank\">Better Search Replace on WordPress.org</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Jan 2015 21:19:54 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"WPTavern: Happy Joe to Host WP Boot Camp January 23: A Free Training Event for Military Veterans\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36751\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:105:\"http://wptavern.com/happy-joe-to-host-wp-boot-camp-january-23-a-free-training-event-for-military-veterans\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1827:\"<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/wp-boot-camp.png\" rel=\"prettyphoto[36751]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/wp-boot-camp.png?resize=1025%2C479\" alt=\"wp-boot-camp\" class=\"aligncenter size-full wp-image-36755\" /></a></p>\n<p><a href=\"http://www.happyjoe.org/\" target=\"_blank\">Happy Joe </a>is launching its first planned <a href=\"http://www.happyjoe.org/wp-bootcamp-for-military-veterans/\" target=\"_blank\">WP Boot Camp</a> in San Antonio, TX on January 23, 2015. The non-profit organization <a href=\"http://wptavern.com/happy-joe-uses-wordpress-to-train-and-help-veterans-find-careers-in-web-technology\" target=\"_blank\">helps US military veterans re-enter the workforce</a> through training in WordPress and the web technology industry in general. Happy Joe was started by former service member <a href=\"http://www.jamesdalman.com/\" target=\"_blank\">James Dalman</a>, who will be presenting at the first WP Boot Camp, along with other WordPress professionals.</p>\n<p>The three hour event will give military veterans and their spouses an opportunity to learn, network, and gain access to free resources and online training. Dahlman plans to assist attendees in setting up an online resume website using WordPress as a first step towards entering the web technology industry.</p>\n<p>WP Boot Camp is free of charge to anyone with a valid military ID, thanks to event sponsors iThemes, Automattic, WP Site Care, and WebTegrity. The event will be held at <a href=\"http://www.geekdom.com/san-antonio\" target=\"_blank\">Geekdom San Antonio</a>, the largest collaborative co-working space in Texas. However, it is limited to 30 attendees, so those planning to attend must <a href=\"http://www.happyjoe.org/wp-bootcamp-for-military-veterans/\" target=\"_blank\">RSVP</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Jan 2015 19:00:41 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:27:\"Matt: WP.com Year in Review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44587\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"http://ma.tt/2015/01/wp-com-year-in-review/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:192:\"<p>There&#8217;s a <a href=\"https://en.blog.wordpress.com/2015/01/06/2014-in-review/\">great write-up of the human side of WordPress.com&#8217;s 2014 as well as some impressive numbers</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Jan 2015 18:53:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"Post Status: The ABCs of the web\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7300\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://poststatus.com/web-abcs/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3244:\"<p>I wanted to change my primary URL, and also setup HTTPS on my new VPS.</p>\n<p>So, I bought an SSL cert that required I add a TXT record to get a verification email. The domain was new so I needed Google MX records added to receive the new email. Ah, but I also changed the DNS provider where I put those records. Thankfully, the TTL for new records was short and I got squared away so I could submit a CSR and get the SSL. I had to make sure to choose a CDN provider to support SSL too, and it happened to be the same place that handles my DNS now. This service also GZIP compresses as much as it can.</p>\n<p>The domain is square now so I SSH&#8217;d into my new VPS to set a few things straight. For one, I needed to edit the MySQL DB with WP-CLI to search and replace the new URL. But I accidentally forgot to exclude the GUIDs so my RSS went haywire.</p>\n<p>My VC is kinda jacked for deployment purposes, though I&#8217;m learning to handle dependencies and repo management with a JSON file via Composer. But I&#8217;ll still need to deploy my Git repo with something like Dploy.io. For now I had to cowboy up and SCP some new stuff to the server, since it doesn&#8217;t have (bad practice) FTP. Then I noticed I screwed something up, so I used Vi to edit it live, like a madman.</p>\n<p>My new CDN provider not only delivers but also caches HTML, CSS, and JS. That&#8217;s on top of what JS-based Grunt does on the theme side, where my front-end JS is concatenated and minified, and my Sass is pre-processed to CSS. Grunt is also managed with a JSON config file, where I can do these things and more: like linting, combing, .pot generation, and auto-prefixing my Sass. I can even generate RTL-specific CSS if I need to. I&#8217;m told that hardly scratches the surface still.</p>\n<p>In order to do these things, I work locally with VVV, so these scripts can run. That lets met setup custom LEMP stacks to my heart&#8217;s content, stored in a www folder. I can even do auto-site generation with one of many custom shell scripts, though you have to watch out if the project structure isn&#8217;t the same as yours. VVV supports WP-CLI too, so that&#8217;s nice.</p>\n<p>Now the live site is HTTPS instead of HTTP, and because of new tools and modern browsers (that support stuff like SPDY and SVG) my website has fewer HTTP requests, and weighs less than a single MB.</p>\n<p>Also, I better not forget to 301 the old URLs to the new URLs with the domain change; that&#8217;s easy with nginx and will help me keep my SEO.</p>\n<p>Of course, these things are happening while building my site with my CMS of choice, which is also the one largely considered the easiest to work with: WP. And I&#8217;m <a title=\"A new look and a new domain\" href=\"https://poststatus.com/new-look-new-domain/\">not even close to done</a>. I have so much to learn, APIs to explore, and mistakes to make.</p>\n<hr />\n<p>The moral of this silly story, is that building and maintaining websites is still pretty complicated. In fact, I think it may be more complicated than ever. I always feel like a kid learning his ABCs, but that shouldn&#8217;t stop us. Don&#8217;t get intimidated. Dig in. Eventually we learn to string a few sentences together, or even a story.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Jan 2015 18:16:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:40:\"Post Status: A new look and a new domain\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7287\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"https://poststatus.com/new-look-new-domain/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12091:\"<p>Last night I launched version 3 of Post Status. The site design was about a year and a half old and in the first two iterations I never put too much thought into it as much as just trying to get something out the door as soon as possible. This time, I tried to build something that could be a foundation for a while.</p>\n<p>I&#8217;m going to try and walk you through much of my thought processes. Hopefully it gives you insight to what I&#8217;ve been up to, as well as perhaps point you to a new resource or two. And if you have advice for me, I&#8217;ll take it.</p>\n<h3>The new design starts with a name</h3>\n<p>I never really expected Post Status to be my business, but now it is. I realized that some early decisions were mistakes &#8212; like not having the .com for the domain. Poststat.us was a fun domain hack and the .com wasn&#8217;t available, but it was also a branding issue. The site&#8217;s name is Post Status, not PostStat.us or poststat.us or whatever else. That&#8217;s always been hard to shake.</p>\n<p>A few days ago <a href=\"https://twitter.com/greg_wallace/status/551229639104794625\">Greg Wallace pointed me</a> to a Flippa auction for the poststatus.com domain. I was both pleased and annoyed. I tried &#8212; in the past year or so &#8212; to contact the owner privately multiple times and never got a response, even with a direct offer of cash. Nevertheless, I <a href=\"https://flippa.com/3484788-13-years-aged-huge-industry-development-potential-exact-match-domain\">bid on the domain</a> and even got the seller to give me a buy it now option so I could guarantee the domain. It was $800, but I think I got plenty of value in the transaction. All of that happened just yesterday.</p>\n<h3>HTTPS everywhere</h3>\n<p>Another important thing to me was making the entire site utilize HTTPS. I&#8217;ll need it for the eCommerce memberships anyway, and it&#8217;s a good practice and even <a href=\"https://thethemefoundry.com/blog/ssl-everywhere/\">has speed benefits</a>. Post Status is now on a custom VPS product that I&#8217;m working on with <a href=\"http://siteground.com\">SiteGround</a>.</p>\n<p>The site is on a LEMP stack, and utilizes a variation of their <a href=\"https://www.getclouder.com/\">GetClouder</a> product. DNS, CDN, and additional caching elements are provided through <a href=\"https://www.cloudflare.com\">Cloudflare</a> Pro, which took me a while to settle on. The SSL certification is from <a href=\"https://www.digicert.com/\">DigiCert</a>, which had great reviews.</p>\n<p>I&#8217;m really excited about using nginx as well as being able to take advantage of SPDY. My site is now more secure, faster, more customizable, and ready for the future. Meanwhile, I was able to knock out two redirects (for the new domain and from HTTP to HTTPS) in one go.</p>\n<h3>New logo</h3>\n<p>The logo featured above is probably not finalized, but it&#8217;s about where I want it to be. I sketched out logo drafts for months and <a href=\"http://sara-cannon.com/\">Sara Cannon</a> helped me put the first version into Illustrator. The one shown in the featured image is a bit thicker than the original, since the thinner one is tough to scale at small sizes.</p>\n<p>I&#8217;ll probably be tweaking this with the help of someone less like a bull in a china shop within Illustrator as I am, to get it cleaned up and <em>swag-ready</em> (oh yeah!). Either way, I&#8217;m happy to finally have a logo for this project, and I think it represents both the brand and the nature of the site pretty well.</p>\n<h3>New theme</h3>\n<p>The part of the site I&#8217;m most excited about is the new theme design. I&#8217;ve had this concept in mind for months, but didn&#8217;t really execute the latter half (aka 90% of it) until the last couple of weeks.</p>\n<p>In general, finding things based on topic and search should be a lot better, and the reading experience is more focused than ever. I went one column on article pages &#8212; something I&#8217;ve wanted to do for a while. And I went to a two-column format for archives, minus the latest article that sits in a featured spot on the home page.</p>\n<p>The development is based off of <a href=\"http://underscores.me\">Underscores</a>, which I&#8217;ve grown to love. I&#8217;m using Sass for the preprocessor, though with a different structure than base Underscores. Though I&#8217;m no longer using <a href=\"http://themehybrid.com/hybrid-core\">Hybrid Core</a> (I still love it), I am using Get The Image from it to wrangle some default featured images on legacy archives.</p>\n<p>One thing you may notice is the icons. Everything is SVG, using <a href=\"https://useiconic.com/\">Iconic</a>. Iconic makes using SVG super simple. I just insert the SVG of choice with an image tag and the Iconic JS (that&#8217;s minified in my primary JS via Grunt) actually changes the image tag to inline SVG. Iconic also has small, medium, and large versions of each icon, which will be pretty cool for some of the larger ones I intend to use for other landing and member page templates. One thing I don&#8217;t like is the FOUI (flash of unstyled icon &#8212; I just made that up) when I load the page. Hopefully that gets cached and doesn&#8217;t happen often, but I sometimes see it working locally.</p>\n<p>The call to action for memberships on the homepage is also something I debated a lot. I&#8217;m excited about how it came together, mostly because that section will also be the member dashboard for folks once they&#8217;re logged in; so the CTAs shouldn&#8217;t be too obnoxious for those that follow them.</p>\n<p>This design is super alpha and I&#8217;m very willing to receive feedback of what you like and hate. I have a lot of known issues too. The bottom half of article pages have a ton of work to do. The footer doesn&#8217;t exist yet. And I have to build out templates for new sections of the website.</p>\n<h3>Typography</h3>\n<p>Part of the new theme is new typography. I have stayed with <a href=\"http://typography.com\">Typography.com</a>&#8216;s delivery service &#8212; mostly because I am just too in love with Gotham Rounded for my titles.</p>\n<p>I do have some performance concerns, as <a href=\"https://www.tollmanz.com/typography-coms-cssom-blocking-font-loader/\">Zack Tollman outlines</a>, but I have reduced the font&#8217;s package size considerably &#8212; from 9 fonts to 6, and they are smaller sets as well.</p>\n<p>I&#8217;m still using Gotham Rounded for the logo, buttons, and for main headers and titles. It&#8217;s just so pretty. But I&#8217;m only using a single weight, since the use is quite controlled.</p>\n<p>I&#8217;m also using a single weight (light italic) of Sentinel, an incredible slab serif, for archive titles, taglines, and pullquotes. Sentinel is replacing four weights of Archer. I thought about not using any serif, but I think Sentinel is worth it.</p>\n<p>The body font is the biggest change. I&#8217;ve gone from Gotham Rounded to Gotham Narrow. It&#8217;s a more traditional sans-serif, and I think it&#8217;s both slightly more serious and slightly more readable. I toyed with the idea of listing (but not hosting) a series of sans-serifs for body, to gain speed improvements by downloading the best available local fonts from the reader; but I discovered I&#8217;m too picky for that. That said, the four weights I&#8217;m using of Gotham Narrow are lighter than Gotham Rounded was.</p>\n<h3>Performance</h3>\n<p>Performance has been a primary concern throughout the redesign. I&#8217;m trying really hard to consider whether I need things.</p>\n<p><span class=\"pullquote alignright\"><br />\nOne takeaway is that performance is a multi-faceted, challenging endeavor that spans design, development, and infrastructure.</span> All in all, Post Status is way faster now.</p>\n<p>Some of that is hardware, with nginx on a VPS and SPDY support with HTTPS. But the theme is faster too. I&#8217;m using no images unless they are in a post. I&#8217;m not using an icon font, but instead using SVG. I&#8217;m using Grunt to concatenate and minify various theme scripts. Fonts are still a burden, but one I decided was worth it.</p>\n<p>And then there are plugins. Oh, plugins.</p>\n<p>Wrangling Jetpack has been tough. I&#8217;m probably screwing up some features on the site, but I&#8217;m basically dequeuing everything Jetpack spits out. However, I&#8217;m confident I&#8217;ll be able to wrangle Jetpack okay, as I&#8217;m really only going to use Related Posts and Sharing as front-facing features; and though neither is shown here today, both are manageable without Jetpack&#8217;s styles and scripts.</p>\n<p>Gravity Forms is another one I still have to wrangle. A simple newsletter signup form (a single email field) is causing four stylesheets and two Javascript files to be loaded on every page. That can&#8217;t happen, so I have some work to do there.</p>\n<p>Generally, finding, dequeuing, and enqueuing styles and scripts from plugins is just annoying. I totally understand why folks tend to just not bother. I would love to see product makers start offering guides on how users can responsibly enqueue such things on their own.</p>\n<p>Especially with something like forms, I don&#8217;t want to remove a script that prevents the form from working properly. But I <em>do</em> want to remove pointless stylesheets that don&#8217;t matter at all to my simple forms. I don&#8217;t mean to pick on Gravity Forms, as I freaking love Gravity Forms. I just want to figure out how to make complex plugins more performant. Every http request matters, you know?</p>\n<p>All in all, every page load is under pretty well under 1MB uncached, and making between 25-50 requests. I&#8217;d like to keep it that way, and really I&#8217;d like to make sure full page loads are under 1 second always, and usually under 500ms. I have a lot of work to do!</p>\n<h3>So much left to do</h3>\n<p>Today is an early Alpha of the new site. I&#8217;ll walk you through some of what&#8217;s left or still in progress:</p>\n<p>Deployments. My deployment method for this site is terrible. I spent a lot of time learning about Composer (will have posts on that) and I may use it, but either way I&#8217;ve got work to do on proper repo management and deployments. This is especially the case since I&#8217;m trying to both manage the site&#8217;s private repo as well as share the theme and functionality plugin as their own repos for others to use, see, and contribute to.</p>\n<p>Memberships and membership functionality still have a long way to go. I&#8217;m using <a href=\"http://www.woothemes.com/woocommerce/\">WooCommerce</a>,  Subscriptions by <a href=\"http://prospress.com/\">Prospress</a> and (most likely) a product that&#8217;s in Alpha/Beta from <a href=\"http://www.skyverge.com/\">SkyVerge</a> for content restriction and other member features. I&#8217;m using the Mailchimp API to create a custom email to send to members with new private content; that&#8217;s been fun to learn.</p>\n<p>I&#8217;ve created two new content types (Notes and Resources) that are going to be members only. Notes are like the old links, but now a members only blog and newsletter. Resources will be mostly members only with some free stuff, and will be evergreen informational content. Then I&#8217;m creating a Profiles content type to create static pages for people and companies (think Crunchbase for WordPress), as well as a cross-relational tool for posts about those folks.</p>\n<p><span class=\"pullquote alignleft\">The goal with the new Post Status is to provide useful and informative free content for everyone, but go above and beyond for members.</span> I&#8217;m working hard to make that content accessible, digestible, high quality, and trim enough for busy WordPress professionals.</p>\n<p>Okay, this is way more than you needed to know. If you read all that, you are my ideal customer.</p>\n<p>I can&#8217;t wait until I can show you guys the rest of the site! I&#8217;m having a blast spending all of my working time on my own project. It&#8217;s a professional euphoria I&#8217;ve never known until now.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 07 Jan 2015 16:11:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"Post Status: Website micro services provider, Elto, is shutting down for now\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7258\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"https://poststatus.com/elto-shutting-down-temporarily/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4615:\"<p><a href=\"http://elto.com\">Elto</a>, formerly Tweaky, is a micro services provider, for lack of a better term. They started with $25 tweaks, which until they <a href=\"http://www.elto.com/blog/well-be-back/\">shut down services today</a>, worked it&#8217;s way to a $199 minimum.</p>\n<p>WordPress is a high focus vertical for Elto&#8217;s, and I presume it&#8217;s their largest as well. Elto is one of several such providers of micro services like this; others still running are <a href=\"https://codeable.io/\">Codeable</a> and <a href=\"http://studio.envato.com/\">Envato Studio</a> (formerly Microlancer). These are besides the longstanding generic types (with rather poor reputations, in my opinion) such as oDesk and Elance.</p>\n<p>I have always kept track of Elto, as I started referring folks to them from my own contact form for small projects, in order to narrow the leads I was getting. When I got the email today from Ned Dwyer, Elto&#8217;s founder, I went to my dashboard to see how many folks had used my referral and what those services were:<br />\n<img src=\"https://poststatus.com/wp-content/uploads/2014/12/elto-services-752x261.png\" alt=\"elto-services\" width=\"752\" height=\"261\" class=\"aligncenter size-large wp-image-7273\" /></p>\n<p>In the time I was referring folks to Elto, I sent them nearly $2,000 in business and got a 25% referral fee. That&#8217;s not a lot; more interesting is that of these referrals, there was an 8.5 / 10 satisfaction rate. I wouldn&#8217;t say that&#8217;s outstanding, but it&#8217;s not bad either. It&#8217;s probably better or close to the satisfaction of more traditional web services providers.</p>\n<p>I emailed Ned to see if he could offer any more insight into this decision. He responded with the following:</p>\n<blockquote><p>\nIt was something we thought long and hard about before making this change.</p>\n<p>The challenge is that the current model was working well &#8211; customers rate us on average 8.7 out of 10, thousands of new customers every month etc &#8211; but it wasn&#8217;t delivering the kinds of results we wanted. This will become clearer when we launch the new version.</p>\n<p>While we could have kept going with this model while working on the next version in the background, the current model has significant customer support challenges. This puts a burden on our team to maintain the current app and customer base which draws resources away from us working on what&#8217;s important.</p>\n<p>We have the full support of our team and investors in making these changes and we&#8217;re excited about what&#8217;s next.</p></blockquote>\n<p>So it appears that this is a temporary stop for Elto. I&#8217;m sure &#8212; with investors to answer to &#8212; rising support challenges makes change inevitable.</p>\n<p>I&#8217;ve always liked the idea of companies like Elto from a developer standpoint. As long as the company values the developers they are mediating for, it can be a nice way for junior developers or just folks that don&#8217;t want to interact with clients much to be able to get work. It can also be a way to fill in the gaps in someone&#8217;s own freelance work.</p>\n<p>I&#8217;m not sure what the next version of Elto will look like, but it seems they&#8217;re aiming to be more in the product business and less in the service business.</p>\n<p>From what I can gather, they raised at least a seed round in 2012, <a href=\"http://thenextweb.com/insider/2012/07/17/99design-founders-invest-460000-in-tweaky-a-marketplace-for-minor-website-customizations/\">reported at $460,000</a>, and perhaps <a href=\"http://www.startupsmart.com.au/growth/growth-strategy/introducing-elto-tweaky-founder-shares-about-their-major-pivot-brand-change-and-latest-investment-round/2014020311615.html\">another round in 2013</a> from Blackbird Ventures.</p>\n<p>I guess my primary takeaway from a change like this is that even when companies are productizing services, doing work for cheap isn&#8217;t easy. Support struggles, maintaining customer expectations, managing developers &#8212; it&#8217;s all tough. I am curious if Codeable and other what I&#8217;d call &#8220;progressive&#8221; members of this style market can relate to Elto&#8217;s struggles, or if they have somehow managed to get past those.</p>\n<p>For some additional reading on Elto&#8217;s journey, Ned&#8217;s post about <a href=\"http://www.elto.com/blog/lessons-weve-learned-from-2-years-of-running-elto/\">what they learned in their first two years</a> was insightful. He also hints they considered a pause even then; so I guess today shouldn&#8217;t be too much of a surprise.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 23:30:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"Post Status: WordPress 4.1, “Dinah”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7245\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"https://poststatus.com/wordpress-4-1-dinah/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7094:\"<p><img src=\"https://poststatus.com/wp-content/uploads/2014/12/wordpress-4-1-752x300.jpg\" alt=\"wordpress-4-1\" width=\"627\" height=\"250\" class=\"aligncenter size-large wp-image-7247\" /><br />\nWordPress 4.1, &#8220;Dinah&#8221;, <a href=\"https://wordpress.org/news/2014/12/dinah/\">has just been released</a>. WordPress 4.1 is the result of months of work and includes a number of excellent new features.</p>\n<p>WordPress 4.1 was led by <a href=\"https://profiles.wordpress.org/johnbillion\">John Blackbourn</a>, who did an outstanding job. Two hundred and eighty three contributors were part of WordPress 4.1, which Matt Mullenweg states is a new high.</p>\n<p>Here are some of the new features.</p>\n<h3>Persistent Distraction-free Writing</h3>\n<p>I must begin with the new persistent Distraction-free Writing feature, as I&#8217;m using it to write this very post. We&#8217;ve had Distraction-free Writing since 2011, with the <a href=\"https://wordpress.org/news/2011/07/gershwin/\">release of WordPress 3.2</a>. However, it&#8217;s always been a single-experience decision. You hit the button to enter distraction free mode, and you utilize it for a single writing session.<span id=\"more-7245\"></span></p>\n<p>Now, the button itself is persistent, and the experience of writing distraction free doesn&#8217;t enter a new screen, but rather fade away the distractions of the default editor.</p>\n<p>https://cloudup.com/cqbFU6CSqm2</p>\n<p>The left admin seamlessly floats away, as do the metaboxes to the right of and below the editor. The editor itself remains, versus using a modified editor like before.</p>\n<p>When you update to WordPress 4.1, you are triggered with a note about Distraction-free Writing, and now that it&#8217;s a decision you only have to make once, I think this feature will finally get the broad use it deserves. It really is much more pleasant to write without everything else around you, to be lost in your thoughts as they make their way to the editor.</p>\n<h3>Twenty Fifteen theme</h3>\n<p>https://cloudup.com/cgjoFpPJvYk</p>\n<p>The Twenty Fifteen theme is the finest work I&#8217;ve seen yet of the default theme team. A blogging, and personal, theme &#8212; Twenty Fifteen is simple, with beautiful typography, and capable of showcasing blog posts of any format with poise.</p>\n<p>Twenty Fifteen comes in six base color schemes: default (light), dark, yellow, ping, purple, and blue. It also supports WordPress&#8217; background and header image features, and allows you to customize colors from your base selection; Twenty Fifteen can be as quirky as you are.</p>\n<p>https://cloudup.com/cFEI4yyaDmU</p>\n<p>Here&#8217;s a link to the <a href=\"http://twentyfifteendemo.wordpress.com/\">default theme demo</a>, as well as it&#8217;s <a href=\"https://wordpress.org/themes/twentyfifteen\">new page on WordPress.org</a>.</p>\n<h3>Dozens of languages, available any time</h3>\n<p>https://cloudup.com/ckbOnTY71Gq</p>\n<p>WordPress has made tremendous progress for non-English speaking users in the past few releases. With WordPress 4.0, you could choose a language on installation, whereas before it required many more steps. Now the team has gone a step further, so that language can be changed at any time, right from WordPress&#8217; general settings page.</p>\n<p>Given that <a href=\"https://poststatus.com/understand-wordpress-internationalization-translation/\">a third of WordPress installs are non-English</a> (and if I recall correctly half of new downloads are non-English now), this change further reduces the barrier of language in publishing software, and is an excellent move for the progression of the platform across the world.</p>\n<h3>Recommended plugins</h3>\n<p>https://cloudup.com/cQi9LX744H8</p>\n<p>I believe recommended plugins is probably the most controversial feature in WordPress 4.1, though it is not without precedent. &#8220;Featured&#8221; themes have been in the WordPress dashboard for a while now. But with a tab for recommended plugins, now users can see plugin recommendations based on plugins already installed and plugins other sites have installed.</p>\n<p>Recommended plugins are replacing the former popular plugins tab, and is mostly a change in the underlying API for showing the plugins themselves. Since it&#8217;s not a manual recommendation, I think this is a good change, and will more accurately help folks find relevant plugins than just listing the most popular plugins in the directory.</p>\n<h3>New template tags and theming tools</h3>\n<p>I&#8217;m really looking forward to using some of the new template tags introduced in WordPress 4.1.</p>\n<p>My favorite is <code>get_the_archive_title()</code>. Themers out there all know about the big blob of conditionals in most theme archive templates to spit out the right string based on which archive template it is. Now, there&#8217;s a function for that, and it&#8217;s fully filterable to boot.</p>\n<p>Descriptions of the new title functions, some new pagination functions, and some particularly nice body class assignment enhancements are well described on <a href=\"https://make.wordpress.org/core/2014/12/04/new-template-tags-in-4-1/\">this Make WordPress post</a> by Konstantin Obenland. There&#8217;s also a post about adding theme support to <a href=\"https://make.wordpress.org/core/2014/10/29/title-tags-in-4-1/\">let WordPress handle title tags</a>, which is a handy thing.</p>\n<h3>Log out from anywhere</h3>\n<p>A relatively small but nice security feature is the new ability to log out of all installs from a single location. WordPress uses cookies to keep you logged into your install for a period of time. Well, if you ever leave yourself logged in on a computer you don&#8217;t trust, you can now log out of all instances easily, from your profile page on an install.</p>\n<p>There is a new button that says &#8220;Log Out of All Other Sessions,&#8221; and also tells you if you are logged in at more than one location.</p>\n<h3>More improvements to queries</h3>\n<p>I love how much progress has been made on the WordPress query tools in the last couple of years. WordPress 4.1 introduces the ability for a nested query syntax, which makes more complex queries possible for <code>WP_Tax_Query</code>, <code>WP_Date_Query</code>, and <code>WP_Meta_Query</code>. I don&#8217;t often call out single individual&#8217;s work on something, but Boone Georges <a href=\"https://core.trac.wordpress.org/ticket/29822\">really</a> <a href=\"https://core.trac.wordpress.org/ticket/29738\">slayed</a> <a href=\"https://core.trac.wordpress.org/ticket/29642\">it</a> with the nested queries work. He wrote about it <a href=\"http://teleogistic.net/2014/12/wordpress-4-1-and-me/\">on his blog in detail</a>.</p>\n<h3>More under the hood</h3>\n<p>WordPress 4.1 includes many other under the hood features you should check out on the <a href=\"http://codex.wordpress.org/Version_4.1\">Codex page about the release</a>.</p>\n<h3>More excellent progress for WordPress</h3>\n<p>WordPress is better than ever, and hundreds (or thousands) of people make it so. Great job everyone. Now, go download WordPress 4.1.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 23:30:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:38:\"Post Status: Let’s WordSesh together\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7232\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"https://poststatus.com/lets-wordsesh-together/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1513:\"<p><img class=\"aligncenter size-large wp-image-7233\" src=\"https://poststatus.com/wp-content/uploads/2014/12/wordsesh-3-752x317.png\" alt=\"wordsesh-3\" width=\"627\" height=\"264\" /></p>\n<p>This weekend, <a href=\"http://wordsesh.org/\">WordSesh</a> 3 will begin. WordSesh is 24 straight hours of live streamed presentations and discussions from a variety of intelligent folks in the WordPress world.</p>\n<p>It starts at 0:00 UTC Saturday, which really means 7:00 p.m. Eastern time on Friday for those of us in America. It&#8217;ll run through Saturday evening.</p>\n<p>The <a href=\"http://wordsesh.org/#schedule\">lineup</a> for WordSesh is as good as any WordCamp, and the chat around the past events has been fantastic. Scott Basgaard and his team of volunteers do a great job.</p>\n<p>I&#8217;ll be on a WordPress news roundtable at the tail end of WordSesh. On Friday, I&#8217;m going to have some news that will help explain my radio silence of late, and will probably spice up the conversation I&#8217;m to have with Jeff Chandler (of WP Tavern), Dre Armeda and Brad Williams (of DradCast) and Doc Pop (of Torquemag). I hope you&#8217;ll watch.</p>\n<p>Check out all the information on the <a href=\"http://wordsesh.org/\">WordSesh</a> website, follow <a href=\"https://twitter.com/wordsesh\">@WordSesh</a> on Twitter, and RSVP if you&#8217;d like to attend. There are already over 600 people signed up. It&#8217;s completely free and community supported. I love this event and I&#8217;m glad to see it happen again.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 23:30:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"Post Status: Matt Mullenweg’s 2014 State of the Word\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7213\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://poststatus.com/matt-mullenwegs-2014-state-word/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11832:\"<p><img class=\"aligncenter size-large wp-image-7215\" src=\"https://poststatus.com/wp-content/uploads/2014/10/mullenweg-752x564.jpg\" alt=\"mullenweg\" width=\"627\" height=\"470\" /></p>\n<blockquote><p>&#8220;Oh, my name is Matt Mullenweg by the way. Nice to meet you.&#8221;</p></blockquote>\n<p>After the WordPress co-founder welcomed the largest WordCamp San Francisco audience ever, he introduced himself and began this year&#8217;s State of the Word &#8212; the annual talk where he provides insight of the last year of WordPress and inspiration for the future.</p>\n<p><em>edit</em>: The video is now available:</p>\n<div class=\"wp-video\"><!--[if lt IE 9]><script>document.createElement(\'video\');</script><![endif]-->\n<a href=\"http://videos.videopress.com/GmPDhkyi/135_3_dvd.mp4\">http://videos.videopress.com/GmPDhkyi/135_3_dvd.mp4</a></div>\n<p><a href=\"http://wordpress.tv/2014/10/26/matt-mullenweg-the-state-of-the-word-2014/\">Or watch on WordPress.tv</a></p>\n<h3>The last WCSF as we know it</h3>\n<p>WordCamp San Francisco has been here in Mission Bay for 7 years, and it&#8217;s the last year here. Next year, things are going to change. There will be a WordCamp US (Matt notes it&#8217;s a working title) that will be modeled similarly to WordCamp Europe. The name, location and date are yet to be determined.</p>\n<h3>The annual WordPress survey</h3>\n<p>This year there were over 33,000 responses to the annual WordPress survey.</p>\n<p>Only 23% of the survey respondents were from the United States &#8212; a 6% increase of international respondents. And for the first time ever, non-English downloads surpassed English downloads. This change is much due to the new internationalization tools in WordPress core itself.</p>\n<p>A quarter of the respondents now make their living fully off of WordPress &#8212; 7,539 people from the survey pool. Matt estimates those people alone make up for more than a billion dollars of economic impact.</p>\n<p>Of those people surveyed, they have between half a million and a million currently active websites they own or have developed. And 91% of those sites took less than 200 hours to make.</p>\n<h3>5 releases since the last WCSF</h3>\n<p><img class=\"aligncenter size-large wp-image-7218\" src=\"https://poststatus.com/wp-content/uploads/2014/10/contributors-752x560.jpg\" alt=\"contributors\" width=\"627\" height=\"466\" /></p>\n<p>Since last summer and the last WCSF, we&#8217;ve had five major releases of WordPress. Matt spent some time going over some of the features we&#8217;ve gained.</p>\n<p>From WordPress 3.6 to WordPress 4.0, WordPress has evolved an enormous amount in a short amount of time. It&#8217;s better on mobile; has a better user experience; is more performant; is easier to use for both developers and end users; and is the best publishing tool in the world.</p>\n<p>There have been seven release leads in that time:</p>\n<ul>\n<li>Jon Cave</li>\n<li>Andrew Nacin</li>\n<li>Helen Hou-Sandi</li>\n<li>Mark Jaquith</li>\n<li>Dion Hulse</li>\n<li>Mike Schroder</li>\n<li>Aaron Campbell</li>\n</ul>\n<p>Additionally, Matt highlighted another 8 significant contributors and five new committers to the WordPress project.</p>\n<p>In these five releases, there have been 785 contributors to the project. And Matt also highlights John Blackbourn &#8212; the WordPress 4.1 release lead, which will soon enter beta.</p>\n<h3>Two Drupal growth</h3>\n<p>Since last summer, WordPress has grown &#8220;two Drupal marketshares.&#8221;</p>\n<p>There have been 684 theme additions to the repository this year &#8212; a 36% increase year over year. There are now 2,781 themes in the repo.</p>\n<h3>iOS and Android</h3>\n<p>There have been two updates for Android, five for iOS, and we abandoned older platforms to focus on a better user experience. &#8220;Sorry, both of the Windows phone users,&#8221; he joked.</p>\n<p>Matt notes that there are now more mobile phones than humans on earth, and that this will continue to be a huge priority.</p>\n<h3>Developer.WordPress.org</h3>\n<p>Noted in the last WCSF State of the Word, <a href=\"http://developer.wordpress.org\">developer.wordpress.org</a> is now live. A little later that hoped, he noted, but it&#8217;s a huge achievement and improvement for WordPress documentation.</p>\n<h3>Community</h3>\n<p>There are over 100 meetup and WordCamp organizers here at WordCamp San Francisco. Matt asked them all to stand, with a personal thanks to their commitment to a difficult, but rewarding task.</p>\n<h3>Internationalization</h3>\n<p>We have a long way to go with Internationalization, but Matt highlights some of the progress and promise for the future, including the advancement of language packs that plugin and theme developers will be able to take advantage of.</p>\n<p>Soon &#8212; with the release of WordPress 4.1 &#8212; Matt announced that the WordPress plugin and theme directories will be fully localized, making it more accessible and fully translated for non-English speakers.</p>\n<p>&#8220;The discovery process [of themes and plugins] is prohibitive&#8221; unless we make it a priority to offer the same discovery features that are in English to other languages.</p>\n<blockquote><p>&#8220;We have the potential &#8212; thanks to the web &#8212; for WordPress to be a truly global experience.&#8221;</p></blockquote>\n<h3>Better WordPress.org stats</h3>\n<p>Matt is promising a better offering of statistics for WordPress theme and plugin providers &#8212; a task that&#8217;s being worked on right now by the .org team.</p>\n<p>These are numbers people have long wanted and are very difficult to get. This is a very welcome change.</p>\n<h3>Adoption of new releases</h3>\n<p>Matt says only 25% of users are on the latest install, WordPress 4.0. While he notes that it&#8217;s far better than it was in the past, we still have a lot of improvement we can make.</p>\n<p>And he goes into the importance of removing versions from the conversation in software. Users should not know or care the version of their software. They should only know that it works.</p>\n<p>&#8220;Our vision is that we&#8217;re like Chrome. &#8230; And the hosts have helped pioneer this.&#8221; But WordPress itself will eventually move to such a model; this is a thing that is controversial, but I believe it is an essential and inevitable evolution.</p>\n<p>Matt asked how many people had been hacked &#8212; and even in a room full of professionals &#8212; it was a lot of people. This is why updates are important, as updated WordPress installs are much safer.</p>\n<h3>Relationship with PHP</h3>\n<p>Matt spent some time talking about WordPress support for more modern versions of PHP.</p>\n<p>WordPress is notorious for being a poor supporter of modern PHP. But that&#8217;s ready to change.</p>\n<blockquote><p>&#8220;We&#8217;re going to start working with hosts to get everyone on PHP 5.5 or above.&#8221;</p></blockquote>\n<h3>The Twenty Fifteen theme</h3>\n<p>Matt is excited about Twenty Fifteen, this coming year&#8217;s default theme. He notes this is our fifth year with a new default theme, and it&#8217;s the same number of years that Kubrick was the only default theme. A massive success.</p>\n<h3>WordPress and Github</h3>\n<p>Matt Mullenweg says that starting this year, you can submit a pull request to WordPress on Github, &#8220;and that will not go into a black hole.&#8221;</p>\n<p>He asked how many people are using Github, and nearly everyone raised their hand. This removes a barrier to contributing to WordPress, and is a huge improvement.</p>\n<p>He also says that all development of the WordPress mobile apps is now on Github. It&#8217;s also worth noting that much of Automattic&#8217;s internal projects, like Jetpack, are run on Github.</p>\n<h3>Community communication with Slack</h3>\n<p>For the first time in 11 years, WordPress is leaving IRC for primary organization communication. We&#8217;re going to try a tool called <a href=\"http://slack.com\">Slack</a>, built by a company in San Francisco started by the former founder of Flickr. Slack has taken over communication in remote teams, from my experience, and will be excellent.</p>\n<p>Slack will also help us make use of integrations and notifications. Right after the talk, <a href=\"http://chat.wordpress.org\">chat.wordpress.org</a> will lead any WordPress.org user to a method for using Slack for communication.</p>\n<p>This is a huge partnership, and as someone that uses Slack daily, I&#8217;m incredibly excited. I&#8217;m sure there could be pushback for using a paid tool for this, but it&#8217;s certainly and interesting experiment and I&#8217;m excited to see what happens.</p>\n<p>It appears clear to me that contributing to WordPress will now be easier than ever.</p>\n<h3>Five for the future</h3>\n<p>Matt talked about his controversial blog post about the concept of <a href=\"http://ma.tt/2014/09/five-for-the-future/\">Five for the future</a>, something <a title=\"Contribution as culture\" href=\"https://poststatus.com/contribution-culture/\">I also opined about</a>.</p>\n<p>Matt highlighted three companies: Gravity Forms, WPMUDev, and Automattic are all now contributing 5%. Of course he notes others are doing it as well, but wanted to highlight those that have committed to doing it publicly.</p>\n<p>Matt discussed a number of ways people can contribute, and that folks can attend sessions to learn how to contribute both here at WCSF and at most other WordCamp events.</p>\n<blockquote><p>&#8220;A contributor, by the way, is a title that no one can give you except yourself.&#8221;</p></blockquote>\n<p>He called it an altruistic mentality of contribution.</p>\n<h3>The JSON REST API</h3>\n<blockquote><p>&#8220;Who&#8217;s excited about the REST API?&#8221;</p></blockquote>\n<p>Nearly everyone responded with enthusiasm. Matt talks about how WordPress.com has had a similar API for years now, and what they&#8217;ve learned, and how much potential there will be for the core version, and the importance for marrying the .com API and the .org API as they each approach 2.0.</p>\n<p>Matt wants us to re-think &#8220;the WordPress engine&#8221; as a kernel that can a hub for building all sorts of things that are more capable to be fit into a proper architecture for the case at hand versus &#8220;shoehorning&#8221; existing WordPress features to areas that aren&#8217;t really meant for it.</p>\n<blockquote><p>&#8220;Maybe what we need isn&#8217;t a way for theming the WP admin; maybe what we need is a way for 1,000 WP admins to be built.&#8221;</p></blockquote>\n<p>And for those admins to be able to fork each other, learn from one another, and create better and catered publishing experiences catered to specific use cases.</p>\n<p>We can expect the core WordPress JSON API in 2015.</p>\n<h3>The continuing importance of WordPress and mobile.</h3>\n<p>Matt discussed how important mobile is to the future of the web, and therefore WordPress. &#8220;They are winning,&#8221; he says about the phones, and says how phones are more available and evolving every year. &#8220;They&#8217;re getting bigger and bigger,&#8221; and the interfaces and methods for interacting with our phones are evolving as well.</p>\n<p>Matt believes that WordPress can play a central role in the further evolution of mobile applications and the mobile web. As the power of mobile devices gets better, Matt believes that the web will become a bigger part of the mobile experience than it is now &#8212; when the conversation seems to be completely centered around apps.</p>\n<blockquote><p>&#8220;This is one of the ways that we can be truly global.&#8221;</p></blockquote>\n<h3>Wrapping up</h3>\n<p>To democratize publishing, is the mission of WordPress.</p>\n<p>WordPress is a community, Matt states, and accessibility from a language, device, and any other point of view is critical to the mission of WordPress.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 23:30:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"Post Status: Postmatic wants to revitalize your WordPress email, starting with comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7197\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"https://poststatus.com/postmatic-wordpress-email/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4912:\"<p><img class=\"aligncenter size-large wp-image-7200\" src=\"https://poststatus.com/wp-content/uploads/2014/10/postmatic-752x307.gif\" alt=\"postmatic\" width=\"627\" height=\"255\" /></p>\n<p><a href=\"http://gopostmatic.com/\">Postmatic</a> is a new WordPress plugin that I think is quite promising. It&#8217;s aim is to eventually change the way you utilize WordPress email in many ways, but its comment functionality is what intrigued me immediately.</p>\n<p>Postmatic currently allows users to subscribe to comments and posts by email; but what sets it apart is that it enables <em>reply by email</em> functionality as well. That&#8217;s something that has been high on my list of wants for a WordPress plugin for a long time, and I wanted it without switching to a third party system like Disqus.</p>\n<p>All in all &#8212; aside from enabling replies by email &#8212; the current feature set is quite similar to Jetpack&#8217;s Subscriptions module. Postmatic has widgets for post subscriptions and will send subscribers new posts and allow them to get emailed comment notifications as well.</p>\n<p></p>\n<p>I asked Jason Lemieux, a co-founder of Postmatic, if they were considering a way to import from Jetpack or otherwise integrate with it, and they are. They&#8217;re working now to make it so that your old posts using Jetpack&#8217;s subscription module for comment notifications will still work, and your new posts will use Postmatic.</p>\n<p>I had a pretty thorough conversation with Jason and got to see Postmatic in action. For a free plugin especially, the functionality is quite impressive. I tested subscribing to comments, replying by email, and opting into subscriptions, and it is all very smooth. Here&#8217;s a sample reply notification to my email.<span id=\"more-7197\"></span></p>\n<div id=\"attachment_7201\" class=\"wp-caption aligncenter\"><img class=\"wp-image-7201 size-large\" src=\"https://poststatus.com/wp-content/uploads/2014/10/postmatic-email-752x816.gif\" alt=\"postmatic-email\" width=\"627\" height=\"680\" /><p class=\"wp-caption-text\">Sample Postmatic notification email</p></div>\n<p>Postmatic is already in beta with their API as well. With a little legwork, you can utilize Postmatic for a variety of custom use cases. I know I&#8217;d love to play with it to see if I could create email campaigns for custom post types or multiple lists. They also intend to monetize the plugin via a few avenues &#8212; including ensuring mail delivery and functionality add-ons.</p>\n<p>Postmatic &#8212; available for <a href=\"https://wordpress.org/plugins/postmatic/\">download on WordPress.org</a> &#8212; is and will remain completely free. At some point they&#8217;ll exit beta and they will offer paid delivery of outgoing mail for larger sites. They understand the limitations of sending email through your own server and are using Mailgun to ensure delivery. They also have an extensive &#8212; and for now private &#8212; list of features they aim to introduce to Postmatic.</p>\n<p>The product is definitely version 1.0. Advanced list management, and more advanced campaign delivery is still not ready. But I was impressed by how good of a 1.0 Postmatic is, and how much effort Jason and his business parter, Dylan Kuhn, have clearly invested heavily into the product. For instance, subscriber importing is already possible, so you could move to Postmatic for post delivery right away. They <a href=\"http://gopostmatic.com/setup/\">have videos show how to do that and more</a> already available.</p>\n<p>They tell me as well that Postmatic is in very early stages. Right now they are working on more advanced template building and other features to help tame your WordPress emails. I think they definitely have other services like <a href=\"http://jetpack.me\">Jetpack&#8217;s</a> Subscriptions and <a title=\"WYSIJA is now MailPoet\" href=\"https://poststatus.com/wysija-now-mailpoet/\">MailPoet</a> in their sights.</p>\n<p>I think WordPress email is ripe for disruption. Imagine, currently, all the ways users can get emails from a website, with little continuity: WordPress itself, Mailchimp or other newsletter provider, Jetpack / WordPress.com, eCommerce solutions, form solutions. Each of these sends email and each has their own quirks, look and feel, and otherwise.</p>\n<p>I&#8217;d love to see a service like <a href=\"http://gopostmatic.com/\">Postmatic</a> help tame WordPress email as a whole, and offer a more seamless experience for my website visitors that receive email from me.</p>\n<p>In the short term, I doubt any service will be able to do this perfectly. But I think as WordPress sites send more and more mail, continuity in this arena will be very important. I know, for me, as I prepare to enable <a title=\"The future of Post Status\" href=\"https://poststatus.com/radical/\">club memberships on Post Status</a>, it&#8217;s top of my mind to provide a quality email experience to my members.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 23:30:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"Post Status: LoopConf: A new WordPress conference that’s only for developers\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7188\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://poststatus.com/loopconf-new-wordpress-conference-thats-developers/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3300:\"<p>&nbsp;</p>\n<p><img class=\"aligncenter size-large wp-image-7191\" src=\"https://poststatus.com/wp-content/uploads/2014/10/loopconf1-752x295.png\" alt=\"loopconf\" width=\"627\" height=\"245\" /></p>\n<p>Early May 2015 will be the first ever <a href=\"http://loopconf.io/\">LoopConf</a>, a WordPress conference that&#8217;s geared solely toward developers. Ryan Sullivan, the owner of <a href=\"http://wpsitecare.com\">WP Site Care</a>, is hosting the conference that is to be held in Las Vegas.</p>\n<p>LoopConf describes itself like this:</p>\n<blockquote><p>LoopConf is the greatest conference ever created for WordPress developers. LoopConf came about as we heard technically-minded folks talk about wanting to get together and dive deep into advanced engineering and development topics. We&#8217;ve assembled an amazing group of speakers to get this inaugural event started off on the right foot, and we&#8217;re excited to share our excitement and passion for WordPress with all of you in an exciting two-day event. We hope that you join us to celebrate the software we love, enjoy each other&#8217;s company, and learn from one another.</p></blockquote>\n<p>There are already six speakers confirmed:</p>\n<ul>\n<li><a href=\"http://nacin.com\">Andrew Nacin</a>: WordPress lead developer, works at Audrey Capital</li>\n<li><a href=\"http://helenhousandi.com/\">Helen Hou-Sandí</a>: Lead developer of WordPress 4.0, works at 10up</li>\n<li><a href=\"http://ghost.org\">John O&#8217;Nolan</a>: Founder of Ghost and former WordPress contributor</li>\n<li><a href=\"http://www.balkhis.com/about/\">Syed Balkhi</a>: Owner of Awesome Motive, the parent company for WP Beginner, List 25, OptinMonster, and others</li>\n<li><a href=\"http://jennmoney.biz/\">Jenn Schiffer</a>: Open web engineer at Bocoup</li>\n<li><a href=\"http://yoast.com\">Joost de Valk</a>: owner of Yoast and maker of the WordPress SEO plugin, amongst others</li>\n</ul>\n<p>The initial speaker line-up is pretty fantastic. I&#8217;d love to learn more from each one of them.</p>\n<p>LoopConf is not a WordCamp or associated with the WordPress foundation. It&#8217;s an independent WordPress conference, and Ryan says it&#8217;s the first in-person developer only WordPress conference he knows of. Most WordCamps are very catered to a diverse audience.</p>\n<p>This could be a good way for people to have more developer centric conversations. I&#8217;m certainly interested to see how it goes, and would like to make it myself. They are seeking sponsors and speaker submissions now. I don&#8217;t know how much the tickets will be exactly, but Ryan tells me he hopes for LoopConf to have a prestige and quality similar to An Event Apart events, but for WordPress &#8212; so I imagine the tickets won&#8217;t be cheap.</p>\n<p>As the WordPress conference ecosystem continues to blossom, I&#8217;m sure this isn&#8217;t the only one we&#8217;ll see like this. Non-WordCamp, niche events like <a href=\"http://pressnomics.com\">PressNomics</a> helped lead the way for those that are happening now, and I think generally it&#8217;s been good to have a diverse array of options for people to attend and learn from one another.</p>\n<p>You can keep up with <a href=\"http://twitter.com/loopconf\">@LoopConf</a> on Twitter or <a href=\"http://loopconf.io\">via the website</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 23:30:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"Post Status: 5 years into business, Pagely is growing faster than ever\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7174\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://poststatus.com/pagely-growth-wordpress-hosting/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9862:\"<p><img class=\"aligncenter size-full wp-image-7177\" src=\"https://poststatus.com/wp-content/uploads/2014/10/pagely.png\" alt=\"pagely\" width=\"640\" height=\"220\" /></p>\n<p><a href=\"http://pagely.com\">Pagely</a> is celebrating their fifth year of business right now. They have just launched their newly designed website (<em>note to early readers</em>: it&#8217;s in process of launching at this moment, so some links may not work until later today) to reflect some of the ways they&#8217;ve changed over the years. They are also growing, rapidly.</p>\n<p>The new website is a complete rebrand. They&#8217;ve tweaked their logo many times over the years, but they&#8217;ve completely changed it now. It&#8217;s much more modern and can be used in a variety of ways.</p>\n<p>The new website is flat, geometric, modern, and as sassy as ever (like with their <a href=\"https://pagely.com/about-us/investors/\">Investors page</a> they are quite proud of). In all, the redesign attempts to showcase happy customers and what makes them different.</p>\n<p><a href=\"https://poststatus.com/pagely-growth-wordpress-hosting/pagely-new-homepage/\" rel=\"attachment wp-att-7181\"><img class=\"aligncenter size-large wp-image-7181\" src=\"https://poststatus.com/wp-content/uploads/2014/10/pagely-new-homepage-752x547.png\" alt=\"pagely-new-homepage\" width=\"627\" height=\"456\" /></a></p>\n<p>They are introducing <a href=\"https://pagely.com/ambassadors/\">brand ambassadors</a> &#8212; a kind of super testimonial &#8212; that includes names you&#8217;ll surely recognize from the WordPress community.</p>\n<p>Additionally, they are giving other managed hosts a bit of a sting with what they call <a href=\"https://pagely.com/turnthepage/\">#turnthepage</a>, a dedicated page to highlight that they don&#8217;t charge for pageviews, something that most managed WordPress hosting companies do.<span id=\"more-7174\"></span></p>\n<p>Pagely has implemented the new branding and design elements across most of their platform, including their Support sub-site.</p>\n<p><img class=\"aligncenter size-large wp-image-7176\" src=\"https://poststatus.com/wp-content/uploads/2014/10/support-pagely-752x491.png\" alt=\"support-pagely\" width=\"627\" height=\"409\" /></p>\n<p>In addition to branding and a web redesign, Pagely is attempting to showcase that they were first to market with managed WordPress hosting, but also that they are best in class. The strategy &#8212; and particularly their recent all-in <a title=\"Pagely has new plans, a new dashboard, and a new Amazon Web Services infrastructure\" href=\"https://poststatus.com/pagely-wordpress-hosting-amazon/\">move to being an AWS-based service</a> &#8212; appear to be working.</p>\n<h3>Record growth</h3>\n<p>I discussed the Pagely redesign and their recent growth with Joshua Strebel, Pagely co-founder and CEO. He told me that they&#8217;ve seen an enormous amount of growth this year.</p>\n<p>Revenue is up 28% in the last month alone and between 40-45% quarter over quarter. This means that Pagely is on pace to more than double in size between this summer and next.</p>\n<p>To some this may seem a surprise, but it&#8217;s part of some slow and steady investments Pagely has made in recent years.</p>\n<p>They certainly did not scale at the pace of other players in the market &#8212; most notably <a href=\"http://wpengine.com\">WP Engine</a>. They also (as noted above with the Investors page) have bootstrapped their company from the beginning.</p>\n<p>Noone knows exactly how big Pagely is today, and that&#8217;s part of what you get with their owners. Though I&#8217;m told they are &#8220;more than 10 people but fewer than 50.&#8221;</p>\n<p><img class=\"aligncenter size-large wp-image-6550\" src=\"https://poststatus.com/wp-content/uploads/2014/05/pagely-team-752x378.jpg\" alt=\"pagely-team\" width=\"627\" height=\"315\" /></p>\n<p>The Strebel&#8217;s (on the left of the picture above) own the company &#8212; only sharing equity with some key employees &#8212; and they are proud of their independence.</p>\n<p>It&#8217;s nearly impossible to be a Pagely customer without feeling the presence of Josh and Sally Strebel&#8217;s own personalities. And while Josh is an opinionated figure in the WordPress community, Pagely customers seem quite happy with that.</p>\n<h3>Managed host customer satisfaction</h3>\n<p>Steven Gliebe started a new project recently called <a href=\"http://hostingreviews.io/\">HostingReviews.io</a>, a website that attempts to collect non-biased reviews from social media about various hosting solutions. Pagely has a 94% happiness rating according to HostingReviews.io &#8212; matched only by <a href=\"http://getflywheel.com\">Flywheel&#8217;s</a> 95% rating.</p>\n<p>I like Steven&#8217;s project because he is not using affiliates at all with this project, an aspect that spoils most hosting review websites. Here&#8217;s a breakdown of some others:</p>\n<p><a href=\"https://poststatus.com/pagely-growth-wordpress-hosting/hosting-reviews-io/\" rel=\"attachment wp-att-7175\"><img class=\"aligncenter size-large wp-image-7175\" src=\"https://poststatus.com/wp-content/uploads/2014/10/hosting-reviews-io-752x757.png\" alt=\"hosting-reviews-io\" width=\"627\" height=\"631\" /></a></p>\n<p>&nbsp;</p>\n<h3>Changes in managed WordPress hosting markets</h3>\n<p>It&#8217;s been an interesting time to analyze the managed WordPress hosting market. For one, the term &#8220;managed WordPress hosting&#8221; is here to stay. Nearly every large player &#8212; including the likes of GoDaddy, Bluehost, Dreamhost, and more &#8212; offer a managed WordPress hosting product.</p>\n<p>The differences between these large company products and the original smaller players &#8212; players like Pagely, WP Engine, Pressable, and later entrants like Flywheel, Siteground, and Pantheon &#8212; are beyond the name of the product. You really have to dig into each service and business model to get a full grasp of how they are unique.</p>\n<p>And this is really hard.</p>\n<p>For one, you can find positive and negative things about every host in the world. But also, these companies are often targeting different audiences. For instance, GoDaddy and the other large hosts pretty clearly want the smaller website audience, but to upsell them with a more WordPress-specific package. And that&#8217;s fine; they can offer some great functionality for that.</p>\n<p>But Pagely, Pantheon, and some others are going after bigger fish; and they are marketing themselves appropriately.</p>\n<h3>Going after WordPress.com VIP</h3>\n<p><a href=\"http://vip.wordpress.com/\">WordPress.com VIP</a> is the king of the big-WordPress mountain. They have the promise of infinite scale and excellent reliability. It&#8217;s Automattic&#8217;s own product and an excellent business model for them.</p>\n<p>They are able to charge big companies big dollars (relative to other WordPress hosting, not compared to some enterprise software these companies are used to) to get the assurance that their website is hosted safely and reliably.</p>\n<p>WordPress.com <a href=\"http://vip.wordpress.com/stats/\">serves billions of pageviews every month</a>. It&#8217;s simply a massive platform and a comfortable place for companies to take their WordPress hosting needs.</p>\n<p>Pagely wants to be an alternative to WordPress.com VIP. They see themselves as a viable and attractive alternative. For one, they&#8217;ll tell you that you can run anything on Pagely; whereas WordPress VIP has a restricted ecosystem that involves approved-only plugins and stringent code reviews for any custom code, that often requires one of their VIP service partners to perform the work.</p>\n<blockquote><p>VIP is a great service. However it is no longer the only service capable of serving clients at scale. We are winning more of those high-caliber clients that need the extra flexibility our stack offers.</p>\n<p>&#8211; Joshua Strebel, Pagely CEO</p></blockquote>\n<p>Pagely and others seeking the high end market are still relatively early on in their efforts; WordPress.com VIP is a behemoth in that market.</p>\n<h3>A changing tide</h3>\n<p>I&#8217;ve noticed &#8212; and I&#8217;m sure some of you have too &#8212; a change in tide of WordPress managed hosting. This year has no doubt been a very tough one for some managed hosts.</p>\n<p>It&#8217;s been painful to see customers that were once happy with their service &#8212; to the point of being huge brand ambassadors themselves &#8212; to quietly leaving and moving on to something else, now with warranted skepticism.</p>\n<p>Personally, I try to stay pretty host-agnostic. It is a very difficult market to say anything about, due to its incredibly competitive nature. However, I think it&#8217;s obvious that Pagely &#8212; accompanied by the likes of <a href=\"http://siteground.com\">SiteGround</a> and <a href=\"http://getpantheon.com\">Pantheon</a> &#8212; is on the rise while some of the other early entrants to WordPress managed hosting are struggling to consistently deliver on their promises.</p>\n<p>However, with new-found popularity and fast growth, Pagely too can be susceptible to some of the same growing pains of their competition. But they say they&#8217;re ready for it.</p>\n<p>They&#8217;ve invested heavily in AWS and put all their technology chips in Amazon&#8217;s basket. And they assure me that they have been hiring some of the best support techs and engineers in the business. Additionally, they tell me that because they aren&#8217;t investing a ton of money into marketing, their customer influx is more natural and less likely to strain more linear growth levels.</p>\n<p>Time will tell if <a href=\"http://pagely.com\">Pagely</a> is ready to scale with players that have more money and resources than they do, but they&#8217;re definitely excited about the recent growth, the new brand and website, their brand ambassadors, and the challenges ahead.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 23:30:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"Post Status: Is WordPress right for eCommerce?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7165\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"https://poststatus.com/wordpress-right-ecommerce/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11014:\"<p><img class=\"aligncenter size-large wp-image-7170\" src=\"https://poststatus.com/wp-content/uploads/2014/10/wordpress-ecommerce-discussion-752x352.jpg\" alt=\"wordpress-ecommerce-discussion\" width=\"627\" height=\"293\" /></p>\n<p>I&#8217;m going to take a leaf out of <a href=\"http://www.chrislema.com/\">Chris Lema&#8217;s</a> book right now to answer whether WordPress should be used for eCommerce: <strong>It depends</strong>.</p>\n<p>There are camps of thought that think WordPress isn&#8217;t right for eCommerce, and there are people that think it&#8217;s the only way to go. Having worked with and used several different eCommerce platforms (both hosted and self-hosted), I&#8217;ve definitely developed the mindset that there are use cases for each. WordPress can be the right choice in a lot of circumstances, but not all.</p>\n<h3>Hosted vs. self-hosted</h3>\n<p>If you&#8217;re not sure about the major differences between hosted vs self hosted platforms, I recommend reading <em>Patrick Rauland&#8217;s</em> <a href=\"http://speakinginbytes.com/2014/08/hosted-vs-self-hosted-e-commerce/\">overview of the major differences</a>. WordPress eCommerce usually falls under self-hosted eCommerce (I don&#8217;t count WordPress.com since it uses external eCommerce solutions). Forbes also <a href=\"http://www.forbes.com/sites/allbusiness/2014/09/26/which-e-commerce-platform-is-the-best-choice-for-your-online-store/\">recently wrote about this</a>, though I don&#8217;t necessarily agree with their conclusions.</p>\n<p>The <a href=\"http://www.practicalecommerce.com/articles/70101-When-to-Avoid-WordPress-Ecommerce\">typical viewpoint</a> is that WordPress plugins like WooCommerce or Easy Digital Downloads are great for small stores or people that just want to quickly and easily sell a few items, while hosted platforms like Shopify and Bigcommerce are for &#8220;serious&#8221; stores.</p>\n<p>This viewpoint is actually pretty backwards, not to mention the fact that the number of items is a poor way of determining which platform you should use.</p>\n<h3 id=\"give-each-its-due\">Give each its due</h3>\n<p>Is WordPress the best platform on which to build apps? I don&#8217;t always think so, but it <strong>could be</strong>. Is it always a good choice for eCommerce? Nope. However, it&#8217;s the <strong>right one</strong> for lots of stores, and it&#8217;s the <strong>wrong one</strong> for lots of stores.</p>\n<p>There are a few major strengths and weaknesses of both WordPress and hosted solutions. I&#8217;ve worked most with <a href=\"http://www.woothemes.com/woocommerce/\">WooCommerce</a>, <a href=\"http://easydigitaldownloads.com/\">Easy Digital Downloads</a>, and <a href=\"http://www.shopify.com/\">Shopify</a>, but have tried lots of other eCommerce solutions for comparison. Some of the knocks against WordPress aren&#8217;t valid, but we should note that some are.</p>\n<h3>WordPress eCommerce weaknesses</h3>\n<p>Everyone loves to talk about how easy certain WordPress plugins are to use. When you compare WordPress plugins to something like Shopify, this just <strong>isn&#8217;t true</strong>. They may be easy to use for people that are familiar with WordPress, but not for the average user who wants to start selling online with no experience.</p>\n<p>WordPress requires a domain name purchase, hosting setup, installation, plugin installation and setup, theme installation and setup, blah blah blah, you get the drift. With hosted solutions, you don&#8217;t worry about this (though solutions like <a href=\"http://evermo.re/\">Evermore</a> &#8212; which was <a title=\"Evermore, hosted WordPress with power and ease of use\" href=\"https://poststatus.com/evermore-interview/\">covered by Post Status</a> when it launched &#8212; make this interesting). You pay your monthly bill, and you&#8217;re handed a store website &#8211; you just pick the name and get rolling. You can start adding products right away, and then you might get into changing your theme or other setup.<span id=\"more-7165\"></span></p>\n<div id=\"attachment_7167\" class=\"wp-caption alignright\"><img class=\"wp-image-7167 size-medium\" src=\"https://poststatus.com/wp-content/uploads/2014/10/easy-300x258.jpg\" alt=\"easy\" width=\"300\" height=\"258\" /><p class=\"wp-caption-text\"><a href=\"https://c2.staticflickr.com/4/3181/3086827283_e9e762331c.jpg\">Image Credit</a></p></div>\n<p>Some of the site tweaks or setup with hosted solutions aren&#8217;t easy, but the learning curve for a solution like Shopify is far gentler than the learning curve for something like WooCommerce.</p>\n<p>There are also <strong>WP Cron</strong> issues for some sites, as it&#8217;s not a perfect system for scheduling actions, like recurring payments. It can work pretty well, but other platforms can make this far easier to implement and more reliable than Cron.</p>\n<p>WordPress store owners are also <strong>responsible</strong> for their own hosting, software updates, and security. For many site owners, these are huge responsibilities. Hosted solutions roll all of this into their package so that users don&#8217;t have to know how their website is powered. They just have to use it.</p>\n<p>Both WordPress and hosted solutions will scale, but there are considerations with WordPress that users need to be aware of. Database issues (like backups or memory with massive amounts of customers and orders) should be addressed, hosting has to be optimized, and plugins need to scale with the site. With a hosted solution, none of this is your problem as a user.</p>\n<h3>WordPress eCommerce strengths</h3>\n<p>Bearing these weaknesses in mind, it&#8217;s a bit crazy to me that WordPress is sometimes referred to as the &#8220;easy solution&#8221; or the right tool for &#8220;small stores&#8221;. It&#8217;s not. In many cases, it&#8217;s like bringing a tank to the eCommerce playground.</p>\n<p>So what does WordPress do well?</p>\n<p>First, WordPress offers the most all-in-one website solution available. WordPress can offer the eCommerce aspects of the website, in addition to its many other CMS features. The ability to create a single, seamless CMS experience for a multi-purpose website makes it quite compelling and more budget-friendly than more &#8220;eCommerce first&#8221; platforms.</p>\n<p>Second, it&#8217;s optimized for <strong>SEO</strong>. Your content is crucial here, and WordPress is built for content. More importantly, if you&#8217;ve tried to blog on another platform, you know how painful it can be (don&#8217;t start with me Squarespace fans, that thing is difficult to use). WordPress doesn&#8217;t encourage you to avoid blogging to avoid headache: it&#8217;s built for <strong>complete websites</strong>, and is not simply focused on eCommerce.</p>\n<p>WordPress also contains functionality that you can&#8217;t always get with different platforms. There&#8217;s a massive selection of plugins, themes, and all sorts of solutions for WordPress that are readily available. Since it&#8217;s open source, it&#8217;s far easier to find ways to customize it when compared to closed platforms like Bigcommerce.</p>\n<p>Speaking of customizations, your ability to customize WordPress or plugins is <strong>far</strong> easier than with hosted solutions. There&#8217;s lots of functionality that can be achieved with WordPress that&#8217;s not even possible in hosted solutions. For example, developers have no control over the Shopify checkout process, but this can be entirely customized with WordPress.</p>\n<p>You can also usually find a plugin that will provide a &#8220;starting point&#8221; for a customization project. Even if you find a Shopify or Bigcommerce app that gets <em>close</em> to what you need, but not quite, you&#8217;ll need to create a completely custom solution anyway &#8211; there&#8217;s no &#8220;extending&#8221; there.</p>\n<p>Along with customization is the <strong>control over your environment</strong>. You can spin up your eCommerce site on something like Digital Ocean, and you&#8217;ve got control over the entire site, from server to theme.</p>\n<h3>Product type</h3>\n<p>The biggest difference for me between hosted solutions and self-hosted actually isn&#8217;t usability or scalability &#8211; it&#8217;s <strong>product type</strong>. Can almost every eCommerce platform sell tee shirts? Yes. Even EDD can do that, and it&#8217;s made for digital products.</p>\n<p>However, selling complex products becomes infinitely more difficult on hosted platforms, as you&#8217;re restricted to what the API offers for product changes, which isn&#8217;t always a lot. For example, if you&#8217;ve ever tried to add pricing changes for customization options in Shopify, you know that it literally takes some wizardry, black magic, and possibly bubble gum used as tape to do so.</p>\n<p>WordPress plugins make this far easier, because the entire platform is open, not just an API. Most eCommerce plugins have more than enough actions or filters to change products, product pages, checkout forms, or any other part of your site.</p>\n<h3>Recap</h3>\n<p>Hosted eCommerce solutions are typically easy to use, and can provide some customization options via apps or other add-on services. However, it&#8217;s like renting a house versus owning. With a rented house, you can&#8217;t go knocking down walls or completely remodeling &#8211; you&#8217;ve got to work inside of a framework you&#8217;re given. This is exactly how a hosted solution works.</p>\n<p>The benefit to this is that you absolve yourself of a lot of responsibility and worry. The entire experience is managed and supported, and is typically very easy to work with.</p>\n<p>However, WordPress eCommerce is like buying the house. You can do whatever you want &#8211; add-on, rebuild sections of the house, change layouts around, add tunnels to other houses, you name it. However, when the water heater blows up, it&#8217;s your responsibility.</p>\n<p>WordPress also affords the opportunity to sell complex products, such as measurement based products like corks by the pound, that simply can&#8217;t be sold on other platforms. The same ability to customize WordPress so thoroughly lets you customize the eCommerce plugin you&#8217;re using.</p>\n<p>You gain the flexibility that comes with the platform, as well as the benefits like tons of plugins, themes, a great content structure, and a consistently maintained and updated core solution. However, the Frankenstein site that you build is your baby, and yours alone &#8211; you need to host it, maintain it, and care for it.</p>\n<p>WordPress lets you create advanced functionality via plugins and customizations, but isn&#8217;t right for users looking for an easy, basic shop setup. If you want a move-in ready house or a beautiful rental, you should look at hosted solutions. If you&#8217;re willing to make your dream house from great bones and foundation, or you need to sell fairly complex products, then WordPress might be it for you. It&#8217;s not the &#8220;easy&#8221; solution, but it can be a great one.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 23:30:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Beka Rice\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:36:\"Post Status: Contribution as culture\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7153\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"https://poststatus.com/contribution-culture/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12488:\"<p><img class=\"aligncenter size-large wp-image-7157\" src=\"https://poststatus.com/wp-content/uploads/2014/10/five-percent-752x250.gif\" alt=\"five-percent\" width=\"627\" height=\"208\" /></p>\n<p><em>This post spends a lot of time analyzing and referencing two other blog posts. Excuse me for that, but also be sure to read both, as they are relevant for this post and also interesting in their own right.</em></p>\n<p>Matt Mullenweg wrote a blog post called <a href=\"http://ma.tt/2014/09/five-for-the-future/\">Five for the Future</a> yesterday that advocates his belief that WordPress-centric companies should aim to utilize 5% of their company resources toward contributing back to the project.</p>\n<p>He noted in the post that <a href=\"http://automattic.com\">Automattic</a> isn&#8217;t quite to this point, but that they are working on it, and describes why he believes it&#8217;s important. He closes with this:</p>\n<blockquote><p>It’s a big commitment, but I can’t think of a better long-term investment in the health of WordPress overall. <strong>I think it will look incredibly modest in hindsight.</strong> This ratio is probably the bare minimum for a sustainable ecosystem, avoiding the <a href=\"http://en.wikipedia.org/wiki/Tragedy_of_the_commons\">tragedy of the commons</a>. I think the 5% rule is one that all open source projects and companies should follow, at least if they want to be vibrant a decade from now.</p></blockquote>\n<p>This was followed up by one of the co-founders of one of the very hosting companies Matt partially referenced in his post &#8212; WP Engine&#8217;s Ben Metcalfe &#8212; who responded with a blog post of his own: <a href=\"http://benmetcalfe.com/blog/2014/09/wordpress-what-exactly-do-they-get-for-their-5/\">WordPress: What exactly do they get for their 5%?</a></p>\n<p>I think I was immediately thrown off by Ben&#8217;s post title, but so many times throughout reading it I was shocked at how he made assumptions of Matt&#8217;s intentions or missed what I would call &#8220;the point&#8221;.</p>\n<h3>5% is not a decree</h3>\n<p>Obviously, Matt is not speaking from the mountaintop with a proclamation of law. This is his recommendation &#8212; one that he believes will reward the firms that strive for it.</p>\n<p>I believe that the community has already shown us that those that invest into WordPress are rewarded from it. We improve our understanding of a foundational software of our careers, improve our skills, are more marketable, more attractive to employers, and create natural opportunities for developing industry relationships.</p>\n<p>How should 5% of &#8220;people&#8221; be defined? I&#8217;m pretty sure Matt would agree that 5% of people or 5% of revenue toward people doesn&#8217;t really matter to him; yet Ben makes a continuous sticking point about the cost of &#8212; and need for &#8212; engineers.</p>\n<p>Additionally, while Matt utilizes full-time employees, the same (or better) effect could be had with shared time from more employees.</p>\n<p>I&#8217;m not big into absolutes, so it&#8217;s important to remember that while I&#8217;m advocating that Matt&#8217;s recommendation of 5% time, I think it&#8217;s simply a good recommendation. This is a free economy and companies can do what they want. But I think in the current and long term, contribution will be key to greater corporate success for those that choose to do so.</p>\n<h3>What does 5% cost, and who does it require?</h3>\n<p><span id=\"more-7153\"></span></p>\n<blockquote><p>While Matt was careful to include numerous non-engineering roles companies could help with, ultimately what drives the open source project is source code contribution by software engineers. &#8230;</p>\n<p>A reasonable engineer in the US costs $100k/y, and if you factor in benefits <em>(tax funded health-care, anyone?)</em> and overheads you could easily be looking at $130k or more per person, per year. &#8230;</p>\n<p>A 200+ person web hosting company would need to hire 10 engineers to meet a 5% goal, requiring a budget of anything between $1MM-1.3MM+ per year. Those engineers probably need a manager – to mentor them, provide career development etc. Those 11 people also put pressure on human resources, finance, legal, facilities etc – probably equating to another person again. Now we’re talking probably more like $1.25-$1.5m annually.</p></blockquote>\n<p>First, I believe Ben has spent too much time in the world&#8217;s largest cities if he believes engineers cost $100,000 per year on average. In my experience (yes, I interview people myself), that&#8217;s not the case, and based on my decent view of the ecosystem it&#8217;s not an appropriate going rate &#8212; especially if the offer on the table is a particularly desirable position.</p>\n<p>More importantly, <strong>the project needs far more non-technical contributors</strong>. Ben&#8217;s assertion that &#8220;ultimately&#8221; software engineers drive the project is not true. Users drive the project. A technically savvy user-minded contributor can be a beacon of light to a group of software developers. And given the user-facing nature of WordPress itself, non-engineer contributors could drastically improve the less code-sexy parts of the WordPress ecosystem: project management, docs, training, testing, support, translation, etc.</p>\n<p>Additional to &#8220;core&#8221; contributions, WordCamps, plugins, themes, communities, and many other venues are outstanding places where contributors &#8212; yes, they&#8217;re still contributors! &#8212; can impact the overall project.</p>\n<p>Finally, as I noted above, I think companies could quite effectively contribute parts of employees&#8217; time versus dedicated 100% time, which would also prevent the need to have dedicated managers for open source contributors.</p>\n<h3>Foundational software to your business</h3>\n<p>Ben spends a chunk of time saying that big companies like GoDaddy get a &#8220;get out of jail free card&#8221; and that obviously Matt wouldn&#8217;t expect they dedicate 5% of their thousands of employees.</p>\n<p>GoDaddy definitely benefits from WordPress and they also contribute to it; and no, they don&#8217;t contribute 5% I&#8217;m sure. But WordPress is not foundational to GoDaddy&#8217;s business. They have a dedicated sub-product for it, and they also have many contributors to it.</p>\n<p>WP Engine, and many others (including mine), are almost completely or completely reliant on WordPress as a platform. WordPress and its underlying technologies are foundational to our careers and businesses.</p>\n<p>It is simply a different story to compare a company that would continue on pretty much fine without WordPress and one that would have to seriously reconsider their entire business model.</p>\n<p>For example, let&#8217;s compare the scenario to a publisher. <a href=\"http://recode.net\">Re/code</a> is built on WordPress. They have a staff of 20+. Do they <em>completely rely</em> on WordPress for their website? Yes. For their business model? No. In their scenario, it makes sense for them &#8212; and could benefit them pretty directly &#8212; to allocate some time of some employees to WordPress, but if WordPress disappears they can and will migrate to a different platform.</p>\n<h3>Contributing to the full stack</h3>\n<p>It was questioned to me on Twitter, after my initial reaction to Ben&#8217;s post, whether I contribute 5% of my time to open source projects like PHP, MySQL, and other tools that WordPress relies on.</p>\n<p>This is a good question and point, but it does not cause me to stumble in my opinions. I believe open source contributions in general benefit the entire software stack.</p>\n<p>In my scenario, I can be more impactful on the WordPress project than others. But I believe contributions can take many shapes, in both directions.</p>\n<p>Some folks, like Daniel Bachhuber, greatly contribute to the project as a whole by supporting upstream projects like <a href=\"http://wp-cli.org\">WP CLI.</a></p>\n<p>Automattic is a fantastic example of a company that has both upstream and downstream contributions. They are active contributors to, employers of contributors or founders, or monetary sponsors to a huge number of downstream projects: WordPress, PHP, Nginx, jQuery, Elastic Search, Node, Socket.io, and probably a bunch I can&#8217;t think of or don&#8217;t know about. Additionally, they are a driving force behind dozens of upstream, open source themes and plugins.</p>\n<p><em>Edit: Matt <a href=\"https://twitter.com/photomatt/status/517270097355091968\">says in a Tweet</a> where Andrey Savchenko asked for clarification about PHP contributions that Automattic doesn&#8217;t actively contribute to PHP. Though I think I define contribution a bit more loosely than Matt does.</em></p>\n<p>Whether a company is contributing to their foundational piece of software, a downstream or upstream application, or on an adjacent aspect that leads to the betterment of the platform that is foundational to their business objectives, then I believe it will in turn be beneficial to their bottom line.</p>\n<h3>Contribution as culture</h3>\n<p>Contribution should not be considered an isolated cost, but an enabling investment.</p>\n<p>If I run a business that relies on a foundational piece of software like WordPress, then it benefits me greatly for my employees &#8212; no matter what role they play within the company &#8212; to be intimately familiar with that software.</p>\n<p>In my last job, I was tasked with guiding a transition of my company from developing mostly on a proprietary CMS to WordPress. I consistently preached the importance for everyone in the company to understand some fundamentals of WordPress itself. During my time there and since I&#8217;ve moved on, I&#8217;ve seen other members of that company learn the software, get involved in our local community, and even contribute back to WordPress itself; and both they and the company are better off for it.</p>\n<p>Whether an employee is in sales, customer service, design, development, management, or wherever else &#8212; every employee knowing your product is important. I firmly believe this. I would want anyone in an organization I&#8217;m part of to be able to discuss our product in detail and with confidence to anyone.</p>\n<p>When your company relies on a foundational piece of software &#8212; such as those we&#8217;re discussing in this post &#8212; that&#8217;s in effect part of your product. We are building products and services around and for WordPress. How important should it be that our company&#8217;s employees understand it?</p>\n<p>And how can they understand it better? By contributing of course!</p>\n<p>Have a new support rep? Show them the WordPress.org forums to get their feet wet. New designer or front-end developer? Have them sit in on default theme conversations or read through the Make UI blog. New sales person? Get them involved at your local meetup and WordCamp. This list can go on.</p>\n<p>Avenues for contribution are an incredible gateway for learning WordPress. Blogging about WordPress (another avenue of contribution) has greatly enabled me to be better at my job, and therefore made me significantly more valuable to the companies I&#8217;ve worked with.</p>\n<h3>Five for now</h3>\n<p>Matt called his post Five for the Future, and talked specifically about how a 5% investment by a company will ensure a greater future for WordPress and therefore said company. I disagree.</p>\n<p>Contributing now will benefit the company and its employees <em>right now</em>. And while both Matt and Ben focused on individuals within the company being targeted contributors, I think it&#8217;s much more beneficial to have a much larger percentage of a company contributing a portion of their time (even if small). I&#8217;d rather see 2 of 200 employees be full time contributors and then have 80 10% contributors than have 10 full time contributors.</p>\n<p>I think we&#8217;ve seen many, many examples of contributors (people and companies) reaping tangible and intangible benefits from when they contribute &#8212; whether that contribution is to the codebase or the community. Contributors in this ecosystem come out on top.</p>\n<p>Contributions are not an isolated cost or burden. Nor should their effects be limited to good faith investments to the sustainability of the ecosystem.</p>\n<p>Contributions benefit the bottom line, and they benefit the bottom line right now.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 23:30:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"Post Status: The anatomy of a security breach, and how to do good in a bad situation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://poststatus.com/?p=7134\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://poststatus.com/ithemes-security-breach-and-disclosure/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:12133:\"<p><img class=\"aligncenter size-large wp-image-7139\" src=\"https://poststatus.com/wp-content/uploads/2014/09/ithemes-dark-752x226.jpg\" alt=\"ithemes-dark\" width=\"627\" height=\"188\" /></p>\n<p>On Tuesday, iThemes posted an announcement that they had <a href=\"http://ithemes.com/2014/09/23/important-security-update-for-all-customers/\">suffered from a security breach</a> of their website and servers. The attackers had reached the servers which stored customer information, including email addresses, IP addresses, full names, and yes, passwords.</p>\n<p>iThemes was quick to notify customers via their blog, social media, and their full customer email list about the breach. Approximately 60,000 users were affected. They warned that passwords were vulnerable. In <a href=\"http://ithemes.com/2014/09/25/update-2-security-update-for-ithemes-customers/\">the second update</a>, posted today, they gave more information about passwords, in response to many questions from users.</p>\n<p>It turns out that passwords were stored in plaintext on iThemes&#8217; server. That is, obviously, very bad practice.</p>\n<blockquote>\n<h3>Why Would You Store Passwords in Plain Text?</h3>\n<p>This is how the membership software we started using in 2009 did it. There are a number of factors for this, none that will make much of a difference at this point or make anyone feel any better about it, myself included.</p>\n<p>Know that it’s not because we did not value your data. As an organization, we have been working on a very large migration process that has required us to interlink legacy systems with the latest technologies. Anyone that has ever gone through that process understands the complexities and challenges.</p>\n<p>Frankly put, it’s been something we identified as a potential risk and are working rapidly now to rectify this issue as fast as humanly possible.</p></blockquote>\n<p>It&#8217;s also worth noting that their customer database and iThemes.com users were affected, but customers that use their Sync product to manage their own websites were not. So if you use iThemes Sync, and utilized your site passwords to connect, those accounts and passwords were not part of this breach.</p>\n<h3>aMember and legacy membership platforms</h3>\n<p>The membership platform that Cory highlights in the update is a<a href=\"http://www.amember.com/\">Member</a>, a membership management system that&#8217;s been around for many years. aMember only introduced <a href=\"http://www.amember.com/p/2011/11/amember-pro-version-4-stable/\">encrypted passwords in version 4</a>, which was released in November of 2011.</p>\n<p>I discussed aMember and plaintext passwords with some other folks that have a significant history with the membership platform, and there are some significant problems that anyone using aMember have experienced.</p>\n<p>First, most folks heavily using aMember aren&#8217;t using it out of the box. At the time, most membership sites were doing significant customizations to aMember to achieve desired functionality. So when the v.4 update came out, it was a very difficult update procedure for people to take advantage of the features.</p>\n<p>iThemes would even tell you that their current version of membership software doesn&#8217;t look much like aMember at all.</p>\n<p>iThemes is also not the first to be hacked and their aMember passwords leaked. Tuts+ Premium <a href=\"http://marketblog.envato.com/general/tuts-premium-security/\">had the same issue in 2012</a>.</p>\n<p>I discussed aMember at length with <a href=\"http://twitter.com/pippinsplugins\">Pippin Williamson</a>. He has done a lot of work on his brother&#8217;s membership site, <a href=\"http://cgcookie.com/\">CGCookie</a>, which also used aMember until 2012, when he did a huge migration of tens of thousands of members to a new platform.</p>\n<p>At the time, Pippin notes that aMember did not disclose passwords were stored in plaintext, so CGCookie had no idea that their users were vulnerable until they learned of the Tuts+ hack, wherein they put a planned migration &#8220;into hyperdrive.&#8221;</p>\n<p>The problem with iThemes&#8217; situation is that they knew of the plaintext passwords and didn&#8217;t address the obvious security vulnerability.</p>\n<p>All in all, the migration for CGCookie took months to perfect and significant juggling of priorities by their team.</p>\n<h3>Ticking time bomb</h3>\n<p>Speaking with Pippin, migrating from aMember was not an easy task. Paypal&#8217;s IPN handlers (a payment notification system) were tightly linked to aMember and preventing customer accounts from being disconnected from the membership site took weeks of engineering. Additionally, simply upgrading to the newer versions was also terrible.</p>\n<p>Many other WordPress companies have used aMember in the past as well, storing plaintext passwords just like iThemes today.</p>\n<p>So, aMember has definitely been a problem before now, but iThemes has absolutely slacked in their prioritization of the issue. Simply put, it&#8217;s inexcusable to put users into long term risk if you know their passwords are stored in plaintext.<span id=\"more-7134\"></span></p>\n<p>That said, we should consider the potential consequences &#8212; though it doesn&#8217;t make it excusable. Because iThemes doesn&#8217;t store credit card details, emails and names and passwords are about the worst things at risk. Still, a tiny percentage of the general population uses responsible passwords, so getting a list of names and emails and passwords is a treasure trove of information for third party (as in other websites like banks and email providers) to steal identities and break directly into user accounts.</p>\n<p>This should also be a significant lesson for any user to always use different passwords for every website where you keep an account. Tools like <a href=\"https://lastpass.com/\">LastPass</a> and <a href=\"https://agilebits.com/\">1Password</a> make account password management easy. Additionally, learn about <a href=\"http://en.wikipedia.org/wiki/Two-step_verification\">2-factor authentication</a> and use it whenever the service enables it.</p>\n<h3>Owning mistakes</h3>\n<p>This is clearly a horrible situation for iThemes to be in. Users have a right to be mad. In 2014 we should be able to expect that our passwords are encrypted, and that even if a server where our information is stored is hacked, that certain valuable details like credit cards or passwords are not exposed. Thankfully, iThemes doesn&#8217;t store credit card details, but those passwords should now be assumed stolen, and users have to pay that price.</p>\n<p>But where I have enormous respect for iThemes is how they have owned it. Especially in the update post, Cory Miller &#8212; iThemes&#8217; founder and CEO &#8212; took ownership of the issue and told the full story of the breach.</p>\n<blockquote><p>I realize this will generate a lot of concern. Again, I am deeply sorry for this mistake and how it has affected you.</p>\n<p>Let me say: we have made mistakes in the past at iThemes … and as humans will make mistakes in the future. To make a promise otherwise would be absurd and misleading.</p>\n<p><strong>But my promise to you, our customers, is this</strong> … and it’s the same promise that I’ve held to since January 2008 when I started iThemes in my home:</p>\n<ol>\n<li><strong>We will identify mistakes as best we can.</strong> You have helped us with this and appreciate that accountability.</li>\n<li><strong>We will own up to our mistakes.</strong> Again, we’ve done this in the past, we did this yesterday and this post is another example of us living this value.</li>\n<li><strong>We will fix the mistake as fast as humanly possible.</strong> A number of priority issues have been unearthed, shone a hard light on, but we are working to resolve them.</li>\n<li><strong>We will learn and grow from it and be better for it and for you.</strong></li>\n</ol>\n<p>Additionally, as the founder and CEO, the leader of this company, I want you to know: <strong>the buck stops with me and me alone.</strong></p>\n<p>At the end of the day, I am responsible for our company, iThemes, and the work we do. I’ve often tried to defer credit for the great work we’ve done to our team, but as for the mistakes we make, that credit belongs solely to me.</p></blockquote>\n<p>Not every company that&#8217;s been breached can say the same. Even huge organizations (I&#8217;m thinking of Home Depot as the latest) have done a horrible job at responsible and honest disclosure to their customers.</p>\n<p>iThemes could have made this much more quiet and kept it from being a priority to their users or a big deal in WordPress news-land. But they didn&#8217;t. They owned it, they apologized, and they&#8217;ve been rewarded for that.</p>\n<p>In the comments of the security update post, users were appalled by the lack of responsibility on the security priorities, but the honesty paid off in the sense that users were verbally thankful for it so that they could accept the problem and deal with it, when the alternative was to be in the dark.</p>\n<p>While this breach has cost iThemes some credibility, and some trust, I believe those things are recoverable. Had they obfuscated the hack itself, my post and users reactions (had they found out) would be very different.</p>\n<h3>What iThemes is doing now</h3>\n<p>iThemes has learned a hard lesson this week, as many other companies have before them. Now they must react, and react strongly. In a situation like this, nothing should take priority over getting this issue fixed.</p>\n<p>Until they get their password storage issue fixed, they still are storing passwords in plaintext, even the new ones. Thankfully they&#8217;ve already updated password restrictions &#8212; which previously limited passwords to 20 characters &#8212; to now accept up to 255 characters. But storing them in plaintext means that they are still as vulnerable today as they were last week if someone gets into the server again. So they must be absolutely vigilant to protect their servers through this migration.</p>\n<h3>What we can all learn</h3>\n<p>Security is not a sexy industry. Too often we don&#8217;t consider it until it&#8217;s a problem. &#8220;Going on offense&#8221; should be our default when we consider security actions, but more often &#8212; even with some of the best companies and people in the tech space &#8212; we react to issues and aren&#8217;t appropriately proactive.</p>\n<p>That said, our job is not done either. All of us should consider our own security situation and how we can improve it. Especially if you have users of your own (and many of my readers do), consider that state of your own security, and make sure it&#8217;s a priority in your business.</p>\n<p>When we think about what pays the bills, it&#8217;s not security awareness and proactive security investments. But we should consider security breaches and vulnerabilities as risks that must be managed; meaning investment into security priorities should be a significant part of any business.</p>\n<p>iThemes, Envato, and WooThemes are all &#8220;big&#8221; businesses from a WordPress business perspective. Each of them has fought a website security battle. Envato and WooThemes before iThemes have recovered and maintained their users and the community&#8217;s trust. I think iThemes will too. But before you, or me, decide &#8220;it won&#8217;t happen to us&#8221;, consider that it can happen to anyone, and our investments into security measures and best practices are not only worthwhile, but the only responsible thing to do.</p>\n<p>And for users, use different passwords on every site. Use LastPass or 1Password. Enable 2-factor authentication. Be vigilant. Do not use the excuse that it&#8217;s too hard or a burden. What&#8217;s much more of a burden is dealing with a hacked email or bank account. Protect yourself and learn how to protect your accounts. It&#8217;s easy to adjust to and modern tools make it a much simpler task to manage.</p>\n<p>Let&#8217;s all &#8212; web professionals and users &#8212; learn with iThemes here, and do better.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 23:30:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Brian Krogsgard\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"WPTavern: WordPress StackExchange Thrives in 2014 with 17 Million Page Views and 14K New Questions\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36695\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:108:\"http://wptavern.com/wordpress-stackexchange-thrives-in-2014-with-17-million-page-views-and-14k-new-questions\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:10679:\"<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/wpse.png\" rel=\"prettyphoto[36695]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/wpse.png?resize=746%2C363\" alt=\"wpse\" class=\"aligncenter size-full wp-image-36734\" /></a></p>\n<p>Last week, moderators from the <a href=\"http://wordpress.stackexchange.com/\" target=\"_blank\">WordPress Development StackExchange</a> (WPSE) posted a short summary of <a href=\"http://meta.wordpress.stackexchange.com/questions/3951/happy-new-year-how-about-some-stats/3952#3952\" target=\"_blank\">stats from 2014</a>, which demonstrate the remarkable growth and success of the community surrounding the site. This past year WPSE pulled in approximately 15,000 new users, bringing the total to 45,000.</p>\n<p>The site received a total of 17 million page views during 2014. Users submitted 14,000 new questions, and the site received 13,000 new answers.</p>\n<p>The question and answer model employed at the WordPress StackExchange may not be a perfect forumula, but it works. If you&#8217;re a developer looking for help, you&#8217;re far more likely to receive high quality answers on WPSE than on the official WordPress.org forums. On average, the two forums cater to different types of users.</p>\n<p>The <a href=\"http://stackexchange.com/\" target=\"_blank\">StackExchange</a> question and answer communities are expert communities by design. Right answers float to the top, based on votes from experts in the community, making it an efficient way to locate the most helpful answers.</p>\n<p>In more traditional forums, you&#8217;ll spend quite a bit of time weeding through useless, poor quality information to find what you&#8217;re looking for. Those who share their knowledge on StackExchange communities earn reputation points, which also helps users discern the quality of answers provided. Overall, it&#8217;s a tidy formula for engaging and rewarding expert advice.</p>\n<h3>The Culture of the WordPress StackExchange Community</h3>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/rarst-wpse.png\" rel=\"prettyphoto[36695]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/rarst-wpse.png?resize=300%2C199\" alt=\"rarst-wpse\" class=\"alignright size-medium wp-image-36731\" /></a>Each new StackExchange community passes through a beta period where it is required to demonstrate sustained activity around the topic. I spoke with <a href=\"http://www.rarst.net/\" target=\"_blank\">Andrey Savchenko</a>, better known online as <a href=\"https://twitter.com/rarst\" target=\"_blank\">@Rarst</a>, a moderator who has witnessed the evolution of WPSE from its early beta days to today. Browsing through questions on the site, there seem to be very few beginner inquiries, as compared to WordPress.org support. I asked Savchenko if the site purposely attracts a different crowd or if the questions are heavily moderated.</p>\n<p>&#8220;At 45,000+ registered users it would be hard for me to paint an average user in few strokes,&#8221; he said. &#8220;Out of more obvious quirks I would say is that WPSE seems more heavily European than WordPress&#8217; usual.</p>\n<p>&#8220;It&#8217;s also a clearly for–developer resource in a primarily user–centric WordPress world, which doesn&#8217;t mean beginner development questions are unwelcome — they often make some of the best ones. But beginner user questions aren&#8217;t something we historically selected for.&#8221;</p>\n<p>While moderation is one of the key features in place in every StackExchange network, Rarst believes it&#8217;s not as heavy as one might imagine. &#8220;I think SE moderation is efficient rather than heavy. It is strict when it needs to be and intelligently flexible when not,&#8221; he said.</p>\n<p>Why do many WordPress users prefer getting help at WPSE as opposed to WordPress.org? Apart from the general difference in the user base, the WPSE community has a different mission and approach to answering questions.</p>\n<p>&#8220;WPSE is a unique case of a high profile WordPress site outside of the WordPress ethos. In a way, we are the other side of the coin — a corner for people who don&#8217;t click with mainline WordPress resources too well,&#8221; Rarst explained.</p>\n<p>&#8220;For StackExchange, the cultivation of knowledge is the primary mission, as the WordPress.org documentation and forums often feel like a neglected afterthought.&#8221; WPSE offers an alternative way to explore WordPress development questions, outside of the culture that exists on WordPress.org.</p>\n<h3>WPSE Thrives on an Organic, Self-Governing Organizational Structure</h3>\n<p>WPSE manages to maintain a cohesive community without instituting an overly strict governing body. All WPSE moderators are organically grown within the community. &#8220;People tend to choose their own level of social involvement; the system isn&#8217;t really opinionated about it,&#8221; Rarst said. &#8220;There are some chatty types, who are around on our meta site and in &#8216;The Loop&#8217; chat room a lot. There are also plenty of high ranked people who keep to themselves and stay a complete mystery, apart from avatar and nickname.&#8221;</p>\n<p>When it comes to housekeeping, WPSE has a natural structure, which lends moderation capabilities to members with the most influence and participation. &#8220;The moderators tend to have a lot of pull in organizational issues, but they tend to be elected moderators because they already have that influence,&#8221; Rarst explained. &#8220;Position comes to those who have established themselves, not the other way around.&#8221;</p>\n<p>The overarching StackExchange mission has been key to the community&#8217;s success. The purpose of the 133 StackExchange communities is to enable users to ask questions and get answers without distraction. Unlike a traditional discussion forum, replies are heavily geared towards answers without a lot of chit-chat. &#8220;I think the focus with which Stack Exchange pursues their goals and their dedication to empowering people to contribute is what captures users on any topic,&#8221; Rarst said.</p>\n<p>Users are encouraged to follow a simple set of guidelines when asking questions. They are encouraged to keep questions tightly focused on the topic at hand and to avoid opinion-based questions that would generate a lengthy discussion.</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/stackexchange-guidelines.png\" rel=\"prettyphoto[36695]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/stackexchange-guidelines.png?resize=548%2C321\" alt=\"stackexchange-guidelines\" class=\"aligncenter size-full wp-image-36713\" /></a></p>\n<p>In the early days, the site was more exploratory, and moderators were open to trying new things to see where it went. &#8220;These days we are more reserved — we learned what works well for us, what is our main identity,&#8221; Rarst said. &#8220;We had finally pushed through name change to &#8216;WordPress Development&#8217; from &#8216;WordPress Answers&#8217;, which had temporarily and accidentally stuck.&#8221;</p>\n<p>They also learned what kind of content to turn away in order to keep the site working well. &#8220;The most prominent example is probably a much more stronger enforcement of questions specific to plugins and themes being out of scope for our general WordPress development focus,&#8221; Rarst said. This helps to keep the site more focused on how WordPress itself works, as opposed to getting overrun with support questions regarding third-party extensions.</p>\n<p>Over the years, moderators and participants have actively sought to <a href=\"http://meta.wordpress.stackexchange.com/questions/3697/our-wooes-and-future-of-platform-plugins-at-wpse\" target=\"_blank\">elicit feedback</a> in order to improve the experience at WPSE, on both the meta site and on <a href=\"http://www.reddit.com/r/Wordpress/comments/ljlsy/what_do_you_guys_think_of/\" target=\"_blank\">Reddit</a>. Discussion from these exchanges has helped shape the direction of the site to filter out questions that detract from the main mission.</p>\n<h3>What Makes WPSE a Good Place to Ask Questions?</h3>\n<p>WPSE stats show that the most voted new question in 2014 was, &#8220;<a href=\"http://wordpress.stackexchange.com/questions/131697/what-is-your-best-practice-to-execute-one-time-scripts\" target=\"_blank\">What is your best practice to execute one-time scripts?</a>&#8221; The most viewed new question was <a href=\"http://wordpress.stackexchange.com/q/141125/847\" target=\"_blank\">&#8220;Allow HTML in Excerpt</a>&#8221; with 8,300+ views.</p>\n<p>With a predominantly developer-oriented community, Rarst believes that the WPSE model is working because it attracts competent WordPress experts to participate. Like-minded users and moderators have cultivated a fertile soil for answers. &#8220;I consider answering questions an immense personal learning opportunity, but also I think as a resource it is important for WordPress knowledge infrastructure, which is starved for quality information,&#8221; Rarst said.</p>\n<p>The points-based reputation system also helps in motivating users to submit answers, although Rarst doesn&#8217;t attribute it to having played a large role in the site&#8217;s success. &#8220;I wouldn&#8217;t try to guess if points made Stack Exchange popular or was it other way around,&#8221; he said. &#8220;They definitely add a playful component to the experience, but the additional nature of &#8216;play&#8217; is the key here — hardly anyone would participate for points alone in my opinion.&#8221;</p>\n<p><a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/stackexchange-points.png\" rel=\"prettyphoto[36695]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/stackexchange-points.png?resize=540%2C169\" alt=\"stackexchange-points\" class=\"aligncenter size-full wp-image-36712\" /></a></p>\n<p>The success is more likely attributed to the combination of dedicated and proven moderators, a focused mission, and a foundational question-and-answer format that simply works. Spend a few minutes sifting through questions on the site and you&#8217;ll undoubtedly have the opportunity to explore the inner workings of WordPress with knowledgeable, experienced respondents on hand.</p>\n<p>The growth of the site over the past year shows that WPSE is quickly becoming a popular, high quality resource for finding answers to WordPress-related questions. If you&#8217;re stuck, and you&#8217;ve already done your homework of googling and browsing other forums, WPSE is a solid option for getting real answers without all the extra fluff.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 22:00:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:19:\"Matt: Rise of Bacon\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44575\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:35:\"http://ma.tt/2015/01/rise-of-bacon/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:217:\"<p><a href=\"http://businessweek.com/articles/2014-10-06/bacon-why-americas-favorite-food-mania-happened\">This article on the amazing rise of bacon</a> was one of my favorite articles I read last year. About bacon.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 06 Jan 2015 13:34:59 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:76:\"WPTavern: Control the Visibility of WordPress Widgets Based on Time and Date\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=35102\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"http://wptavern.com/control-the-visibility-of-wordpress-widgets-based-on-time-and-date\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3203:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/12/time.jpg\" rel=\"prettyphoto[35102]\"><img src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2014/12/time.jpg?resize=1024%2C496\" alt=\"photo credit: Βethan - cc\" class=\"size-full wp-image-35409\" /></a>photo credit: <a href=\"https://www.flickr.com/photos/beth19/4721798240/\">Βethan</a> &#8211; <a href=\"http://creativecommons.org/licenses/by-nc-nd/2.0/\">cc</a>\n<p>The traditional use of widgets in WordPress is to set it and forget it. After placing and configuring a widget, it stays in the widgetized area until manually removed. Many plugins have extended widgets to add visibility settings that are based on the page or post where the widget appears. But what if you could also control widgets based on time and date?</p>\n<p>The new <a href=\"https://wordpress.org/plugins/widget-visibility-time-scheduler/\" target=\"_blank\">Widget Visibility Time Scheduler</a> plugin actually allows you to schedule the display of widgets down to the minute. The plugin, created by WordPress developer <a href=\"https://profiles.wordpress.org/hinjiriyo/\" target=\"_blank\">Martin Stehle</a>, adds time-based visibility settings to each widget&#8217;s configuration options.</p>\n<p><a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/12/widget-visibility.png\" rel=\"prettyphoto[35102]\"><img src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2014/12/widget-visibility.png?resize=446%2C485\" alt=\"widget-visibility\" class=\"aligncenter size-full wp-image-35115\" /></a></p>\n<p>Widget Visibility Time Scheduler was designed to work seamlessly with <a href=\"http://jetpack.me/support/widget-visibility/\" target=\"_blank\">Jetpack&#8217;s Widget Visibility module</a>, which allows you to limit widget display to certain pages. There is no conflict if your site is Jetpack-enabled and you can even use the two visibility options in combination with one another.</p>\n<p>The plugin is perfect for seasonal widgets, temporary sales/promotions, events, live chat buttons, and any other time/date-dependent content. One feature that might be useful to add is an indefinite option for the end time of the widget display. That would enable users to schedule future widgets and leave them in place indefinitely. Additionally, an option to set the widget display based on the day of the week could offer more flexibility.</p>\n<p>After testing the plugin, I can confirm that it works as advertised. If you try the plugin and you want to remove it at a later point in time, you&#8217;ll need to uncheck the widget visibility time scheduler box in each widget before you remove that plugin. This will ensure that none of its data remains in the database after you remove the plugin.</p>\n<p>Widget Visibility Time Scheduler is a handy addition to any site using WordPress as a CMS, an e-commerce platform, or even a blog. In combination with the Jetpack module, it offers full control over when and where your widgets are displayed. This is one you may want to favorite for the next time you need to use it. The plugin is available for <a href=\"https://wordpress.org/plugins/widget-visibility-time-scheduler/\" target=\"_blank\">download from WordPress.org</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 05 Jan 2015 22:13:49 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: Emil Uzelac Launches New WordPress Theme Review Service\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36615\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"http://wptavern.com/emil-uzelac-launches-new-wordpress-theme-review-service\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4358:\"<p><a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/theme-review-service.png\" rel=\"prettyphoto[36615]\"><img src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/theme-review-service.png?resize=300%2C231\" alt=\"theme-review-service\" class=\"alignright size-medium wp-image-36641\" /></a>Emil Uzelac&#8217;s new <a href=\"http://themereview.co/\" target=\"_blank\">WordPress Theme Review service</a> is the first of its kind. As a <a href=\"https://twitter.com/emiluzelac/status/545569135808483328\" target=\"_blank\">four-year veteran</a> of the WordPress.org Theme Review Team, he is uniquely qualified to operate a service that focuses on theme standards and quality control.</p>\n<p>Uzelac plans to assist developers with theme reviews for client projects, commercial themes, and free themes submitted to WordPress.org. The reviews are aimed not only at helping developers meet the latest WordPress theme guidelines but also at catching bugs before the product gains distribution. The service will also aim to give customers detailed feedback on performance and security.</p>\n<p>A preliminary review starts at $90 for the first hour. <strong>&#8220;You would be surprised how much one can find within an hour,&#8221;</strong> Uzelac told the Tavern.</p>\n<p>&#8220;The service will cover things like efficiency, performance, sanity, and the overall code quality,&#8221; he said. &#8220;It will also include UX improvements for both desktop and mobile devices. My goal is also to educate as well,&#8221; he said. Customers who use the service will receive suggestions for improvement, along with examples and support from Uzelac.</p>\n<p>&#8220;Look, no one wants to ship a theme with issues,&#8221; Uzelac said. &#8220;Everyone knows time constraints and the pressure to finish can introduce mistakes even the most seasoned developers miss. That’s completely normal. But frustrated end users quickly abandon themes they don’t understand or can’t fix.&#8221; As the original author of <a href=\"https://wordpress.org/themes/responsive\" target=\"_blank\">Responsive</a>, one of most popular themes of all time on WordPress.org, Uzelac knows the kind of quality and support required to build a strong user base.</p>\n<h3>The Need for Professional Theme Review</h3>\n<p>In the past, getting a theme through the rigorous review process for WordPress.org could take weeks. If you have errors that need to be fixed, your theme goes back into the queue to be reviewed again. Being able to make it through the first time with no issues is advantageous to developers who are hoping to release their themes to the public as soon as possible.</p>\n<p><a href=\"http://devrix.com/\" target=\"_blank\">Mario Peshev</a> recently touched on this topic when we interviewed him regarding his <a href=\"http://wptavern.com/devrix-and-emil-uzelac-team-up-to-produce-masonry-a-free-wordpress-theme\" target=\"_blank\">partnership with Uzelac to launch a theme for his company</a>. &#8220;There is no clear way to hire any of them for theme reviews or building a theme following the WordPress.org guidelines,&#8221; Peshev said, commenting on the lack of visibility of the WordPress Theme Review Team. &#8220;I assume that small and medium agencies would be willing to pay for professional reviews or getting themes built for any reason, which would support both parties,&#8221; he said.</p>\n<p>WordPress users are losing confidence in large commercial theme marketplaces that continue to sell products riddled with <a href=\"http://wptavern.com/why-wordpress-theme-developers-are-moving-functionality-into-plugins\" target=\"_blank\">bad practices</a> and <a href=\"http://wptavern.com/100000-wordpress-sites-compromised-using-the-slider-revolution-security-vulnerability\" target=\"_blank\">security vulnerabilities</a>. The community has a need for a service that can authoritatively address problems with WordPress themes and educate developers on best practices.</p>\n<p>Despite launching his <a href=\"http://themereview.co/\" target=\"_blank\">theme review service</a>, Uzelac plans to continue volunteering on the WordPress.org Theme Review Team for many years to come. &#8220;This is something I enjoy doing, even more than creating themes,&#8221; he said. If the service takes off, he plans to do it full-time and hopes to take on additional reviewers to grow the business.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 05 Jan 2015 18:34:05 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Matt: What’s in My Bag, 2014\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:21:\"http://ma.tt/?p=44570\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"http://ma.tt/2015/01/whats-in-my-bag-2014/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6355:\"<p>As the start of a new year&#8217;s tradition, I&#8217;d like to take inventory of what I carry around in my backpack, which I have with me almost everywhere I go. I&#8217;m constantly iterating and changing what I carry around, so I hope it&#8217;s interesting to see this vignette of what I&#8217;ve found to be the best or most effective items to have with me all the time. With the things in this backpack I can be productive pretty much any place on the planet with a wifi or LTE connection.</p>\n<p><a href=\"http://i1.wp.com/ma.tt/files/2015/01/IMG_4001.jpg\"><img class=\"alignnone\" src=\"http://i1.wp.com/ma.tt/files/2015/01/IMG_4001.jpg?resize=604%2C453\" alt=\"\" /></a></p>\n<ol>\n<li><a href=\"http://www.amazon.com/Kensington-International-Travel-Adapter-K38120WW/dp/B00I3E1ENW/\">Kensington international adapter</a>, I like this one because it has two USB ports, but every adapter I&#8217;ve used seems a little janky.</li>\n<li><a title=\"Been putting a lot of miles on these.\" href=\"http://www.amazon.com/dp/B00DIOAM4Y/\">Plantronics BackBeat GO 2 with charging case</a>, as I mentioned <a href=\"http://ma.tt/2014/10/beats-studio-wireless-vs-samsung-level-over/\">in my headphones post</a>.</li>\n<li><a href=\"http://www.amazon.com/High-Resolution-Display-Adaptive-PagePress-Sensors/dp/B00IOYAM4I/\">Kindle Voyage</a>. Love love love.</li>\n<li>64gb USB stick.</li>\n<li>Lockpick set.</li>\n<li>Apple Thunderbolt / VGA adapter. (I can probably stop carrying this around.)</li>\n<li>Samsung Level Over, as I mentioned <a href=\"http://ma.tt/2014/10/beats-studio-wireless-vs-samsung-level-over/\">in my headphones post</a>.</li>\n<li>Macbook power adapter, and <a href=\"http://www.motorola.com/us/accessories-bluetooth-headsets/Moto-Hint/moto-hint-pdp.html\">Moto Hint bluetooth headset</a>.</li>\n<li>Audrey Hepburn deck of playing cards, and business card holder. The last few items <a href=\"http://www.cocooninnovations.com/grid.php\">are on a Gridit holder</a>, which I like but seems to drop items as I walk around.</li>\n<li><a href=\"http://www.amazon.com/Macally-Charger-iPhone-Mobile-Devices/dp/B003UATJ7C/\">Macally double USB charger</a>, which I like because the plug pivots, and it can charge an iPad at full speed.</li>\n<li>Thunderbolt to thunderbolt cable, which is great for transferring between computers, and <a href=\"http://www.amazon.com/Belkin-Rockstar-Multi-Headphone-Splitter/dp/B00475K64E/\">Belkin audio cable splitter</a>, with an old Beats cable wrapped around which I use with the Samsung headphones.</li>\n<li><a href=\"http://www.amazon.com/gp/product/B00LIS9EM8/\">Retractable HMDI cable</a>.</li>\n<li>Garmin chest strap heart rate monitor, for running.</li>\n<li>Miscellaneous retractable cables: Jawbone UP24 charger (not using the UP at the moment, just the Basis), 1/8th inch audio cable, ethernet CAT5e, USB mini type B.</li>\n<li><a title=\"Best sound, best comfort, but my ears get waxy when I wear them too much.\" href=\"http://pro.ultimateears.com/en-us/home/18-Pro\">Ultimate Ears 18 Pro Custom</a>, with a <a href=\"http://thisisground.com/collections/cordtaco\">gold cord taco</a>.</li>\n<li>Jetpack notebook for taking analog notes.</li>\n<li>Some <a href=\"http://www.amazon.com/Bag-Balm-Vermonts-Original-Moisturizing-Softening/dp/B001838FPA\">bag balm</a> in a little plastic holder, an <a href=\"http://www.amazon.com/Aveda-Blue-Oil-0-24-oz/dp/B0031KN9UE\">Aveda Blue Oil</a> that I find relaxing, and some Advil for when ouches happen.</li>\n<li><a href=\"https://www.amazon.com/gp/product/B007PTCFFW/\">TP-LINK TL-WR702N Wireless N150 Travel Router</a>, which works so-so.</li>\n<li>Chargers for the two watches.</li>\n<li><a href=\"http://www.amazon.com/gp/product/B00KINSDK8\">Mpow Streambot Mini Wireless Bluetooth 4.0 Audio Music Streaming Receiver Adapter</a>.</li>\n<li>Apple Magic Mouse, still the best.</li>\n<li>Moto X second generation, with walnut back and orange highlights.</li>\n<li>Not pictured, iPhone 6+, because it took the picture, space grey of course.</li>\n<li>Miscellaneous swag and trinkets, and a T-mobile SIM card.</li>\n<li>Maison Bonnet sunglasses and cleaning cloth.</li>\n<li><a href=\"http://www.amazon.com/Lamy-Pico-Pocket-Ballpoint-White/dp/B00439T9OM/\">Lamy Pico Pocket Ballpoint pen</a>.</li>\n<li>Brand new passport! No stamps in it yet. Unfortunately picture was taken when I was still in the mustache competition.</li>\n<li><a href=\"http://www.amazon.com/Basis-Peak-Ultimate-Fitness-Tracker/dp/B00GJG79LM\">Basis Peak watch</a>, which I like a lot overall.</li>\n<li><a href=\"http://www.amazon.com/Garmin-Forerunner-620-Black-Bundle/dp/B00FBYYC90\">Garmin Forerunner 620</a>, for quantifying running along with the chest strap in #13.</li>\n<li><a href=\"http://www.westoneaudio.com/index.php/products/hearing-protection/es49-custom-hearing-protection.html\">Westone ES49 custom earplugs</a>, for if I go to concerts or anyplace overly loud.</li>\n<li><a href=\"http://www.amazon.com/Bucky-Eye-Shades-Earplugs-Black/dp/B000FFSWAU/\">Bucky eye shades</a>, like an eye mask but has a curve so it doesn&#8217;t touch your eyes. I don&#8217;t use this often but when I do it&#8217;s a life-saver.</li>\n<li>Retina Macbook Pro, 15 inch, with a few stickers and the custom W light cut-out.</li>\n<li>The bag that holds everything pictured: <a href=\"http://www.hardgraft.com/products/oldschoolrucksack-heritage\">Old School Laptop Rucksack</a>. I wish it had a few more interior pockets for organizing things. It&#8217;s starting to get pretty worn, I probably need to treat the leather on the bottom.</li>\n<li>Not pictured: <a href=\"http://www.amazon.com/Incase-Speed-Charger-Lightning-Cable/dp/B00P7Y6M2Y/\">Incase dual USB 2.4 amp car charger</a>, a <a href=\"http://www.amazon.com/Belkin-Car-Vent-Mount-Smartphones/dp/B00O5JARCI/\">Belkin car mount</a>, and a retractable lightning cable. (They were in the car when I took this.)</li>\n</ol>\n<p><a href=\"http://i1.wp.com/ma.tt/files/2015/01/IMG_4001.jpg\"><img class=\"alignnone\" src=\"http://i1.wp.com/ma.tt/files/2015/01/IMG_4001.jpg?resize=604%2C453\" alt=\"\" /></a></p>\n<p>So if you add it all up, there are about 53 unique items I&#8217;m carrying around all the time. I&#8217;m curious how this total number changes over time as well. If you have any recommendations for a better, lighter, or more functional item than what I&#8217;m carrying please leave it in the comments!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 05 Jan 2015 17:07:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:65:\"WPTavern: Kim Parsell, Affectionately Known as #wpmom Passes Away\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://wptavern.com/?p=36618\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"http://wptavern.com/kim-parsell-affectionately-known-as-wpmom-passes-away\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9532:\"<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/KimParsell.png\" rel=\"prettyphoto[36618]\"><img class=\"size-full wp-image-36619\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/KimParsell.png?resize=655%2C418\" alt=\"WordCamp San Francisco 2014 By Sheri Bigelow\" /></a>WordCamp San Francisco 2014 By Sheri Bigelow\n<p>In the eight years I&#8217;ve covered the WordPress scene, <a title=\"http://web.archive.org/web/20120827003459/http://www.wptavern.com/forum/forum-lobby/1003-rip-dan-schulz.html\" href=\"http://web.archive.org/web/20120827003459/http://www.wptavern.com/forum/forum-lobby/1003-rip-dan-schulz.html\">only once</a> have I written about someone passing away. It&#8217;s with a heavy heart and great sadness to inform you that <a title=\"https://profiles.wordpress.org/kpdesign\" href=\"https://profiles.wordpress.org/kpdesign\">Kim Parsell</a> passed away last week at her home in Southern, Ohio. The cause of death is unknown and a small service is tentatively scheduled for this Saturday. There&#8217;s also a memorial type of event being planned for WordCamp Columbus, OH.</p>\n<h2>Kim Parsell The Photographer</h2>\n<p>Before getting actively involved in the WordPress project, she was an <a title=\"http://www.kpimages.net/index.php?x=browse&pagenum=1\" href=\"http://www.kpimages.net/index.php?x=browse&pagenum=1\">avid photographer</a>. Almost all of the photos she published were taken on her property in Southern, Ohio. She had an eye for nature&#8217;s beauty and showed the world through photography how beautiful Ohio is. Her photos are so good that I think she could have made a living selling them as prints.</p>\n<a href=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/KimParesellSpringtimeSunset.png\" rel=\"prettyphoto[36618]\"><img class=\"size-full wp-image-36620\" src=\"http://i2.wp.com/wptavern.com/wp-content/uploads/2015/01/KimParesellSpringtimeSunset.png?resize=969%2C560\" alt=\"Springtime Sky by Kim Parsell\" /></a>Springtime Sky by Kim Parsell\n<h2>Kim Parsell The Contributor</h2>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/KimParsellWordPressProfile.png\" rel=\"prettyphoto[36618]\"><img class=\"size-full wp-image-36626\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/KimParsellWordPressProfile.png?resize=963%2C459\" alt=\"Kim Parsell\'s WordPress.org Profile\" /></a>Kim Parsell&#8217;s WordPress.org Profile\n<p>In the past few years, Kim has worked on improving documentation in WordPress as a member of the docs team. She substantially contributed to the effort of adding <a title=\"https://make.wordpress.org/docs/inline-docs/\" href=\"https://make.wordpress.org/docs/inline-docs/\">inline documentation</a> to every hook in WordPress. Her contributions got her <a title=\"http://wordpress.tv/2014/10/26/matt-mullenweg-the-state-of-the-word-2014/\" href=\"http://wordpress.tv/2014/10/26/matt-mullenweg-the-state-of-the-word-2014/\">mentioned by Matt Mullenweg</a> (11:00 minute mark) during his State of the Word presentation at WordCamp San Francisco 2014. She&#8217;s contributed to every release of WordPress from 3.7 to 4.1.</p>\n<p>Being mentioned in the State of the Word is one of Kim&#8217;s best moments and it meant a lot to her. Sarah Pressler <a title=\"http://sarahpressler.com/time-ran-short/\" href=\"http://sarahpressler.com/time-ran-short/\">accurately describes</a> the jubilation felt by Kim, “Can you believe it? Me!!! In Matt’s talk! Me!? I…just …. I can’t believe it. Little ol’ me. An old lady up there on the screen with all the kids. It’s official, I really am #WPMom now.”</p>\n<h2>Kim Parsell The #wpmom</h2>\n<a href=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/KimParsellDocsTeamMeetup.jpg\" rel=\"prettyphoto[36618]\"><img class=\"wp-image-36621 size-full\" src=\"http://i0.wp.com/wptavern.com/wp-content/uploads/2015/01/KimParsellDocsTeamMeetup.jpg?resize=750%2C460\" alt=\"The Docs Team Meetup in Cincinnati 2013 - Image Courtesy of <a title=\" /><a title=\" http:=\"></a>Kim Parsell With the Docs Team Meetup in Cincinnati 2013\n<p>Kim became known throughout the WordPress community as <a title=\"https://twitter.com/hashtag/wpmom\" href=\"https://twitter.com/hashtag/wpmom\">#wpmom,</a> a title she fully embraced. She had a way of giving people purpose, taking them under her wing, and showing compassion when it was needed most. As <a title=\"http://www.carriedils.com/for-you-kim/\" href=\"http://www.carriedils.com/for-you-kim/\">Carrie Dils explains</a>, &#8220;Folks jokingly call her <a href=\"https://twitter.com/hashtag/wpmom?src=hash\" target=\"_blank\">#wpmom</a>, but there’s a lot of truth there. She was very much like a mother figure, but never EVER in a condescending way.&#8221;</p>\n<p>In a <a title=\"http://www.carriedils.com/for-you-kim/#comment-68920\" href=\"http://www.carriedils.com/for-you-kim/#comment-68920\">comment</a> on the same post, Amanda describes exactly the type of person Kim was, &#8220;The greatest thing about Kim is that whether you’re standing at the back of the line or the front she would have walked her way down that line to let everyone know they were equally as important and that the only reason there’s a line is because everyone can’t be in the same place at once.&#8221;</p>\n<p>As <a title=\"http://onefinejay.com/2015/01/03/remembering-kim-parsell\" href=\"http://onefinejay.com/2015/01/03/remembering-kim-parsell\">Jayvie Canono found out</a>, Kim didn&#8217;t put up with bull crap from anyone and had no problem letting you know about it. It&#8217;s how she told people which made her unique, &#8220;She brought people together and had the salty, country-gal personality who would <em>not put up with your bull crap</em> and yet would never break one rule of etiquette in the process of letting you know.&#8221;</p>\n<h2>Kim Parsell The Person I Knew</h2>\n<a href=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/KimParsellSunset.png\" rel=\"prettyphoto[36618]\"><img class=\"size-full wp-image-36624\" src=\"http://i1.wp.com/wptavern.com/wp-content/uploads/2015/01/KimParsellSunset.png?resize=1024%2C768\" alt=\"Sunset as Seen From Kim Parsell\'s Property\" /></a>Sunset as Seen From Kim Parsell&#8217;s Property\n<p>Kim referred to herself as “The little ol’ crazy lady at the top of a hill in Ohio.” She wasn&#8217;t crazy but rather, an independent, strong-willed woman who at times was stubborn. A hard worker, she spent a lot of time in rural Ohio alone, &#8220;<span class=\"ProfileHeaderCard-locationText u-dir\" dir=\"ltr\">Chillin&#8217; on a dirt road.</span>&#8221; She routinely drove an hour and a half north to attend <a title=\"http://www.meetup.com/NEOWordPress/\" href=\"http://www.meetup.com/NEOWordPress/\">our WordPress meetup</a> because there wasn&#8217;t a person within 30 miles of her house who knows what WordPress is.</p>\n<p>When I started WordPress Weekly in 2009, she would often join me on each episode to provide the countdown before I hit the record button. She was occasionally a guest on the show as <a title=\"http://wptavern.com/wpweekly-episode-87-%E2%80%93-the-lost-episode\" href=\"http://wptavern.com/wpweekly-episode-87-%E2%80%93-the-lost-episode\">on episode 87</a>. After the show, she would stick around for a half hour to an hour to talk about whatever was on her mind. In many ways, the show offered her an opportunity to connect and speak to WordPress people every week. The show was the closest thing to a meetup she could regularly attend.</p>\n<a href=\"http://recordings.talkshoe.com/TC-34224/TS-317335.mp3\">http://recordings.talkshoe.com/TC-34224/TS-317335.mp3</a>\n<p>She lived in a rural area where her internet was capped at 1.5MB, but it didn&#8217;t stop her from contributing to WordPress. Despite living on top of a hill in Southern Ohio, often alone, she left a lasting impact on people across the world. She wasn&#8217;t much of a speaker but at WordCamp San Francisco 2014, she gave a presentation on WordPress documentation.</p>\n<p></p>\n<h2>Kim Parsell, You Are Missed</h2>\n<p>Kim, you&#8217;re missed by a lot of people, some of whom you&#8217;ve never met. That&#8217;s the kind of impact and legacy you&#8217;ve left us with. You&#8217;re an inspiration to become a better person and be more kind to those in the WordPress community. You opened your heart and soul to whoever needed help and ended every exchange with a smile. I will miss you friend, colleague, and fellow buckeye. My deepest condolences are with the Parsell family.</p>\n<p>If you have a lasting memory of Kim, please share it in the comments.</p>\n<p><strong>Related Reading:</strong></p>\n<ul>\n<li><a title=\"https://make.wordpress.org/docs/2015/01/05/rip-kim-parsell/\" href=\"https://make.wordpress.org/docs/2015/01/05/rip-kim-parsell/\">RIP Kim Parsell </a></li>\n<li><a title=\"http://sarahpressler.com/time-ran-short/\" href=\"http://sarahpressler.com/time-ran-short/\">For Kim. Because Time Ran Short.</a></li>\n<li><a title=\"http://www.carriedils.com/for-you-kim/\" href=\"http://www.carriedils.com/for-you-kim/\">For You, Kim</a></li>\n<li><a title=\"http://onefinejay.com/2015/01/03/remembering-kim-parsell\" href=\"http://onefinejay.com/2015/01/03/remembering-kim-parsell\">Remembering Kim Parsell</a></li>\n<li><a title=\"https://blog.dembowski.net/2015/thank-you-wpmom-for-everything/\" href=\"https://blog.dembowski.net/2015/thank-you-wpmom-for-everything/\">Thank you #wpmom for everything</a></li>\n<li><a title=\"http://werdswords.com/farewell-old-friend/\" href=\"http://werdswords.com/farewell-old-friend/\">Farewell old friend</a></li>\n</ul>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 05 Jan 2015 16:28:29 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Jeff Chandler\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";a:10:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Wed, 14 Jan 2015 15:28:43 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:14:\"content-length\";s:6:\"271031\";s:10: