2>Programas de productividad</h2>\n</div>\n<div id=\"accordion2\" class=\"programas\">\n<h3>Costo por kilómetro <img class=\"prog_icono\" src=\"[bloginfo key=\'template_url\']/images/programas_icon.png\" alt=\"\" /></h3>\n<div class=\"programas_conten\"><img src=\"[bloginfo key=\'template_url\']/images/programa1_xl.png\" alt=\"mantenimiento predictivo\" />\n<div class=\"programas_txt\">A través de un plan de seguimiento a las muestras de aceite, por parte de ingenieros especializados, se logra extender el período de cambio de aceite logrando un mejor costo x kilómetro.\n<ul>\n	<li>Mejor costo por kilómetro</li>\n	<li>Ahorro cuantificado por menos cambios de aceite realizados en el año.</li>\n</ul>\n</div>\n</div>\n<h3>Mantenimiento predictivo por estado de muestra de aceite <img class=\"prog_icono\" src=\"[bloginfo key=\'template_url\']/images/programas_icon.png\" alt=\"\" /></h3>\n<div class=\"programas_conten\"><img src=\"[bloginfo key=\'template_url\']/images/programa5_xl.png\" alt=\"mantenimiento predictivo\" />\n<div class=\"programas_txt\">Se toma una muestra de aceite en cada cambio realizado, esta es analizada para determinar si existen contaminantes que afecten el motor o componentes del vehículo (transmisión y diferencial).\n<ul>\n	<li>Permite anticiparse a daños progresivos en el motor o componentes ocasionados por tierra, hollín y combustible.</li>\n	<li>Permite verificar el desgaste anormal de piezas del motor con el fin de tomar acciones preventivas.</li>\n</ul>\n</div>\n</div>\n<h3>Mantenimiento en tiempo real <img class=\"prog_icono\" src=\"../img/programas_icon.png\" alt=\"\" /></h3>\n<div class=\"programas_conten\"><img src=\"../img/programa3_xl.png\" alt=\"mantenimiento en tiempo real Cummins\" />\n<div class=\"programas_txt\">Solución de mantenimiento que permite que el motor Cummins electrónico informe en tiempo real como se encuentran las variables más importantes de funcionamiento (presión de aceite, temperatura de refrigerante o presión de múltiple de admisión, entre otras variables) y sus respectivos códigos de falla que permitirán tomar las acciones correspondientes en el momento indicado.\n<ul>\n	<li>Permite conocer el cumplimiento de entregas.</li>\n	<li>Integra mantenimiento con operación.</li>\n	<li>Profesionaliza a los conductores.</li>\n	<li>Hace tangibles los beneficios de su inversión.</li>\n	<li>Aprovecha al máximo la vida útil de las partes Cummins.</li>\n	<li>Reducir el costo por kilómetro de su operación.</li>\n	<li>Incrementa la disponibilidad.</li>\n	<li>Monitoreo del nivel de urea.</li>\n</ul>\n</div>\n</div>\n<h3>Test tire <img class=\"prog_icono\" src=\"../img/programas_icon.png\" alt=\"\" /></h3>\n<div class=\"programas_conten\"><img src=\"../img/programa2_xl.png\" alt=\"frenos suspensión\" />\n<div class=\"programas_txt\">A través de un moderno programa se realiza el seguimiento al desgaste de llantas.\n<ul>\n	<li>Control y programación en el cambio o reencauche de llantas.</li>\n</ul>\n</div>\n</div>\n</div>','Programas de productividad','','inherit','open','open','','2-autosave-v1','','','2014-12-15 21:42:08','2014-12-15 21:42:08','',2,'http://localhost/laflota/?p=53',0,'revision','',0),(54,1,'2014-12-15 20:45:01','2014-12-15 20:45:01','<div class=\"titulos\">\r\n		<img src=\"../img/productividad_icono.png\" alt=\"productividad\">\r\n		<h2>Programas de productividad</h2>			\r\n	</div>\r\n\r\n	<div id=\"accordion2\" class=\"programas\">\r\n	<h3>Costo por kilómetro <img class=\"prog_icono\" src=\"../img/programas_icon.png\" /></h3>\r\n	<div class=\"programas_conten\">\r\n		<img src=\"../img/programa1_xl.png\" alt=\"mantenimiento predictivo\" />\r\n		<div class=\"programas_txt\">A través de un plan de seguimiento a las muestras de aceite, por parte de ingenieros especializados, se logra extender el período de cambio de aceite logrando un mejor costo x kilómetro.<br/><br/>\r\n		<ul>\r\n			<li>Mejor costo por kilómetro</li>\r\n			<li>Ahorro cuantificado por menos cambios de aceite real