lose cerrar\">close</a>\r\n								<div class=\"ca-content-text respaldo_adicional_txt\">\r\n									<p>Potencia cuenta con un amplio catálogo de repuestos genuinos para realizar el mantenimiento preventivo o correctivo en motores Cummins. También con la infraestructura necesaria para prestar un servicio oportuno y eficaz.</p>\r\n									<p>Energía comercializa los productos Cummins Power Generation con enfoque en soluciones completas y proyectos llave en mano.</p>\r\n\r\n								</div>\r\n\r\n								<ul>\r\n									<li><a href=\"http://www.cumandes.com.co\" target=\"_blank\">www.cumandes.com.co</a></li>\r\n								</ul>\r\n							</div>\r\n						</div>\r\n					</div>\r\n					<div class=\"ca-item respaldo_info\">\r\n						<div class=\"ca-item-main\">\r\n							<img src=\"[bloginfo key=\'template_url\']/images/respaldo_logo2.png\" alt=\"cummins de los andes\">\r\n							<h4>\r\n								<span>GAF es un concepto de productividad en el cual se optimiza la calidad de fluidos como: aire, aceite, combustible y refrigerante que interactúan con motores diesel o gas.</span>\r\n							</h4>\r\n								<a href=\"#\" class=\"ca-more mas_info\">+ Más información</a>\r\n						</div>\r\n						<div class=\"ca-content-wrapper \">\r\n							<div class=\"ca-content respaldo_adicional\">\r\n								<h6>GAF</h6>\r\n								<a href=\"#\" class=\"ca-close cerrar\">close</a>\r\n								<div class=\"ca-content-text respaldo_adicional_txt\">\r\n									<p>El objetivo de GAF es aumentar la productividad de la operación, al reducir costos, aumentar la disponibilidad de los equipos y disminuir el impacto ambiental, por medio de tecnologías y procedimientos que optimizan los fluídos de los equipos. </p>\r\n\r\n								</div>\r\n\r\n								<ul>\r\n									<li><a href=\"http://www.gaf.com.co\" target=\"_blank\">www.gaf.com.co</a></li>\r\n								</ul>\r\n							</div>\r\n						</div>\r\n					</div>\r\n					<div class=\"ca-item respaldo_info\">\r\n						<div class=\"ca-item-main\">\r\n							<img src=\"[bloginfo key=\'template_url\']/images/respaldo_logo3.png\" alt=\"cummins de los andes\">\r\n							<h4>\r\n								<span>Equitel cuenta con participación accionaria en Prolub, licenciataria de la marca Gulf Oil International para Colombia.</span>\r\n							</h4>\r\n								<a href=\"#\" class=\"ca-more mas_info\">+ Más información</a>\r\n						</div>\r\n						<div class=\"ca-content-wrapper \">\r\n							<div class=\"ca-content respaldo_adicional\">\r\n								<h6>Prolub</h6>\r\n								<a href=\"#\" class=\"ca-close cerrar\">close</a>\r\n								<div class=\"ca-content-text respaldo_adicional_txt\">\r\n									<p>Prolub es reconocida como una empresa de soluciones a las necesidades de combustibles y lubricación dedicada al almacenamiento, comercialización y distribución nacional de productos derivados del petróleo. </p>\r\n\r\n								</div>\r\n\r\n								<ul>\r\n									<li><a href=\"http://www.gulfcolombia.com\" target=\"_blank\">www.gulfcolombia.com</a></li>\r\n								</ul>\r\n							</div>\r\n						</div>\r\n					</div>\r\n\r\n				</div>\r\n			</div>','Respaldo','','inherit','open','open','','16-revision-v1','','','2014-12-16 22:48:22','2014-12-16 22:48:22','',16,'http://localhost/laflota/?p=78',0,'revision','',0),(79,1,'2014-12-16 22:49:02','2014-12-16 22:49:02','<div class=\"titulos\">\r\n		<img src=\"[bloginfo key=\'template_url\']/images/respaldo_icono.png\" alt=\"aliados\">\r\n		<h2>Respaldo</h2>	\r\n	</div>\r\n	<p>La Flota cuenta con el respaldo de 3 compañías que se enfocan en el desarrollo de soluciones de productividad para sus clientes. Cuenta con socios como Prolub, fabricante y distribuidor de lubricantes Gulf en Colombia.</p>\r\n\r\n	<div id=\"ca-container\" class=\"ca-container respaldo_conten\">\r\n				<div class=\"ca-wrapper\">\r\n					<div class=\"ca-item respaldo_info\">\r\n						<div class=\"ca-item-main\">\r\n							<img src=\"[bloginfo key=\'template_url\']/images/respaldo_logo1.png\" alt=\"cummins de los andes\">\r\n							